INSERT INTO `blogs` (`blog_id`, `title_1`, `title_2`, `content`, `image_file_2`, `image_file_3`, `linked_product_id`, `create_date`, `type`) VALUES
(5, 'Перга «Пчелиный хлеб» .', 'Eда или лекарство?', '&lt;p&gt;Перга &amp;laquo;Пчелиный хлеб&amp;raquo; - настоящая копилка витаминов и микроэлементов. 28 полезных веществ, среди которых витамины B1, C, B6, E, P, позволяют врачам назначать пергу в качестве лечебного питания. Герметичная упаковка поможет на долгий срок сохранить пищевую и лечебную ценность продукта.&lt;/p&gt;\r\n\r\n&lt;p&gt;Рекомендуется употреблять пергу с мёдом. Это усиливает терапевтический эффект и вкусовые качества &amp;laquo;Пчелиного хлеба&amp;raquo;. Из всех продуктов пчеловодства перга реже всего вызывает аллергические реакции и может использоваться даже в детском питании.&amp;nbsp; Большое применение перга нашла в народной медицине: на ее основе делают настои и мази.&lt;/p&gt;\r\n\r\n&lt;p&gt;Взрослому человеку для витаминной поддержки и тонизирования организма будет достаточно половины чайной ложки. Для достижения наилучшего эффекта &amp;laquo;Пчелиный хлеб&amp;raquo; нужно поместить под язык и держать там до полного растворения. Не рекомендуется запивать пергу кофе и алкогольными напитками.&amp;nbsp;&lt;/p&gt;\r\n', '/images/2017-10-0316-47-40_18-32-41.JPG', '/images/2017-10-0316-47-40_18-32-41.JPG', 748, 1514964883, 'standart'),
(6, 'Бортевой дикий мед: ', 'дары леса на нашем столе', '&lt;p&gt;Бортевой мед &amp;ndash; это мед диких пчел. Необычное название произошло от слова &amp;laquo;борть&amp;raquo; - так в старину назывался улей, сделанный из цельной деревянной колоды. В России признанным лидером считается мед, собранный башкирскими бортниками. Сбор меда диких пчел &amp;ndash; тяжёлый изнурительный труд.&lt;/p&gt;\r\n\r\n&lt;p&gt;Стоит ли говорить, что мед, собранный в лесу &amp;ndash; экологически чистый продукт, обладающий более выраженным лечебным воздействием, чем его пасечный собрат. Состав меда включает в себя фолиевую кислоту, калий, йод и другие важные для организма компоненты. Цвет меда варьируется от белых до шоколадных оттенков в зависимости от района сбора. Бортевой мед благотворно влияет на желудочно-кишечный тракт и мочеполовую систему.&lt;/p&gt;\r\n\r\n&lt;p&gt;Любой мед лучше хранить в стеклянной или керамической таре, так он на долгий срок сохранит свои полезные свойства. Срок хранения дикого меда значительно дольше пасечного. &amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n', '/images/2017-10-0316-46-33_18-51-43.JPG', '/images/2017-10-0316-46-33_18-51-43.JPG', 752, 1514964969, 'standart'),
(7, 'Маринованные каперсы ', '- пикантный штрих ', '&lt;p&gt;Что такое каперсы? Многие считают, что это овощи, фрукты или, на худой конец, ягоды. Вовсе нет. Каперсы &amp;ndash; это бутоны каперсника, колючего, но весьма целебного кустарника.&lt;/p&gt;\r\n\r\n&lt;p&gt;Каперсы обрели заслуженное признание как среди мэтров от кулинарии, так и у простых хозяек. Их плоды придутся по вкусу тем, кто любит маринованные огурчики.&lt;/p&gt;\r\n\r\n&lt;p&gt;Они идеально подойдут к следующим продуктам: говядине, баранине, овощным заправкам со сладким перцем или сельдереем.&amp;nbsp; Отдельные гурманы предпочитают бутерброды с каперсами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Каперсы не только обладают изысканным вкусом, они помогают замедлить процесс старения поскольку в них содержится большое количество витамина Е, называемого иногда витамином молодости.&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Открытая банка каперсов может храниться довольно долгое время, иногда до нескольких месяцев. Идеальные условия для хранения каперсов: температурный режим от 0 до 25 градусов при относительной влажности не более 75 процентов.&lt;/p&gt;\r\n', '/images/2017-09-2913-20-24_15-39-36.JPG', '/images/2017-09-2913-20-24_15-39-36.JPG', 309, 1514965021, 'standart'),
(8, 'Фермерское сливочное масло, ', 'нежность и вкус', '&lt;p&gt;Сливочное масло используют почти во всех областях кулинарии. Любая хозяйка знает выражение &amp;ldquo;кашу маслом не испортишь&amp;rdquo;, особенно если это настоящее фермерское масло, сбитое из густых коровьих сливок.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сливочное масло состоит из тех же белков, жиров и углеводов, что и молоко, но в других пропорциях. Этот уникальный продукт содержит одновременно водо- и жирорастворимые витамины и обладает высокой калорийностью. Летнее и зимнее сливочное масло различается по составу, который зависит от рациона коровы.&lt;/p&gt;\r\n\r\n&lt;p&gt;Масло благотворно влияет на слизистую желудка, а холестерин, входящий в его состав, необходим для выработки ряда гормонов.&lt;/p&gt;\r\n\r\n&lt;p&gt;Традиционно масло используют при приготовлении бутербродов, подливок, заправки супов, придавая им характерный сливочный привкус. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Важно следить за условиями хранения продукта, оптимальный температурой для масла считается +6 градусов.&amp;nbsp; &amp;nbsp;Герметичная упаковка сохранит все полезные качества и увеличит срок годности продукта.&lt;/p&gt;\r\n', '/images/2017-11-1315-37-39_22-25-15.JPG', '/images/2017-11-1315-37-39_22-25-15.JPG', 1847, 1514965109, 'standart'),
(9, 'Томатный соус к пасте: ', 'выбираем правильно', '&lt;p&gt;Классическую итальянскую пасту сложно представить без помидоров. Польза томатов неоспорима, причем даже в законсервированном виде они сохраняют большое количество полезных веществ. В них содержатся винная, лимонная, яблочная кислоты, витамины A, B2, B6, PP, E, K, минеральные соли, фруктоза, глюкоза и йод.&lt;/p&gt;\r\n\r\n&lt;p&gt;Вы удивитесь, но в помидорах присутствует естественный антибиотик кварцетин, который &amp;nbsp;поддерживает иммунитет.&lt;/p&gt;\r\n\r\n&lt;p&gt;Чтобы правильно подобрать соус к пасте, обратите внимание на макароны. Длинные макаронные изделия &amp;ndash; спагетти &amp;ndash; хорошо сочетаются с нежным соусом жидкой консистенции. Короткие макароны с крупными отверстиями могут подаваться с густыми соусами, содержащими кусочки овощей, мяса, рыбы.&lt;/p&gt;\r\n\r\n&lt;p&gt;Agromonte Cherry Tomato Pasta Sause &amp;ndash; насыщенный соус с ярким вкусом помидоров черри и чеснока имеет среднюю консистенцию и подойдет к любой разновидности пасты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Если хотите добавить блюду больше аромата и пикантности, украсьте его свежим листочком базилика.&lt;/p&gt;\r\n', '/images/2017-11-2217-21-26_22-58-20.JPG', '/images/2017-11-2217-21-26_22-58-20.JPG', 3317, 1514965164, 'standart'),
(10, 'Камамбер: нежность ', ' сливок в грибной корочке', '&lt;p&gt;Название сыру Камамбер дала французская деревня, неподалеку от которой расположен памятник целебным свойствам этого продукта. О целебных свойствах сыра сложены легенды. Несколько веков назад доктор из городка Вимутье стал рекомендовать этот продукт тяжелобольным людям, и добился высоких результатов в лечении.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сыр Камамбер богат витаминами, важнейшими микроэлементами и аминокислотами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Технология изготовления камамбера сложная, многоэтапная и требует соблюдения температурного режима. Продукт производят с сентября по май. Транспортируется сыр в особой упаковке, хранится недолго, поэтому на столе у покупателей всегда будет свежий продукт.&lt;/p&gt;\r\n\r\n&lt;p&gt;Этот вид сыра очень ценится гурманами, идеально сочетается с хорошим белым или розовым вином, является ингредиентом многих французских деликатесов (соусов, супов, десертов).&lt;/p&gt;\r\n\r\n&lt;p&gt;Нужно быстро придумать легкую закуску для небольшого фуршета? Сделайте сырную тарелку, сердцем которой станет Кamembert.&lt;/p&gt;\r\n', '/images/2017-11-1317-06-28_00-02-09.JPG', '/images/2017-11-1317-06-28_00-02-09.JPG', 1802, 1514965264, 'standart'),
(11, 'Артишоки - вкусные ', 'соцветия для гурманов', '&lt;p&gt;Для консервирования и маринования подходят маленькие и средние артишоки. Особым почтением они пользуются у любителей итальянской кухни. В Италии ими можно лакомиться целых восемь месяцев в году! Эти продукты обладают полезными свойствами: тонизируют, омолаживают организм, помогают в борьбе с множеством заболеваний, очищают кровь, выводят токсины, способствуют выведению камней из почек, к тому же это мощные антиоксиданты. В них содержатся кальций, железо, фосфор, натрий, калий, множество витаминов. Это диетический продукт с низкой калорийностью, способствующий быстрому сжиганию жира.&lt;/p&gt;\r\n\r\n&lt;p&gt;Из этого продукта можно приготовить сотни блюд итальянской кухни, холодных и горячих. Артишоки подают как самостоятельное блюдо или в составе супов, салатов, пицц, начинки для тарталеток, а порой даже в качестве ингредиента для десертов.&lt;/p&gt;\r\n\r\n&lt;p&gt;Есть мнение, что артишоки являются отличными афродизиаками. Прекрасный повод приготовить блюдо с ними для романтического ужина!&lt;/p&gt;\r\n', '/images/2017-09-2913-26-09_15-08-36_15-12-00.JPG', '/images/2017-09-2913-26-09_15-08-36_15-12-00.JPG', 292, 1514965420, 'standart'),
(12, 'тест 1', 'тест 2', '&lt;p&gt;фываываыва&lt;/p&gt;\r\n', '/assets/img/blogs/de0abe2d97a948b6.jpg', '/assets/img/blogs/1a9ff8c0b1d4de24.jpg', 0, 1514976979, 'provider');
