('TC-1-13-031', 1, 189, '', 'Ijevan', 'Абрикосовый сок', NULL, 'Абрикосы', 'Армения', 180, 23, 0, 0, 'шт', '2017-09-2714-46-15_11-00-12.JPG', 'шт', '1 л', 0, 0, 0, 'Абрикосовый сок Ijevan прямиком с родины абрикос. Натуральный продукт, наполненный солнцем Армении. ', '', 'Абрикосы свежие ,сок прямого отжима.\n', '2 года ', 'ЗАО «Иджеванский Винно-Коньячный Завод» ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '184.2 ', '0', '0', '11', '', 'cA25BmiVKqM;', '', 0, 'YToyOntpOjA7czo3NDoiaHR0cHM6Ly9yb3pldGthLmNvbS51YS9pamV2YW5fNDg1MDAwMTAzMjY4Ny9wMjcxNTAyMTcvI3RhYj1jaGFyYWN0ZXJpc3RpY3MiO2k6MTtzOjQ1OiJodHRwOi8vd3d3LmlqZXZhbmdyb3VwLmFtL3Byb2R2aWV3LnBocD9pZHA9ODUiO30='),
('TC-1-13-031', 1, 190, '', 'Ijevan', 'Персиковый сок', NULL, 'Персики', 'Армения', 180, 23, 0, 0, 'шт', '2017-09-2714-46-07_11-01-00.JPG', 'шт', '1 л', 0, 0, 0, 'Персиковый сок Ijevan производится из чистейших фруктов, собранных вручную в солнечной Армении. Получается и очень вкусно, но и очень полезно!\n\n', '', 'Персиковое пюре, сахар и глюкозно-фруктозный сироп, регулятор кислотности - лимонная кислота, вода.', '1 год', 'ЗАО «Иджеванский Винно-Коньячный Завод»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', ' 50 ', '0', '0', '13', '', 'cA25BmiVKqM;', '', 0, ''),
('TC-1-13-031', 1, 191, '', 'Ijevan', 'Компот ассорти домашний', NULL, 'ассорти', 'Армения', 150, 23, 0, 0, 'шт', '2017-09-2714-46-00_11-08-47.JPG', 'шт', '1 л', 0, 0, 0, 'Вишня, жёлтая слива, абрикосы, персики и другие фрукты составляют потрясающий ансамбль, который называется - Домашний Компот Ijevan Ассорти. Ощутите домашний вкус!', '', 'Персик, абрикос, черешня, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода. \nНе содержит консервантов, искусственных ароматизаторов и красителей. Хранить при температуре от 0 до +20˚С и относительной влажности воздуха не более 75%. \nВскрытую тару хранить в холодильнике не более 3 дней. ', '2 года', 'ЗАО «Иджеванский Винно-Коньячный Завод» ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46', '0', '0', '11,3', '', 'cA25BmiVKqM;', '', 0, ''),
('TC-1-13-031', 1, 192, '', 'Ijevan', 'Абрикосовый компот', NULL, 'Абрикосы', 'Армения', 150, 23, 0, 0, 'шт', '2017-09-2714-45-50_11-09-20.JPG', 'шт', '1 л', 0, 0, 0, 'Сколько компотов из абрикос не вари, а армянский всё равно получится лучше!Самые лучше абрикосы растут в Армении. Попробуйте  частичку нашей родины в бутылочке с подписью \"Ijevan Абрикосовый Компот\"!\n\n', '', 'Абрикос, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода.\nНе содержит консервантов, искусственных ароматизаторов и красителей. Хранить при температуре от 0 до +20˚С и относительной влажности воздуха не более 75%. \nВскрытую тару хранить в холодильнике не более 3 дней. ', '2 года', 'ЗАО «Иджеванский Винно-Коньячный Завод» ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46', '0', '0', '11,3 ', '', 'cA25BmiVKqM;', '', 0, ''),
('TC-1-13-031', 1, 193, '', 'Ijevan', 'Айвовый компот', NULL, 'Айва', 'Армения', 150, 23, 0, 0, 'шт', '2017-09-2714-45-38_11-09-59.JPG', 'шт', '1 л', 0, 0, 0, 'Кисло-сладкий айвовый компот Ijevan готовится из спелой айвы, которую собрали  в Араратской долине и на территории Тавушского региона Армении. Этот полезный и в тоже время вкусный   напиток будет очень кстати в любую погоду и в любое время года.\n\n', '', 'Айва свежая, сахар-песок, вода.Не содержит консервантов, искусственных ароматизаторов и красителей. Хранить при температуре от 0 до +20˚С и относительной влажности воздуха не более 75%. Вскрытую тару хранить в холодильнике не более 3 дней. \n', '2 года', ' ЗАО «Иджеванский Винно-Коньячный Завод»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '61,2', '0', '0', '14,8', '', 'cA25BmiVKqM;', '', 0, 'YToyOntpOjA7czo0NzoiaHR0cDovL3d3dy5tb25vcGlyLnJ1L0NvbXBvdGUvSWpldmFuL3F1aW5jZS0xLWwiO2k6MTtzOjY0OiJodHRwOi8vYXJtc2hvcC5ydS9jYXRhbG9nL2tvbXBvdHkva29tcG90LWlkemhldmFuLWF5dm92eXktMTAwMGcvIjt9'),
('TC-1-13-031', 1, 194, '', 'Ijevan', 'Компот из дикой груши', NULL, 'Груши', 'Армения', 150, 23, 0, 0, 'шт', '2017-09-2714-45-30_11-10-51.JPG', 'шт', '1 л', 0, 0, 0, 'Ещё в старые времена из дикой груши часто варили компоты. В те времена этот напиток ценился за свои целебные качества. На сегодняшний день  мы можем оценить ещё и его  необычный вкус.\n\n', '', 'Груша, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода. \nНе содержит консервантов, искусственных ароматизаторов и красителей. Хранить при температуре от 0 до +20˚С и относительной влажности воздуха не более 75%. \nВскрытую тару хранить в холодильнике не более 3 дней. ', '2 года', 'ЗАО «Иджеванский Винно-Коньячный Завод» ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46', '0', '0', '11,3', '', 'cA25BmiVKqM;', '', 0, ''),
('TC-1-13-031', 1, 195, '', 'Ijevan', 'Персиковый нектар', NULL, 'Персики', 'Армения', 180, 23, 0, 0, 'шт', '2017-09-2714-45-21_11-11-28.JPG', 'шт', '1 л', 0, 0, 0, 'Именно в персике соединено все самое лучшее - бархатистая кожица, освежающий кисло- сладкий вкус и несравнимый аромат и сочная мякоть .\nПерсиковый нектар не только вкусен, но и полезен.', '', 'Персики свежие, сахар песок, лимонная кислота, вода питьевая.', '2 года', ' ЗАО «Иджеванский Винно-Коньячный Завод»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '40', '0', '0', '10 ', '', 'cA25BmiVKqM;', '', 0, ''),
('TC-1-13-031', 1, 196, '', 'Ijevan', 'Облепиховый нектар', NULL, 'Облепиха', 'Армения', 190, 23, 0, 0, 'шт', '2017-09-2714-45-12_11-12-30.JPG', 'шт', '1 л', 0, 0, 0, 'Благодаря своей исключительной полезности облепиха уже завоевала себе всемирную любовь. Попробовав облепиховый нектар  вы почувствуйте— кладезь витаминов и прекрасный вкус!', '', 'Облепиховое пюре не менее 25%, сахар, вода.', '1,5 года', 'ЗАО «Иджеванский Винно-Коньячный Завод»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', ' 49', '0', '0', '13,4', '', 'cA25BmiVKqM;', '', 0, ''),
