('TC-1-7-047', 1, 269, '', 'Dial Export', 'Рисовое масло', NULL, 'Рис', 'Россия', 305, 20, 0, 0, 'шт', '2017-09-2913-31-11_14-45-40.JPG', 'шт', '500 мл', 0, 0, 0, 'Производится из рисовых отрубей. Это традиционный продукт восточной кухни – японской, китайской и корейской. Характеризуется высокой температурой дымления, что позволяет хозяйкам жарить на нем без вреда для здоровья. Рисовое масло отличается высоким содержанием полиненасыщенных жирных кислот и природных антиоксидантов, которые замедляют старение организма. Масло широко применяется в кулинарии и косметологии.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.\n', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1MjoiaHR0cDovL2RpYWxleHBvcnQucnUvbWFzbG8tcmlzb3ZvZS9tYXNsby1yaXNvdm9lLTA1LyI7fQ=='),
('TC-1-7-047', 1, 270, '', 'Dial Export', 'Хлопковое масло', NULL, 'Хлопок', 'Россия', 190, 20, 0, 0, 'шт', '2017-09-2913-31-03_14-46-24.JPG', 'шт', '500 мл', 0, 0, 0, 'Хлопковое масло получают из семян хлопчатника. Оно особенно популярно в Средней Азии, однако завоевывает всё большую популярность у потребителей по всему миру.Хлопковое масло в кулинарии применяется в первую очередь для плова, салатов, жарки, во фритюре, для приготовления в воке (китайская кухня), оно не пропитывает продукт, а создаёт хрустящую корочку. Это незаменимый продукт блюд восточной кухни. Оно также издревле применялось в народной медицине для лечения ожогов и кожных заболеваний.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1MDoiaHR0cDovL2RpYWxleHBvcnQucnUvaGxvcGtvdm9lL21hc2xvLWhsb3Brb3ZvZS0wNS8iO30='),
('TC-1-7-047', 1, 271, '', 'Dial Export', 'Кукурузное масло', NULL, 'Кукуруза', 'Россия', 200, 20, 0, 0, 'шт', '2017-09-2913-30-55_14-46-59.JPG', 'шт', '500 мл', 0, 0, 0, 'Масло кукурузы получают из зародышей золотистых семян растения, содержащих множество биологических веществ, необходимых человеческому организму. Оно богато линолевой кислотой, которая повышает сопротивляемость организма и регулирует свертываемость крови, а также является ценным источником витаминов. Помимо токоферола, кукурузное масло содержит витамины F, B1, PP, провитамин А.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1MjoiaHR0cDovL2RpYWxleHBvcnQucnUva3VrdXJ1em5vZS9tYXNsby1rdWt1cnV6bm9lLTA1LyI7fQ==');
