('TC-1-7-047', 1, 272, '', 'Dial Export', 'Масло облепиховое', NULL, 'Облепиха', 'Россия', 395, 20, 0, 0, 'шт', '2017-09-2913-30-49_14-47-37.JPG', 'шт', '500 мл', 0, 0, 0, 'Это масло выделяется благодаря своему насыщенному красно-оранжевому цвету и специфическому приятному запаху. Масло из облепихи DIAL EXPORT не является БАДом, оно применяется в кулинарии и обладает большим количеством лечебно-профилактических свойств. Среди других масел оно выделяется благодаря содержанию витаминов группы В, витамина А, РР, Е, С, каротиноидов (около 40%) и многих микроэлементов. Является природным антибиотиков, повышает тонус и иммунитет. Нагревать не рекомендуется!', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Масло имеет ярко-оранжевый цвет, который обусловливают каротиноиды — предшественники витамина А. Продукт насыщен токоферолами (витамин Е), а также аскорбиновой кислотой (витамин С). Другие полезные составляющие: Омега-3, Омега-6, Омега-9, фосфолипиды, аминокислоты, 27 минералов.Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898 ', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-047', 1, 273, '', 'Dial Export', 'Масло арахиса', NULL, 'Арахис', 'Россия', 350, 20, 0, 0, 'шт', '2017-09-2913-30-37_14-48-15.JPG', 'шт', '500 мл', 0, 0, 0, 'Его отличает насыщенный ореховый вкус и тонкий, изысканный аромат. Производится из ядер арахиса. Масло арахиса – это питательный пищевой продукт, он обладает высокой энергетической ценностью и способствует быстрому насыщению. Применяется для заправки салатов, жарки и тушения мясных и овощных блюд, для приготовления выпечки. Применяется в косметологии.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898 ', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1MToiaHR0cDovL2RpYWxleHBvcnQucnUvbWFzbG8tYXJhaGlzL21hc2xvLWFyYWhpc2EtMDUvIjt9'),
('TC-1-7-047', 1, 274, '', 'Dial Export', 'Масло чесночное', NULL, 'Чеснок', 'Россия', 380, 20, 0, 0, 'шт', '2017-09-2913-30-23_14-48-56.JPG', 'шт', '500 мл', 0, 0, 0, 'Благодаря высокому содержанию фитонцидов,  оно повышает сопротивляемость организма к простудным заболеваниям, стимулирует работу желудка и кишечника, способствует развитию нормальной микрофлоры. Основная сфера применения чесночного масла – кулинария, и это немудрено: пикантный вкус и насыщенный аромат делают его удачной заправкой как для салатов, так и для горячих блюд! Попробуйте добавить чесночное масло в отварной картофель или мясные блюда – вкус Вас обязательно порадует!', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. В состав данного продукта входят азотистые соединения, полисахариды, фитонциды, фитостерины, никотиновая кислота, витамины группы B, минеральные соединения (фосфор, железо, йод, калий, кальций и др.).Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898 ', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1NDoiaHR0cDovL2RpYWxleHBvcnQucnUvY2hlc25vY2hub2UvbWFzbG8tY2hlc25vY2hub2UtMDUvIjt9'),
('TC-1-7-047', 1, 275, '', 'Dial Export', 'Масло конопляное', NULL, 'Конопля', 'Россия', 700, 20, 0, 0, 'шт', '2017-09-2913-30-14_14-49-34.JPG', 'шт', '500 мл', 0, 0, 0, 'Конопляное масло – это продукт, получаемый из семян растения, которое относится к семейству Коноплевых.Масло темное, может иметь зеленоватый оттенок, на вкус – с небольшой кислинкой, запах слабый, приятный. Получают его путем холодного отжима. По содержанию омега-3 и омега-6 — полиненасыщенных жирных кислот, рекомендуемых при профилактике и лечении заболеваний сердечно-сосудистой, нервной системы, ожирении — почти догоняет льняное масло. Богато антиоксидантами, фитостеролами, жирорастворимыми витаминами и минеральными веществами.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898 ', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1NDoiaHR0cDovL2RpYWxleHBvcnQucnUva29ub3BseWFub2UvbWFzbG8ta29ub3BseWFub2UtMDUvIjt9'),
('TC-1-7-047', 1, 276, '', 'Dial Export', 'Масло черного тмина', NULL, 'Тмин', 'Россия', 650, 20, 0, 0, 'шт', '2017-09-2913-29-50_14-55-37.JPG', 'шт', '500 мл', 0, 0, 0, 'МАСЛО СОДЕРЖИТ БОЛЬШОЕ КОЛИЧЕСТВО ПОЛИНЕНАСЫЩЕННЫХ  ЖИРНЫХ КИСЛОТ, КРАЙНЕ НЕОБХОДИМЫХ ДЛЯ ПРОФИЛАКТИКИ И ЛЕЧЕНИЯ МНОГИХ БОЛЕЗНЕЙ. Подобные кислоты в таком процентном соотношении содержатся только в морепродуктах. Помимо этого, в масле присутствуют витамины А, Е и Д, бета-каротин, кальций, фосфор, железо, медь и другие макро- и микроэлементы, способствующие нормализации функций всех систем организма человека.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Продукт содержит большое количество необходимых организму полиненасыщенных жирных кислот. Также в нем есть витамины А, Д, Е, бета-каротин, фосфор, кальций, железо, медь и другие макро- и микроэлементы. Готовый продукт, расфасованный имеет насыщенный пряный аромат и немного горьковатый вкус. Масло не содержит искусственных добавок и производит заметный лечебный эффект на организм при ревматизме, аллергических заболеваниях, кишечных инфекциях.Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898 ', '', '', '', '', 'ToPJ-8iUNxM;', '', 0, 'YToxOntpOjA7czo1MDoiaHR0cDovL2RpYWxleHBvcnQucnUvY2hlcm55ai10bWluL2NoZXJueWlfdG1pbl8wNS8iO30='),
('TC-1-7-047', 1, 277, '', 'Василево', 'Кунжутное масло', NULL, 'Кунжут', 'Россия', 300, 20, 0, 0, 'шт', '2017-09-2913-29-38_14-56-13.JPG', 'шт', '250 мл', 0, 0, 0, 'По своему вкусу оно напоминает масло, получаемое из оливок. Масло из семян широко применяется при консервировании и производстве кондитерских изделий, а также в области медицины.', '', 'Изготовлено из сырых семян кунжута.Не содержит консервантов и ароматизаторов. ', '', 'ООО \"Василево\" ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '565', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-047', 1, 278, '', 'Василево', 'Горчичное масло', 'Горчичное масло остро-жгучее из семян белой горчицы ', 'Горчица', 'Россия', 150, 20, 0, 0, 'шт', '2017-09-2913-29-29.JPG', 'шт', '250 мл', 0, 0, 0, 'В отличие от других растительных масел, горчичное обладает значительной стойкостью к окислению, обуславливающей длительный срок хранения. Горчичное масло значительно превосходит по вкусовым и диетическим свойствам распространенное в России подсолнечное масло.', '', 'Масло получено методом холодного отжима.Благодаря современным технологиям прессования сохраняются все полезные свойства и витамины. Оно богато биологически активными веществами: калием, фосфором, а также витаминами А, D, Е, В3, В6. В составе горчичного масла в значительном количестве присутствуют линолевая и линоленовая кислоты.\n', '', 'ООО \"Василево\" ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
