('TC-1-7-047', 1, 286, NULL, 'Aroy-D', 'Соус сладкий Чили', NULL, 'Chilli', 'Таиланд', 230, 20, 0, 0, 'шт', '2017-09-2913-27-09_15-03-46.JPG', 'шт', '920 мл', 0, 0, 0, 'Кисло-сладкий с приятной остротой соус чили придаст блюду из птицы экзотический азиатский акцент.Сладкий соус чили для курицы великолепно подходит для подачи с жареной птицей, мясом и рыбой.', NULL, 'Сахар 40%, вода 30,18%, перец чили 22%, соль 4%, чеснок 2,5%, кукурузный крахмал,\nуксусная кислота, стабилизатор ксантеновая камедь. Особую пикантность придаст блюдам, приготовленным во фритюре и на гриле. Оригинален в качестве ингредиента для заправки мясных салатов.\nХранить в сухом месте при температуре от +5\'C до +30\'C. После вскрытия хранить в холодильнике, употребить в течение 1 месяца.', '24 месяцев', 'Thai Agri Foods Public CL.', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '216', '0,41', '0,26', '53', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-047', 1, 287, '', 'Barilla', 'Соус Basilico', 'Соус Basilico томатный с базиликом ', 'Basilico', 'Италия', 160, 20, 0, 0, 'шт', '2017-09-2913-26-56_15-04-32.JPG', 'шт', '400 мл', 0, 0, 0, 'Соус Basilico приготовлен из отборных продуктов – спелых томатов, свежих ароматных трав и качественного оливкового масла.', '', 'мякоть томата 71%, концентрат томатный 13,5%, лук, масло подсолнечное, базилик 2%, сахар, соль, натуральный ароматизатор.\nРекомендуется хранить при температуре 3°C-24°C. Открытую банку хранить в холодильнике не более 5 дней.', '21 мес.', 'Barilla G & R. Fratelli', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '61', '1.6', '2.7', '6.8', '0', 'lEpkQVLgxEs;gQQVqFXHcNA', '', 1, 'YToyOntpOjA7czo4NjoiaHR0cHM6Ly9mcmVzaGJyb2Njb2xpLnJ1L2NhdGFsb2cvMzQ2Ml9zb3VzLWJhc2lsaWNvLXRvbWF0bnl5LXMtYmF6aWxpa29tLWJhcmlsbGEtNDAwZy8iO2k6MTtzOjM5OiJodHRwczovL3d3dy51dGtvbm9zLnJ1L2l0ZW0vOTAyLzMyMTg1OTQiO30='),
('TC-1-7-047', 1, 288, '', 'Barilla', 'Соус Arrabbiata', 'Соус Arrabbiata томатный с перцем Чили', 'Arrabbiata', 'Италия', 160, 20, 0, 0, 'шт', '2017-09-2913-26-43_15-05-16.JPG', 'шт', '400 мл', 0, 0, 0, 'Соус Arrabbiata для тех, кто любит поострее. У соуса довольно густая консистенция, он идеально подходит к пасте с ребристой текстурой.', '', 'мякоть томата 70,4%, концентрат томатный 13%, лук, масло подсолнечное, сладкий перец\nкрасный, чеснок, петрушка, соль, крахмал рисовый, сахар, перец чили 0,1%. \nХранить при температуре от +3\'C до +24\'C. \nПосле вскрытия хранить в холодильнике не\nболее 5 суток.', '', 'Barilla G & R. Fratelli', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '58', '1.4', '3.1', '5.2', '0', 'lEpkQVLgxEs;gQQVqFXHcNA', '', 0, 'YToyOntpOjA7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzk0LzE5NDYwNjI3IjtpOjE7czo5MjoiaHR0cHM6Ly9mcmVzaGJyb2Njb2xpLnJ1L2NhdGFsb2cvMzQ2MV9zb3VzLWFycmFiYmlhdGEtdG9tYXRueXktcy1wZXJ0c2VtLWNoaWxpLWJhcmlsbGEtNDAwZy8iO30='),
('TC-1-7-047', 1, 289, '', 'Barilla', 'Соус Pecorino', 'Соус Barilla Pecorino', 'Pecorino', 'Италия', 240, 20, 0, 0, 'шт', '2017-09-2913-26-35_15-05-53.JPG', 'шт', '400 мл', 0, 0, 0, 'Готовые соусы для пасты Barilla - это комплексные, сбалансированные рецепты для приготовления полноценных, вкусных и питательных блюд из итальянской пасты.', '', 'томаты, подсолнечное масло, сыр, соль, кешью, изюм, крахмал, перец, перец сладкий, сахар, чеснок. Для приготовления настоящей итальянской пасты вам нужно отварить пасту, подогреть соус на сковородке с небольшим количеством оливкового масла и перемещать ингредиенты. Может применяться как дополнение к блюдам из мяса, рыбы и овощей.', '18 месяцев', 'Barilla G & R.', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '139', '3', '9.5', '9.6', '0', 'lEpkQVLgxEs;gQQVqFXHcNA', '', 0, 'YTozOntpOjA7czo0ODoiaHR0cHM6Ly93d3cub3pvbi5ydS9jb250ZXh0L2RldGFpbC9pZC8xMzYwMDAyODUvIjtpOjE7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzk0LzIzNDc4ODY5IjtpOjI7czowOiIiO30='),
