('TC-1-7-047', 1, 291, NULL, 'Barilla', 'Соус Bolognese', NULL, 'Bolognese', 'Италия', 220, 20, 0, 0, 'шт', '2017-09-2913-26-21_15-07-06.JPG', 'шт', '400 мл', 0, 0, 0, 'Bolognese – одна из самых вкусных и популярных заправок для пасты. Секрет в свежем фарше и хорошей томатной основе.', NULL, 'томаты измельченные 42,5%, вода, концентрат томатный, лук, масло подсолнечное, морковь 3,6%, соль, приправы, сахар, базилик 0,2%, чеснок. Способ приготовления: обжарьте мясной фарш, добавьте соус.\nПеремешайте с отваренной пастой.\nМожет применяться в качестве основного соуса к пасте или как дополнение к блюдам из мяса, рыбы и овощей.\nХранить в при температуре от +3\'C до +24\'C.\nОткрытую банку хранить в холодильнике не более 5 дней', '21 мес.', 'Barilla G & R. Fratelli', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '69', '1.3', '4', '6.2', '0', 'lEpkQVLgxEs;gQQVqFXHcNA', '', 0, 'YToyOntpOjA7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzkwMi8zMjE4NTk3IjtpOjE7czo3NToiaHR0cHM6Ly9mcmVzaGJyb2Njb2xpLnJ1L2NhdGFsb2cvMzQ2M19zb3VzLWJvbG9nbmVzZS10b21hdG55eS1iYXJpbGxhLTQwMGcvIjt9'),
