('Орех', 1, 374, '', '', 'Язык говяжий', 'Язык говяжий свежий', 'Язык говяжий', 'Россия', 0, 0, 0, 0, '', '14aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжий язык — ценный субпродукт первой категории. По сути, это сплошная мышца с шершавой оболочкой. Традиционно его варят, коптят или солят.Продукт является как самостоятельным блюдом, так и составной частью горячих и холодных блюд, салатов в десятках кухонь мира, в том числе русской, грузинской, украинской, китайской, бразильской. Говяжий язык считается деликатесом благодаря своему необычному вкусу и нежной структуре. Нередко это мясо включают в состав белковых диет.\n\n', '', '', '10 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '173', '16', '12,1', '2,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 1, 375, '', '', 'Печень говяжья', 'Печень говяжья', 'Печень говяжья', 'Россия', 0, 0, 0, 0, '', '15aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжья или телячья печень – мясной продукт, свежесть и польза которого легче всего определяется по цвету – он должен быть темно-красно или коричневый, строение ткани должно быть мелкозернистое, без желчных прожилок. Свежий продукт обладает слабым сладковатым запахом. После приготовления она сохраняет мягкий, тающий вкус и характерный аромат.', '', '', '10 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '127', '17,9', '3,7', '5,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 0, 376, NULL, '', 'Фасоль белая', NULL, 'Фасоль', NULL, 0, 0, 0, 0, NULL, '2017-10-0213-43-17_12-29-06.JPG', 'кг', NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 1, 377, '', '', 'Сердце говяжье', 'Сердце говяжье', 'Сердце говяжье', 'Россия', 0, 0, 0, 0, '', '13aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжье сердце — субпродукт первой категории, имеет упругую консистенцию. Свежий продукт отличается ярко-красным цветом с насыщенным коричневым оттенком.Сердце говядины настолько упругое, что способно полностью восстановить свою первоначальную форму при надавливании. Данное свойство напрямую связано с тем, что продукт практически полностью состоит из мышечной ткани, имеющей тонкие и упругие волокна.\n\n', '', '', '10 суток', '', -100, 100, 0, '0000-00-00', '0000-00-00', 1, 1, '', '96', '16', '3,5', '2,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
