('Орех', 1, 380, '', '', 'Вырезка свиная', 'Вырезка свиная свежая', 'Вырезка свиная', 'Россия', 0, 0, 0, 0, '', '6zzz.JPG', 'кг', '', 0, 0, 0, 'Свиная вырезка — самая ценная часть тушки свиньи. Она располагается в заднепоясничной части туловища, и представляет из себя поясничную мышечную ткань, находящуюся над почками свиньи возле поясничных позвонков. На протяжении периода существования, эта мышечная ткань практически не подвергается физическим нагрузкам, поэтому становится нежной, мягкой и обладает безупречным вкусом.', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '142', '19,4', '7,1', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 1, 381, '', '', 'Шея свиная', 'Шея свиная свежая', 'Шея свиная', 'Россия', 0, 0, 0, 0, '', '7zzz.JPG', 'кг', '', 0, 0, 0, 'Свиная шея, для которой характерна мягкость, нежность и наличии жировых прожилок. Мясо, срезанное со свиной шеи, хорошо тем, что в нем нет никаких жилок и накачанных мускул. . Употребляется в пищу преимущественно в жареном или запеченном виде.', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '198', '61,08', '38,92', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
