('Орех', 1, 383, '', '', 'Рулька свиная', 'Рулька свиная', 'Свинина', 'Россия', 0, 0, 0, 0, '', '8zzz.JPG', 'кг', '', 0, 0, 0, 'Польза свиной рульки заключается как раз в тех веществах, которые и позволяют холодцу стать холодцом. Это животные желерующиевещества, которые содержаться в костях, связках и хрящах. В холодце, который сварен из свиной рульки, содержится большое количество коллагена. Он повышает эластичность тканей и суставов человека. ', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '333', '18,6', '24,7', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 1, 384, '', '', 'Грудинка свиная', 'Грудинка свиная', 'Грудинка свиная', 'Россия', 0, 0, 0, 0, '', '9zzz.JPG', 'кг', '', 0, 0, 0, 'Свиная грудинка - часть мышечной ткани, расположенной поверх ребер домашней свиньи. Отличается наличием пленки и большого количества жира. В пищу употребляют в жареном, тушеном, вяленом и копченом виде.Свиная грудинка отлично сочетается с огромным количеством пищевых продуктов, особенно с овощами (картофель, капуста, бобовые), грибами, кисло-сладкими и острыми соусами, соусом, сыром, орехами, большинством приправ и специй.', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '170', '69,64', '30,36', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
