('Орех', 1, 387, '', '', 'Ножка свиная', 'Ножка свиная', 'Ножка свиная', 'Россия', 0, 0, 0, 0, '', '10zzz.JPG', 'кг', '', 0, 0, 0, ' Этот субпродукт относится к низкой категории. Вообще свиные ноги состоят из шкуры, костей и сухожилий. В них практически нет жира и мяса. Чаще всего используют ноги для получения желирующего эффекта, что дает возможность не использовать желатина или агар-агара для застывании бульона. Для этого субпродукт в течение длительного времени варят.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '216', '18', '16', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Орех', 1, 388, '', '', 'Печень свиная', 'Печень свиная', 'Печень свиная', 'Россия', 0, 0, 0, 0, '', '11zzz.JPG', 'кг', '', 0, 0, 0, 'Свиная печень – не только вкусный, но полезный продукт. Кухни разных стран предлагают гурманам сотни оригинальных рецептов, диетологи напоминают людям разного пола и возраста о пищевой ценности, лечебных свойствах печени.\n', '', '', '10 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '109', '18,8', '3,8', '4,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
