('TC-1-10-022', 1, 505, NULL, 'Ararat', 'Компот из терна', NULL, 'Терн', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-30-45_15-16-51.JPG', 'шт', '1 л', 0, 0, 0, 'Компот из терна рекомендуется для употребления при расстройствах желудка, имеет диуретическое и антисептическое свойство, обладает отхаркивающим действием.', NULL, 'Терн свежий, сахар-песок, вода питьевая.\nМассовая доля фруктовой части не менее 15%.\n Помогает успокоить нервную систему, улучшает обмен веществ.\nКомпот содержит каротин, клетчатку, натрий, калий, фосфор, железо, кальций, магнезий, витамины С и Е.\n Хранить при температуре от 00до +250С и относительной влажности воздуха не более 75%.  После вскрытия хранить при температуре от +20до +60С не более 3х суток.', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 506, NULL, 'Ararat', 'Компот из облепихи', NULL, 'Облепиха', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-30-28_15-21-41.JPG', 'шт', '1 л', 0, 0, 0, 'Компоты Ararat приготовлены по традиционному армянскому рецепту и очень похожи на домашние.', NULL, 'Облепиха свежая, сахар-песок, вода питьевая.\nМассовая доля фруктовой части не менее 15%.\nОблепиха является очень полезной ягодой для человека. Она замедляет старение, улучшает обмен веществ, укрепляет кровеносную систему, снимает воспаление в тканях, помогает заживлению ран, облегчает течение хронических заболеваний и помогает в борьбе со стрессом.\nРекомендуется хранить при температуре от +2°C до +25°C и относительной влажности воздуха не более 75%', '24 мес', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
