('TC-1-10-022', 1, 516, NULL, 'Ararat', 'Сок из манго', NULL, 'Манго', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-28-06_15-35-37.JPG', 'шт', '1 л', 0, 0, 0, 'Напиток Манго \"Арарат\"\nЭтом фрукте очень много каротиноидов. О чем говорит желтый или оранжевый цвет мякоти.', NULL, 'Пюре из манго, сахар-песок, регулятор кислотности-кислота лимонная пищевая, стабилизаторы Е 412, Е 414, Е 415, идентичный натуральному пищевой ароматизатор \"Манго\", пищевой краситель Е 160а, вода питьевая.\nИзготовлен из концентрированного пюре.\nМинимальная объемная доля фруктового пюре 10%.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.После вскрытия хранить при температуре от 2°C до 6°C не более 3-х суток', '24 месяцев', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '40', '0', '0', '10', '0', 'Zu17NwO8f-Y;', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 517, NULL, 'Ararat', 'Вишневый сок', NULL, 'Вишня', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-27-56_15-37-04.JPG', 'шт', '1 л', 0, 0, 0, 'Вишневый напиток. Считается одним из лучших ягодных соков, он обладает множеством целебных свойств.', NULL, 'Вишневый сок, сахар-песок, регулятор кислотности-кислота лимонная пищевая, идентичный натуральному пищевой ароматизатор \"Вишня\", пищевые красители Е 124, Е 122, вода питьевая.Обширный минеральный состав, пектиновые вещества и клетчатка позволяют использовать сок для лечения гастритов с низкой кислотностью и употреблять его в качестве поливитаминного напитка. Способствует омоложению клеток крови.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.После вскрытия хранить при температуре от 2°C до 6°C не более 3-х суток.', '18 месяцев', 'ООО «ПИЩЕВОЙ КОМБИНАТ АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '40,0', '0', '0', '10,0', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 518, NULL, 'Ararat', 'Яблочный сок', NULL, 'Яблоки', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-27-47_15-38-26.JPG', 'шт', '1 л', 0, 0, 0, 'Яблочный сок. Прямого отжима - Арарат\n Один из самых полезных и гипоаллергенных соков.', NULL, 'Богат витаминами (группы В, С, Е, А), минералами (калий, фосфор, железо, медь, натрий, магний, селен, сера) и органическими кислотами. Его употребляют при атеросклерозе, ревматизме, артрите, заболеваниях печени и почек, а также моче- и желчнокаменнои болезнях. Употребление яблочного сока способствует укреплению волос, ногтей, зубов, повышают гемоглобин, восстанавливают мышечную ткань после физических нагрузок.\nХранить при температуре + 2 С до +25 С относительной влажности воздуха не более 75%.', '24 месяцев', 'ООО пищевой комбинат «Арарат»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '46', '0', '0', '11,5', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 519, NULL, 'Ararat', 'Ананасовый сок', NULL, 'Ананасы', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-27-20_15-40-11.JPG', 'шт', '1 л', 0, 0, 0, 'Ананасовый сок полезен для снижения веса, так как содержит вещество бромелайн, которое является природным сжигателем жира. Он помогает расщеплять жиры и выводить их из организма.', NULL, 'Ананасовый сок, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода питьевая.\nИзготовлен из концентрированного сока.\nМинимальная объемная доля фруктового сока 40%.\nУпотребить до даты, указанной на верхней стороне крышки.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.\nПосле вскрытия хранить при температуре от 2°C до 6°C не более 3-х суток.', '24 месяцев', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '40', '0', '0', '10', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 520, NULL, 'Ararat', 'Томатный сок', NULL, 'Томаты', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-27-11_15-42-19.JPG', 'шт', '1 л', 0, 0, 0, 'Томатный сок\nУкрепляющий, освежающий и утоляющий жажду напиток.', NULL, 'По содержанию аскорбиновой кислоты томатный сок не уступает цитрусовым. Сок томатов содержит витамины А и С,органические кислоты (яблочная, лимонная, щавелевая), минералы (магний, калий, натрий, кальций). Он нормализует обмен веществ, укрепляет сердечную мышцу и кровеносные сосуды.\nХранить при температуре от +20до +250С и относительной влажности воздуха не более 75%. \nПеред употреблением взбалтывать.\nПосле вскрытия хранить при температуре от +20до +60С не более 3х суток.', '2 года', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '16,8', '0', '0', '4,2', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 521, NULL, 'Ararat', 'Компот из клубники', NULL, 'Клубника', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-26-23_15-47-55.JPG', 'шт', '1 л', 0, 0, 0, 'Клубника улучшает работу сердца, делает сосуды более эластичными, снижает давление и нормализует работу нервной системы.', NULL, 'Ягоды клубники содержат от 4,5 до 9% сахаров, минеральные вещества и необходимые для нормальной деятельности организма витамины такие, как калий, фосфор, кальций, натрий, магний, железо, йод, витамин С. Также клубника содержит значительное количество Р-активных веществ, особенно ягоды с темно-красной мякотью.\n В сезон клубники, регулярно её употребляя, можно привести в полный порядок сердечно-сосудистую систему, желудочно-кишечный тракт, печень, почки, избавиться от отеков, болей в суставах.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.\nПосле вскрытия хранить при температуре от 2°C до 6°C не более 3-х суток.', '24 месяцев', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 522, NULL, 'Ararat', 'Компот из вишни', NULL, 'Вишня', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-26-05_15-48-45.JPG', 'шт', '1 л', 0, 0, 0, 'Напиток из вишни по праву считается одним из лучших среди ягодных компотов. Как взрослые, так и дети любят его за уникальную кислинку и насыщенный вкус.', NULL, 'Вишня свежая, сахар-песок, кислота лимонная пищевая, вода питьевая.\nВишневый компот «Арарат» изготовлен по старинным рецептам, что позволяет сохранить все полезные элементы и витамины этой чудесной ягодой.\nМассовая доля фруктовой части не менее 15%.\nХранить при температуре от 00до +250С и относительной влажности воздуха не более 75%. После вскрытия хранить при температуре от +20до +60С не более 3х суток', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 523, NULL, 'Ararat', 'Компот алычовый', NULL, 'Алыча', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-57_15-50-56.JPG', 'шт', '1 л', 0, 0, 0, 'Компот алычевый \"Ararat\" 1000 мл в стеклянной таре. Массовая доля фруктовой части не менее 15%.', NULL, 'Алыча свежая, сахар-песок, вода питьевая.\nАлыча рекомендуется для употребления при расстройствах желудка, имеет диуретическое и антисептическое свойство, обладает отхаркивающим действием. Помогает успокоить нервную систему, улучшает обмен веществ. Содержит каротин, клетчатку, натрий, калий, фосфор, железо, кальций, магнезий, витамины С и Е.\n Хранить при температуре от 00до +250С и относительной влажности воздуха не более 75%. После вскрытия хранить при температуре от +20до +60С не более 3х суток.', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 524, NULL, 'Ararat', 'Компот грушевый', NULL, 'Груши', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-49_15-52-11.JPG', 'шт', '1 л', 0, 0, 0, 'Дикая груша способствует повышению прочности кровеносных капилляров, оказывает противовоспалительное действие.', NULL, 'груша дикая свежая, сахар-песок, вода питьевая.\nИмеет диуретическое, жаропонижающее и противокашлевое действие. Компот полезен при воспалении желудочно-кишечного тракта и мочевого пузыря. Содержит витамины В1, В2, В6, РР, С и каротин.\nХранить при температуре от 00до +250С и относительной влажности воздуха не более 75%. После вскрытия хранить при температуре от +20до +60С не более 3х суток.', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30=');
