('TC-1-10-022', 1, 525, NULL, 'Ararat', 'Компот из граната', NULL, 'Гранаты', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-42_15-53-14.JPG', 'шт', '1 л', 0, 0, 0, 'Отличается превосходным глубоким вкусом.\nБлагодаря высокотехнологичному процессу\nпереработки в нем максимально сохранены витамины и микроэлементы.', NULL, 'Гранатовый сок, сахар-песок, регулятор кислотности-кислота лимонная пищевая, идентичный натуральному пищевой ароматизатор \"Гранат\", пищевой краситель Е 129, вода питьевая.вода питьевая.\nИзготовлен из концентрированного сока.\nМинимальная объемная доля фруктового сока 10%.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.', '18 месяцев.', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '40', '0', '0', '10', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 526, NULL, 'Ararat', 'Компот из фейхоа', NULL, 'Фейхоа', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-34_16-02-27.JPG', 'шт', '1 л', 0, 0, 0, 'Основная польза фейхоа заключается в том, что в его мякоти содержится легкоусвояемый йод. А значит их можно использовать для лечения всевозможных эндокринных заболеваний.', NULL, 'Фейхоа свежее, сахар-песок, лимонная кислота, вода питьевая.\nМассовая доля фруктовой части не менее 15%.\nХранить при температуре от 00до +250С и относительной влажности воздуха не более 75%. Срок годности 24 месяца. После вскрытия хранить при температуре от +20до +60С не более 3х суток.', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 527, NULL, 'Ararat', 'Компот айвовый', NULL, 'Айва', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-26_16-15-17.JPG', 'шт', '1 л', 0, 0, 0, 'Компот из айвы полезен для желудочно-кишечного тракта. Айва улучшает деятельность пищеварения, является антисептиком, обладает диуретическим свойством.', NULL, 'А свежая, сахар-песок, вода питьевая.\nМассовая доля фруктовой части не менее 15%.\nУпотребление компота полезно людям, страдающим заболеваниями дыхательных путей. Содержит витамины А, С, Е, В1, В2, В6, РР.\n хранить при температуре от 00до +250С и относительной влажности воздуха не более 75%. Срок годности 24 месяца. После вскрытия Хранить при температуре от +20до +60С не более 3х суток.', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '56', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 528, NULL, 'Ararat', 'Компот из шелковицы', NULL, 'Шелковица. Тутовник.', 'Армения', 130, 20, 0, 0, 'шт', '2017-09-3014-25-06_16-16-17.JPG', 'шт', '1 л', 0, 0, 0, 'Компот из черной шелковицы\nКомпоты Ararat приготовлены по традиционному армянскому рецепту и очень похожи на домашние. Ягоды и фрукты из этих компотов тоже необыкновенно вкусные!', NULL, 'Шелковица содержит сахара, железо, витамины В1, В2, С, РР. Зрелый плод содержит большое количество ресвератрола, являющегося сильным растительным антиоксидантом. В шелковице много калия, по его содержанию она, наряду с чёрной смородиной, лидирует среди плодово-ягодных культур. Красная шелковица полезна для крови, белая – для нервной системы.\nРекомендуется хранить при температуре от +2°C до +25°C и относительной влажности воздуха не более 75%', '24 месяцев', 'ООО \"Пищевой Комбинат Арарат\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '14', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 529, NULL, 'Amrita', 'Компот из яблок', NULL, 'Яблоки', 'Армения', 120, 20, 0, 0, 'шт', '2017-09-3014-24-26_16-17-26.JPG', 'шт', '1 л', 0, 0, 0, 'Компот из яблок и барбариса', NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 'Vb6y0u15xP8;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-022', 1, 530, NULL, 'Amrita', 'Компот из персика', NULL, 'Персики', 'Армения', 120, 20, 0, 0, 'шт', '2017-09-3014-24-14_16-19-05_16-20-55_16-27-40.JPG', 'шт', '1 л', 0, 0, 0, 'Компот из персика и кизила\n Персиковый сок богат минеральными солями калия и железа. Персиковый сок ускоряет метаболизм и способствует похудению.', NULL, 'Персиковое пюре, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода питьевая. Он богат витаминами С и группы В, каротином и пектином, что помогает организму приспосабливаться к неблагоприятным условиям внешней среды.\nИзготовлен из концентрированного пюре.\nМинимальная объемная доля фруктового пюре 40%.\nХранить при температуре от 2°C до 25°C и относительной влажности воздуха не более 75%.\nПосле вскрытия хранить при температуре от 2°C до 6°C не более 3-х суток.', '24 месяцев', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '40', '0', '0', '10', '0', 'Vb6y0u15xP8;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
