('TC-1-10-022', 1, 535, NULL, 'Ararat', 'Чай мята и лайм', NULL, 'Мята', 'Армения', 55, 30, 0, 0, 'шт', '2017-09-3014-22-44_16-53-44.JPG', 'шт', '1 л', 0, 0, 0, 'Холодный чай витаминизированный, мята, лайм.  Продукт стерилизован и упакован.', NULL, 'настой мяты, идентичный натуральному пищевой ароматы- затор лимон-Лайма, сахар-песок, регулятор кислотности,- кислота лимонная пищевая, витамин  С, вода питьевая. \nХранить при температуре + 2 С до +25 С относительной влажности воздуха не более 75%.\nПосле вскрытия хранить при температуре от +2 C до +6 C не более 3-х суток.', NULL, 'ООО пищевой комбинат «Арарат»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '30', '0', '0', '7,5', '0', 'Zu17NwO8f-Y;', '', 0, 'YToxOntpOjA7czowOiIiO30='),
