('TC-1-10-022', 1, 537, '', 'Armenium', 'Апельсиновый сок', 'Апельсиновый сок неосветленный \"Армениум\"', 'Апельсины', 'Армения', 110, 20, 0, 0, 'шт', '2017-09-3014-22-20_17-09-54.JPG', 'шт', '1 л', 0, 0, 0, 'Пищевой комбинат «Арарат», производитель сока Armenium, расположен в Армении и является одним из крупнейших производителей соковой продукции и консервации.  Производство «полного цикла», от плодов с поля и сада до готовой продукции, дает дополнительные преимущества по качеству и свежести.\n', '', 'Апельсиновый сок.\nИзготовлен из концентрированного сока.\nХранить при температуре + 2 С до +25 С и относительной влажности воздуха не более 75%.\nОткрытый пакет хранить при температуре от +2 C до +6 C не более 3-х суток. Перед употреблением взбалтывать.', 'Указан на верхней панели пакета', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '44,8', '0', '0', '11,2', '', ';', '', 0, ''),
('TC-1-10-022', 1, 538, '', 'Armenium', 'Мультифруктовый сок', 'Мультифруктовый нектар неосветленный \"Армениум\"', 'не знаю', 'Армения', 110, 20, 0, 0, 'шт', '2017-09-3014-22-16_17-11-07.JPG', 'шт', '1 л', 0, 0, 0, 'Пищевой комбинат «Арарат», производитель сока Armenium, расположен в Армении и является одним из крупнейших производителей соковой продукции и консервации.  Производство «полного цикла», от плодов с поля и сада до готовой продукции, дает дополнительные преимущества по качеству и свежести.\n\n', '', 'Мандариновый сок, яблочный сок, апельсиновый сок, ананасовый сок, банановое пюре, пюре из манго, сок из маракуйи, лимонный сок, пюре из личи, сахар-песок, регулятор кислотности-кислота лимонная пищевая, вода питьевая.\nИзготовлен из концентрированного сока.\nХранить при температуре + 2 С до +25 С и относительной влажности воздуха не более 75%.\nОткрытый пакет хранить при температуре от +2 C до +6 C не более 3-х суток. Перед употреблением взбалтывать.\n', ' Указан на верхней панели пакета', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '48', '0', '0', '12', '', ';', '', 0, ''),
('TC-1-10-022', 1, 539, '', 'Armenium', 'Сок из манго', 'Нектар из Манго неосветленный \"Армениум\"', 'Манго', 'Армения', 110, 20, 0, 0, 'шт', '2017-09-3014-22-09_17-12-02.JPG', 'шт', '1 л', 0, 0, 0, 'Пищевой комбинат «Арарат», производитель сока Armenium, расположен в Армении и является одним из крупнейших производителей соковой продукции и консервации.  Производство «полного цикла», от плодов с поля и сада до готовой продукции, дает дополнительные преимущества по качеству и свежести.\n\n', '', 'Пюре из манго, сахар-песок, регулятор кислотности - кислота пищевая, вода питьевая.\nИзготовлен из концентрированного сока.\nХранить при температуре + 2 С до +25 С и относительной влажности воздуха не более 75%.\nОткрытый пакет хранить при температуре от +2 C до +6 C не более 3-х суток. Перед употреблением взбалтывать.', 'Указан на верхней панели пакета', 'ООО «ПИЩЕВОЙ КОМБИНАТ «АРАРАТ»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '48', '0', '0', '12', '', ';', '', 0, 'YTozOntpOjA7czo0NDoiaHR0cDovL3d3dy5hcm1lbmlhb25saW5lLnJ1L3Byb2R1Y3QucGhwLzk5OTIiO2k6MTtzOjY4OiJodHRwOi8vaXphcm1lbmlpLnJ1L2NhdGFsb2cvanVpY2VzX2FuZF9uZWN0YXJzL21hbmdvX2p1aWNlX2FybWVuaXVtLyI7aToyO3M6MDoiIjt9'),
