('TC-2-10-048', 1, 889, '81.0065,1', 'Cretan Mill', 'Оливковое масло', 'Cretan Mill оливковое масло Extra Virgin с базиликом с о.Крит ', 'Оливки', 'Греция', 240, 20, 204, 6, 'шт', '2017-10-0315-35-49_23-02-43.JPG', 'шт', '250 г', 0, 0, 0, 'Масло оливковое нерафинированное высшего качества Extra Virgin olive oil с базиликом CRETAN MILL прекрасно подходит к спагетти, итальянским блюдам из риса, средиземноморской кухне..\n\n', '', 'Масло оливковое нерафинированное высшего качества Extra Virgin olive oil (98%), базилик (2%).Хранить в сухом, прохладном и защищенном от солнечных лучей месте. Продукт не содержит ГМО. ', ' 18 месяцев', 'CRETA OLIVE MILL I. ALMPANTAKIS & CO. S.A. ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '824', '', '91.6', '', '', ';', '', 0, 'YToxOntpOjA7czozNjoiaHR0cHM6Ly93d3cub2RlbGlrYXRvcy5ydS81MzExOC5odG1sIjt9'),
('TC-2-10-048', 1, 890, '81.0066,1', 'Cretan Mill', 'Оливковое масло', 'Cretan Mill оливковое масло Extra Virgin с лимоном с о.Крит ', 'Оливки', 'Греция', 240, 20, 204, 6, 'шт', '2017-10-0315-35-38_23-03-56.JPG', 'шт', '250 г', 0, 0, 0, 'Масло оливковое нерафинированное высшего качества Extra Virgin olive oil с лимоном CRETAN MILL прекрасно подходит морепродуктам, рыбе, овощам, картофелю и курице.', '', ' Масло оливковое нерафинированное высшего качества Extra Virgin olive oil (98%), свежий лимон (2%).Хранить в сухом, прохладном и защищенном от солнечных лучей месте. Продукт не содержит ГМО. ', ' 18 месяцев', 'CRETA OLIVE MILL I. ALMPANTAKIS & CO. S.A. ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '824', '', '91.6', '', '', ';', '', 0, 'YToxOntpOjA7czozNjoiaHR0cHM6Ly93d3cub2RlbGlrYXRvcy5ydS81MzEyMC5odG1sIjt9'),
