('TC-2-10-048', 1, 892, '81,0026,1', 'Delphi', 'Оливковое масло', 'Оливковое масло  нефильтрованное.', 'Оливки', 'Греция', 545, 20, 464, 6, 'шт', '2017-10-0315-35-15_23-05-07.JPG', 'шт', '500 мл', 0, 0, 0, 'Оливковое масло Агурелео значительно выделяется на фоне остальных не только своим цветом, консистенцией и вкусом, но и составом, поскольку оно не проходит никаких фильтраций.\nОбязательное наличие естественного осадка в масле, перед употреблением взболтать.', '', 'Из самых первых зелёных оливок, собранных руками и отжатых холодным способом в течении лишь пары часов после сбора, имеет красивый не прозрачный золотисто-оливковый цвет, плотную текстуру, которая достигается за счёт свежести продуктов.Кислотность 0,4 %', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '896', '', '100', '', '', ';', '', 0, 'YToxOntpOjA7czoxMjI6Imh0dHA6Ly9vbGl2ZW9pbC1tYXJrZXQucnUvbWFzbG8tb2xpdmtvdm9lL21hc2xvLW9saXZrb3ZvZS1leHRyYS12aXJnaW4vbWFzbG8tb2xpdmtvdm9lLWRlbHBoaS1uZWZpbHRyb3Zhbm5vZS1hZ3VyZWxlby0wLTVsIjt9'),
('TC-2-10-048', 1, 893, '81.0002', 'Delphi', 'Оливковое масло', 'Delphi оливковое масло Extra Virgin P.D.O. Kolymvari с о.Крит ', 'Оливки', 'Греция', 420, 20, 357, 12, 'шт', '2017-10-0315-35-04_23-05-49_23-06-19.JPG', 'шт', '500 мл', 0, 0, 0, 'Оливковое масло первого холодного отжима, произведенное в небольшом городке Аноскели на острове Крит, Греция. Это идеально сбалансированное масло со средней кислотностью 0,5%, обладающее сертификатом P.D.O. (защищенный регион происхождения) Kolimvari, стабильно высокого качества с отличным ароматом и богатым вкусом.', '', 'Не содержит холестерина. Не содержит соли.\nКислотность от 0,1% до 0,8%.\nХранить в прохладном темном месте при температуре 18-27C.\n\n', '2 года', 'A. CO. ANOSKELI S.A. ', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '840', '', '94', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
