('TC-1-16-012', 1, 1027, '', '', 'Осьминог В/У', 'Осьминог в/у готовый', 'Осьминог', 'Россия', 1300, 10, 0, 0, '', '2017-10-0314-13-22_13-18-16.JPG', 'шт', '', 0, 0, 0, 'Во многом, полезные свойства мяса осьминога зависит от наличия в нем жирных кислот. Именно они помогают снизить риск возникновения сердечно-сосудистых заболеваний, весьма эффективно помогает при их лечении, помогают избавиться от депрессии и приступов упадка настроения. Также, они предотвращают возникновение многих других болезней, в том числе и онкологических.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '82', '14,91', '1,04', '2,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-16-012', 1, 1028, '', '', 'Мидии в раковине', 'Мидии в раковине', 'Мидии', '', 600, 15, 0, 0, '', '2017-10-0314-12-31_13-18-45.JPG', 'шт', '', 0, 0, 0, 'урманы по всему миру любят употреблять в пищу мидии, которые отдаленно напоминают устрицы, однако по вкусу эти два моллюска значительно различаются. Кроме того, устрицы имеют мышцу, которая скрепляет створки, а у мидий такие мышцы отсутствуют, из-за чего открыть раковину гораздо проще. С бокалом белого вина это искушение!', '1 кг.', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77', '11,5', '2,0', '3,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
