('TC-1-4-075', 1, 1302, NULL, 'Abaco', 'Оливковое  масло', NULL, 'Virgin', 'Испания', 0, 10, 0, 0, 'шт', '2017-09-3013-13-42_14-32-37.JPG', 'шт', '1 л', 0, 0, 0, 'Продукт состоит из смеси рафинированного оливкового масла первого холодного отжима (около 75%) и нерафинированного оливкового масла высшего качества (около 15%).', NULL, 'Оливковое масло высшего качества, полученное механическим отжимом из оливок.В нем сохраняется большое количество полезных веществ, а также неповторимый оливковый вкус и аромат.\nПодходит для заправок; салатов; готовых холодных блюд;закусок; соусов.', NULL, 'F.Faiges SL, Pol.Ind.Daimiel Sur, C/Calidad 468', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '824', '0', '91,6', NULL, '0', ';', NULL, 0, 'YToxOntpOjA7czo1ODoiaHR0cHM6Ly9vbGl2YXMucnUvY2F0YWxvZy9vbGl2a292b2VfbWFzbG8vYWJhY29fcHVyZV8xXzBfLyI7fQ=='),
('TC-1-4-075', 1, 1303, '', 'Basso', 'Оливковое  масло', 'Оливковое масло Basso в жестяной банке', 'Pomace (из жмыха)', 'Италия', 1880, 10, 0, 0, 'шт', '2017-09-3013-13-02_14-35-52.JPG', 'шт', '5 л', 0, 0, 0, 'Оливковое масло Basso в основном предназначено для жарки и приготовления горячей пищи. Оливковое масло не зря считается очень полезным для здоровья. Оно сохраняет все свои вкусовые и природные свойства даже после жарки, а во время неё не распадается на канцерогены, тем самым благоприятно влияет на ваше здоровье.Каждый этап производства и упаковки этого масла контролируется технологами компании Basso, что обеспечивает высочайшие стандарты качества.', '', 'смесь рафинированного, натурального оливкового масла и масла из жмыха. Кислотность не более 1,5%. Наличие доли неочищенного масла в составе гарантирует сохранность множества полезных веществ и витаминов, в частности, витамина E.\n', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czoxMDg6Imh0dHA6Ly93d3cuZW9pbHMucnUvY29sbGVjdGlvbi8zLWxpdHJhLWktNS1saXRyb3YvcHJvZHVjdC9tYXNsby1vbGl2a292b2UtcmFmaW5pci1iYXNzby01LWwtdi16aGVzdC1rYW5pc3RyZSI7fQ=='),
