('TC-1-4-075', 1, 1310, '', 'Oro Espanol', 'Оливковое  масло', 'МАСЛО ОЛИВКОВОЕ \"ORO ESPAÑOL\" EXTRA VIRGIN \"OLD SICILIA\" ORGANIC', 'Extra Virgin (для салатов)', 'Испания', 658, 10, 0, 0, 'шт', '2017-09-3013-10-39_14-43-50.JPG', 'шт', '750 мл', 0, 0, 0, 'Масло оливковое нерафинированное высшего качества органическое, полученное непосредственно из оливковых плодов исключительно методом механического прессования. Масло не содержит остатков пестицидов и химических удобрений', '', 'Нерафинированное оливковое масло первого холодного отжима.', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
