('TC-1-4-075', 1, 1314, NULL, 'Abaco', 'Оливковое  масло', NULL, 'Extra Virgin (для салатов)', 'Испания', 423, 10, 0, 0, 'шт', '2017-09-3013-08-45_14-52-22.JPG', 'шт', '500 мл', 0, 0, 0, 'Оливковое масло первого отжима нерафинированное Olio Extra Vergine di Oliva \n Picual\nЭто настоящий оливковый сок, без добавления чего бы то ни было.', NULL, 'Изготовлено в естественных условиях, при таких температурных условия, когда с сырьем и конечных продуктом не происходит каких-либо изменений. Высококачественный продукт, с великолепным мягким вкусом и ароматом, изначальная кислотность которого не превышает 0.3%. Изготовлено из одного сорта плодов -Пикуаль', NULL, 'F.Faiges SL', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '824', NULL, '91,6', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
