('TC-1-4-075', 1, 1359, '', 'Esterer', 'Тыквенное масло', 'Масло тыквенных семечек нерафинированное Ölmühle Esterer ', 'Тыква', 'Австрия', 0, 10, 0, 0, 'шт', '2017-09-3012-37-13_16-37-12.JPG', 'шт', '500 мл', 0, 0, 0, 'Штирийское масло из тыквенной семечки – это масло из высококачественных семечек штирийских тыкв, выращенных без кожуры, отжатое путем холодного прессования.  Масло ценится за свои уникальные характерные качества - темно-зеленый цвет, тягучую консистенцию и ореховый вкус. ', '', 'Масло тыквенное содержит большое количество биологически активных веществ: каратиноиды, токоферолы (не менее 30%), фосфолипиды, витамины В1, В2, С, Р, флавоноиды, ненасыщенные и жирные полиненасыщенные кислоты – линоленовую, олеиновую, линолевую, пальмитиновую, стеариновую. \n', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo4NzoiaHR0cDovL3d3dy5lb2lscy5ydS9wcm9kdWN0L21hc2xvLWl6LXR5a3Zlbm55aC1zZW1lY2hlay1vbG11aGxlLWVzdGVyZXItNTAwLW1sLWF2c3RyaXlhIjt9'),
