('TC-1-4-075', 1, 1366, '', 'Iliada', 'Оливковое  масло', 'Набор Оливковковых масел ILIADA Extra Virgin PDO 750+500 мл.', 'Extra Virgin (для салатов)', 'Греция', 0, 10, 0, 0, '', '2017-09-3012-32-18_16-50-07.JPG', 'шт', '', 0, 0, 0, 'В набор входит:\n1. Оливковое масло Extra Virgin нерафинированное ILIADA PDO Kalamata 0.75 ж/б.\nМасло произведено из Оливок сорта Koroneiki, выращенных в регионе Kalamata на юге Греции.\n2.  Оливковое масло Extra Virgin нерафинированное ILIADA PDO Sitia 0.5 в стекл. бут.Это масло происходит из Sitia на острове Crete (Крит). Золотисто зеленый цвет, свежий фруктовый аромат с нежным травяным оттенком создают идеальный баланс сладкого и горького.Маркировка P.D.O подтверждает, что масло производится из оливок, выращенных в охраняемой географической области и разлито на месте производства.   \n\n\n\n\n\n', '', '', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czoxMDE6Imh0dHA6Ly93d3cuZW9pbHMucnUvcHJvZHVjdC9uYWJvci1tYXNlbC1vbGl2a292a292eWgtaWxpYWRhLWV4dHJhLXZpcmdpbi0yP3JlY29tbWVuZGVkX2J5PWludGVyZXN0aW5nIjt9'),
('TC-1-4-075', 1, 1367, '', 'Basso', 'Виноградное масло', 'Масло виноградной косточки «Basso» рафинированное ', 'Виноград', 'Италия', 282, 10, 0, 0, 'шт', '2017-09-3012-25-46_17-12-42.JPG', 'шт', '500 мл', 0, 0, 0, 'Масло экстрагировано из виноградных косточек и особо ценится за лёгкий вкус. Используется для заправки, тепловой кулинарной обработки пищи, приготовления различных блюд, в том числе выпечки.', '', 'Масло виноградной косточки получено из косточек винограда путем однократного холодного отжима, который позволяет сохранить полезные вещества в масле в большом количестве и неизменном виде. Наличие осадка свидетельствует о натуральности продукта.', '2 года', '«Basso Fedele & Figli s.r.l.»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '900', '', '100', '', '', ';', '', 0, 'YToxOntpOjA7czo4NzoiaHR0cDovL21pcm1hc2xhLnJ1L21hc2xvLXZpbm9ncmFkbm95LWtvc3RvY2hraS1iYXNzby1pdGFsaXlhLXJhZmluaXJvdmFubm9lLTUwMC1tbC5odG1sIjt9'),
