('TC-1-4-075', 1, 1381, '', 'Albano', 'Виноградное масло', NULL, 'Виноград', 'Италия', 282, 10, 0, 0, 'шт', '2017-09-3012-18-50_18-03-37.JPG', 'шт', '500 мл', 0, 0, 0, 'Масло «Albano» относится к деликатесным, создается из виноградных косточек, поэтому имеет весьма необычный фруктовый вкус и насыщенный аромат. Содержит очень большое количество редких витаминов и веществ, среди которых отдельно стоит выделить необходимые для нашей жизнедеятельности жиры Омега 3, Омега 6, Омега 9.', '', 'Рафинированное масло, получено путем отжима виноградных косточек. Масло имеет высокую температуру воспламенения, поэтому его можно нагревать до 240°С, не опасаясь дыма, брызг и пригорания. ', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo2MzoiaHR0cHM6Ly9vbGl2YXMucnUvY2F0YWxvZy92aW5vZ3JhZG55a2hfa29zdG9jaGVrL2FsYmFub18wXzVfXzEvIjt9'),
