('TC-1-4-075', 1, 1383, '', 'Basso', 'Рисовое масло', 'Рисовое масло для жарки «Basso»  рафинированное ', 'Рис', 'Италия', 0, 10, 0, 0, 'шт', '2017-09-3012-18-24_18-05-01.JPG', 'шт', '1 л', 0, 0, 0, 'Благодаря легкому вкусу и высокой  температуре кипения    масло идеально подходит для жарки, когда важно сохранить вкусовые качества продуктов. С рисовым маслом  блюда сохраняют свой натуральный вкус и аромат.', '', 'Рисовое масло экстрагируется из тонкого коричневого слоя между ядром риса и защитной пленкой зерна. Этот слой содержит ценные питательные компоненты такие как протеины, витамины, минеральные вещества и лецитин. Масло богато витамином Е, жирными кислотами, скваленом.', '', '«Basso Fedele & Figli s.r.l.»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo4MjoiaHR0cDovL21pcm1hc2xhLnJ1L3Jpc292b2UtbWFzbG8tZGx5YS16aGFya2ktYmFzc28taXRhbGl5YS1yYWZpbmlyb3Zhbm5vZS0xLWwuaHRtbCI7fQ=='),
