('TC-1-4-075', 1, 1414, '', 'Basso', 'Оливковое  масло', 'Оливковое масло Basso Olio Di Sansa Для жарки Рафинированное (Pomace) ', 'Pomace (из жмыха)', 'Италия', 216, 10, 0, 0, 'шт', '2017-09-3012-02-34_11-48-06_11-48-36.JPG', 'шт', '500 мл', 0, 0, 0, 'Оливковое масло Basso в основном предназначено для жарки и приготовления горячей пищи. Оливковое масло не зря считается очень полезным для здоровья. Оно сохраняет все свои вкусовые и природные свойства даже после жарки, а во время неё не распадается на канцерогены, тем самым благоприятно влияет на ваше здоровье.Каждый этап производства и упаковки этого масла контролируется технологами компании Basso, что обеспечивает высочайшие стандарты качества.', '', 'смесь рафинированного, натурального оливкового масла и масла из жмыха. \nКислотность не более 1,5%. Наличие доли неочищенного масла в составе гарантирует сохранность множества полезных веществ и витаминов, в частности, витамина E. ', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
