('TC-1-4-047', 1, 1447, NULL, 'Agromonte', 'Томаты Agromonte', NULL, 'Томаты вяленые', 'Италия', 1147, 20, 0, 0, 'шт', '2017-09-2916-20-33_12-50-04.JPG', 'шт', '1 кг', 0, 0, 0, 'Вяленые маленькие томаты черри - особый деликатес и один из излюбленных компонентов средиземноморской кухни.', NULL, 'Томаты черри полусушеные (62%), масло подсолнечное, соль, базилик, орегано, чеснок, острый перец, лимонная и аскорбиновая кислота.\nТоматы черри слаще, чем обычные, к тому же они дольше остаются свежими, а меньший размер позволяет им быстрее высушиваться на солнце.', '24 месяцев', 'Agromonte', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '189', '2,5', '13', '14', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-4-047', 1, 1448, NULL, 'Agromonte', 'Соус Agromonte', NULL, 'Томаты', 'Италия', 144, 20, 0, 0, 'шт', '2017-09-2916-19-36_12-55-46.JPG', 'шт', '330 г', 0, 0, 0, 'Соус Agromonte с томатами черри.\nЕго сладкий вкус, очень приятен и нравится детям.', NULL, 'Ингредиенты: помидоры Черри (97%), оливковое масло экстраверджин, соль, морковь, лук, базилик, сельдерей, сахар.\nЭтот соус рождается из помидоров черри, типичного сицилийского деликатеса, которые обрабатываются только в летние месяцы. Используются только первоклассные ингредиенты.', '36 месяцев', 'Agromonte', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '132', '2,20', '9,70', '8,60', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-4-047', 0, 1449, NULL, 'Agromonte', 'Соус Agromonte', NULL, 'Томаты', 'Италия', 0, 20, 0, 0, 'шт', '2017-09-2916-19-30_12-56-13.JPG', 'шт', '260 г', 0, 0, 0, 'Соус для пасты, чеснок и томаты черри', NULL, 'Томаты черри (96%), олив. масло экстра верджин(1.23), чеснок (1.07%) морковь(0.6%), лук(0.5%), соль(0.3%), базилик(0.1%), сельдерей(0.1%), сахар(0.1%)\nУсловия хранения: хранить в сухом прохладном месте. Открытую банку хранить в холодильнике не более 7 дней.', '36 месяцев', 'AGROMONTE', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '135,00', '1,20', '9,80', '9,80', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-4-047', 0, 1450, NULL, 'Agromonte', 'Соус Agromonte', NULL, 'Puttanesca', 'Италия', 0, 20, 0, 0, 'шт', '2017-09-2916-19-24_12-56-59.JPG', 'шт', '260 г', 0, 0, 0, 'Натуральный томатный соус, приготовленный по традиционным итальянским рецептам из спелых помидоров черри с добавлением оливок и каперсов, не оставит равнодушным даже притязательного ценителя вкусной и полезной средиземноморской кухни.', NULL, 'Томаты черри 85,9%, масло оливковое Extra Virgin, зелёные оливки 3,5%, каперсы 2,3%, морковь, лук, чеснок, базилик, сельдерей, соль, сахар. \nУсловия хранения: хранить в сухом прохладном месте. Открытую банку хранить в холодильнике не более 7 дней.', '36 месяцев', 'Agromonte', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '120', '1,4', '8,8', '7,8', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
