('TC-1-4-063', 1, 1701, NULL, 'Althaus', 'Чай в пакетиках', 'Althaus Grand Pack Rooibush Strawberry Cream ягодный чай', 'не знаю', 'Германия', 540, 23, 0, 0, 'шт', '2017-09-2914-15-10_11-51-08.JPG', 'шт', '20 шт', 0, 0, 0, 'Это превосходное сочетание вкуса спелой клубники, воздушных сливок и нежного аромата отборных листьев ройбуша. Ройбуш — это экзотический напиток из Южной Африки.', NULL, 'ройбуш, клубника, сливки. Не содержит кофеина и исключительно полезен для здоровья. \nХранить в сухом прохладном месте, отдельно от сильнопахнущих продуктов.', '24 месяцев', 'Althaus', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czo0NzoiaHR0cDovL3d3dy5vem9uLnJ1L2NvbnRleHQvZGV0YWlsL2lkLzEzNTk4MDM1NS8iO30='),
('TC-1-4-063', 1, 1702, NULL, 'Althaus', 'Чай в пирамидках', 'Althaus Lung Ching зеленый чай', 'не знаю', 'Германия', 348, 23, 0, 0, 'шт', '2017-09-2914-14-35_11-52-58.JPG', 'шт', '20 шт', 0, 0, 0, 'Чай Althaus Lung Ching радует глаз теплыми желтоватыми переливами.', NULL, 'это коллекция из 13 купажей, в которую вошли лучшие сорта высококачественного листового чая, а также отборные смеси из цельных кусочков фруктов, ягод, цветочных лепестков, целебных трав.', '24 месяцев', 'Althaus', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czo0NzoiaHR0cDovL3d3dy5vem9uLnJ1L2NvbnRleHQvZGV0YWlsL2lkLzEzNTE0Nzk3OC8iO30='),
('TC-1-4-063', 1, 1703, '', 'Althaus', 'Чай в пирамидках', 'Althaus Lemon Mint чайный напиток травяной', 'не знаю', 'Германия', 348, 23, 0, 0, 'шт', '2017-09-2914-14-24_11-53-35.JPG', 'шт', '20 шт', 0, 0, 0, 'Лимонник и мята лежат в основе вкусового своеобразия оригинального напитка Althaus Lemon Mint.Чайный напиток станет идеальным завершением легкого завтрака, ведь он не только полезен для здоровья, но и обладает замечательным тонизирующим эффектом.', '', 'ягоды бузины, апельсиновая цедра, яблоко, мелисса, лепестки подсолнечника и мальвы. В этом купаже травянисто-цитрусовый вкус лимонника подчеркивается яркой освежающей нотой сладкой мяты и завершается пикантным имбирным оттенком. \nХранить в сухом, прохладном месте отдельно от сильнопахнущих продуктов.', '24 месяцев', 'Althaus', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '0', '0', '0', '0', '0', ';', '', 0, 'YToxOntpOjA7czo0NzoiaHR0cDovL3d3dy5vem9uLnJ1L2NvbnRleHQvZGV0YWlsL2lkLzEzNTE0Nzk4NC8iO30='),
('TC-1-4-063', 1, 1704, NULL, 'Althaus', 'Чай в пирамидках', 'Althaus English Superior черный чай', 'не знаю', 'Германия', 348, 23, 0, 0, 'шт', '2017-09-2914-14-18_11-54-21.JPG', 'шт', '20 шт', 0, 0, 0, 'Немного терпкий чай с едва заметным травяным привкусом, превосходно сбалансированный, объединяющий в себе легкую мармеладную кислинку, манящую сладость теплого бисквита и \"огненную\" нотку поджаренных хлебных злаков.', NULL, 'чай черный байховый листовой высший сорт.\nЯркий, сочный, но очень мягкий аромат, как воздух осеннего леса, дополняется ноткой пикантной сладости спелых фруктов. После добавления свежего молока запах этого чая напоминает аромат теплого тоста с медом. \nХранить в сухом, прохладном месте отдельно от сильнопахнущих продуктов.', '2 года', 'Althaus', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToyOntpOjA7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzYxLzI5MDgwNzU5IjtpOjE7czo0NzoiaHR0cDovL3d3dy5vem9uLnJ1L2NvbnRleHQvZGV0YWlsL2lkLzEzNTE0Nzk3MC8iO30='),
('TC-1-4-063', 1, 1705, NULL, 'Althaus', 'Чай в пирамидках', 'Althaus Fruit Berry чайный напиток фруктовый в пирамидках', 'не знаю', 'Германия', 348, 23, 0, 0, 'шт', '2017-09-2914-14-11_11-55-03.JPG', 'шт', '20 шт', 0, 0, 0, 'Этот уникальный фруктовый чай обладает ярким ягодным ароматом с легким оттенком сухофруктов. При заваривании летняя сладость раскрывается в богатом букете со множеством выразительных нюансов, соблазнительном послевкусием клубники и дикой вишни.', NULL, 'гибискус, бузина, шиповник, яблоко, листья клубники, ароматизатор пищевой лесные ягоды.\nВ этой замечательной композиции из отборных красных фруктов и ягод угадываются сладкие ароматы душистого домашнего варенья.\nХранить в сухом прохладном месте, отдельно от сильнопахнущих продуктов.', '2 года', 'Althaus', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToyOntpOjA7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzYxLzU4NTYwODkyIjtpOjE7czo0NzoiaHR0cDovL3d3dy5vem9uLnJ1L2NvbnRleHQvZGV0YWlsL2lkLzEzNTE0Nzk4OS8iO30='),
('TC-1-4-063', 1, 1706, '', 'Belvedere', 'Чай в пакетиках', ' Фитнес Микс чай', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-06-55_12-32-03.JPG', 'шт', '20 шт', 0, 0, 0, 'Травяная смесь на основе зеленого ройбуша.', '', 'зеленый ройбуш, листья мате, цукаты папайи и манго, рисовый попкорн, ягоды Годжи, лепестки роз и василька, цветы календулы.\nУникальный состав травяной смеси позволит наладить обмен веществ,  укрепит здоровье, даст организму дополнительные силы для борьбы с вирусами. Основу напитка составляет африканское растение ройбуш, обладающее пряным, сладковатым вкусом. Терпкие мотивы усиливают листья мате, ягоды Годжи. Цветочный мягкий букет обеспечивают розы, василек и календула. \n\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '0', '0', '0', '0', '0', ';', '', 0, 'YToyOntpOjA7czo4MzoiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9UZWEtTWl4LUJlbHZlZGVyZS1GaXRuZXNzLWZvci1EdW1taWVzLTYtZy0xMi1wY3MiO2k6MTtzOjA6IiI7fQ=='),
('TC-1-4-063', 1, 1707, '', 'Belvedere', 'Чай в пакетиках', 'Зеленый чай Жасмин', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-06-33_12-32-45.JPG', 'шт', '20 шт', 0, 0, 0, '', '', 'зеленый китайский байховый чай, цветки жасмина. Крупные листочки китайского чая обдаются паром для приостановки ферментации, после чего их сушат вместе с едва начавшими раскрываться бутонами жасмина.  При заваривании получается светло-желтый настой с тонким ароматом жасмина и мягким вкусом. \n\n\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo3OToiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9KYXNtaW5lLVRlYS1CZWx2ZWRlcmUtZm9yLWR1bW1pZXMtNC1nLTEyLXBjcyI7aToxO3M6MDoiIjt9'),
