('TC-1-4-063', 1, 1709, '', 'Belvedere', 'Чай в пирамидках', 'Фруктовый микс чай', 'не знаю', 'Германия', 290, 23, 0, 0, 'шт', '2017-09-2914-06-16_12-34-14.JPG', 'шт', '17 шт', 0, 0, 0, 'Нежнейший купаж на основе фруктов и трав.', '', 'гибискус, кокосовая стружка, кусочки банана, виноград, яблоко, лепестки роз, цукаты ананаса и папайи, цветки василька.Обладающий легкой кислинкой бленд строится на основе популярного каркаде. Тропический аромат формируют кокос, виноград, банан, папайя и ананас. Часть богатых витаминами фруктов представлена в виде сладких цукатов, придающих настою особую нежность. \n\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '0', '0', '0', '0', '0', ';', '', 0, 'YToyOntpOjA7czo4MToiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9UZWEtQmVsdmVkZXJlLUZydWl0LU1peC1Gb3ItRHVtbWllcy04LWctMTItcGNzIjtpOjE7czowOiIiO30='),
('TC-1-4-063', 1, 1710, '', 'Belvedere', 'Чай в пирамидках', 'Зеленый чай Жасмин', 'не знаю', 'Германия', 250, 23, 0, 0, 'шт', '2017-09-2914-05-58_12-40-07.JPG', 'шт', '17 шт', 0, 0, 0, '', '', 'зеленый китайский байховый чай, цветки жасмина. Крупные листочки китайского чая обдаются паром для приостановки ферментации, после чего их сушат вместе с едва начавшими раскрываться бутонами жасмина.  При заваривании получается светло-желтый настой с тонким ароматом жасмина и мягким вкусом. \n\n\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '0', '0', '0', '0', '', ';', '', 0, 'YToyOntpOjA7czo3OToiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9KYXNtaW5lLVRlYS1CZWx2ZWRlcmUtZm9yLWR1bW1pZXMtNC1nLTEyLXBjcyI7aToxO3M6MDoiIjt9'),
('TC-1-4-063', 1, 1711, '', 'Belvedere', 'Чай в пирамидках', 'Черный чай Ассам', 'не знаю', 'Германия', 250, 23, 0, 0, 'шт', '2017-09-2914-05-45_12-41-27.JPG', 'шт', '17 шт', 0, 0, 0, 'Высококачественный индийский чай с лучших плантаций Северного Ассама.\n', '', ' верхние листья чайного куста и нераспустившиеся почки. Знаменитый чай с тонким нежным ароматом и слегка терпким послевкусием.\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo2ODoiaHR0cDovL2NvZmZlZWdyb3VwLnJ1L3N0b3JlLzEwMDM1MTEzLzEwMDU1NzkwLzEwMDU1Nzk3Lz9wb3M9MTAzMDQ4NzciO2k6MTtzOjA6IiI7fQ=='),
('TC-1-4-063', 1, 1712, '', 'Belvedere', 'Чай в пирамидках', 'Зеленый чай Сенча', 'не знаю', 'Германия', 250, 23, 0, 0, 'шт', '2017-09-2914-06-05_12-36-39.JPG', 'шт', '17 шт', 0, 0, 0, 'Зеленый чай плоской скрутки, с нежнейшими травяными нотками. Каждый листок чая собран с самой верхушки чайного куста и обработан с учетом всех традиций Японии. Экологическая и правильная упаковка от Бельведер, позволят максимально долго сохранить свежесть каждого листа.\n', '', 'Байховый китайский чай обработан по Японским традициям из молодых листьев первого сбора.', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo3MDoiaHR0cDovL2hhcHB5Y3VwNS5ydS90ZWEvcGFrZXRpcm92YW5ueXktY2hheS1kbHlhLWNoYXNoZWsvc2VuY2hhLXNlbmNoYSI7aToxO3M6Njg6Imh0dHA6Ly9jb2ZmZWVncm91cC5ydS9zdG9yZS8xMDAzNTExMy8xMDA1NTc5MC8xMDA1NTc5Ny8/cG9zPTEwMzA0ODc0Ijt9'),
('TC-1-4-063', 1, 1713, '', 'Belvedere', 'Чай в пирамидках', 'Черный байховый чай Эрл Грей', 'не знаю', 'Германия', 250, 23, 0, 0, 'шт', '2017-09-2914-05-54_12-40-51.JPG', 'шт', '17 шт', 0, 0, 0, 'Хорош в употреблении, как в чистом виде, так и с парой капелек молока.\n', '', 'чай черный байховый, эфирное масло бергамота. Отборные листочки чая сушатся вместе с бутонами бергамота. Пропитанные дополнительно эфирными маслами, полученными из кожуры и цветов этого растения, они обладают насыщенным ароматом.\n\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo2ODoiaHR0cDovL2NvZmZlZWdyb3VwLnJ1L3N0b3JlLzEwMDM1MTEzLzEwMDU1NzkwLzEwMDU1Nzk3Lz9wb3M9MTAzMDQ4ODAiO2k6MTtzOjc4OiJodHRwOi8vd3d3LnRlYS1jb2ZmZWUucnUvQmVsdmVkZXJlL0VhcmwtR3JleS1UZWEtQmVsdmVkZXJlLVB5cmFtaWRzLTMtZy0xNy1wY3MiO30='),
('TC-1-4-063', 1, 1714, '', 'Belvedere', 'Чай в пирамидках', ' Бирюзовый чай Молочный Улун ', 'Молочный улун', 'Германия', 290, 23, 0, 0, 'шт', '2017-09-2914-05-39_12-42-06.JPG', 'шт', '17 шт', 0, 0, 0, ' Один из самых популярных и любимых в России видов чая.', '', 'молочный улун. Изготавливается из китайского улуна высшего сорта. Крупные зрелые чайные листья впитывают сливочный пломбирный аромат, добавляемый в процессе частичной ферментации. Данный напиток обладает всеми полезными свойствами улуна: он насыщает организм антиоксидантами, препятствующими старению, улучшает обмен веществ, укрепляет стенки сосудов и очищает их, расщепляет жиры.', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo5OToiaHR0cDovL3d3dy5iYXJpc3Rhcy5ydS9iZWx2ZWRlcmUtbW9sb2Nobnl5LXVsdW4tdnlzc2hleS1rYXRlZ29yaWktYmlyeXV6b3Z5eS1jaGF5LXVsdW4tcGFrZXQtNTAwLWcvIjtpOjE7czozMToiaHR0cDovL3d3dy5sYXR0ZS5ydS90b3Zhci8xMDg3NCI7fQ=='),
