('TC-1-4-063', 1, 1716, '', 'Belvedere', 'Чай в пакетиках', 'Зеленый чай Мятный Марракеш', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-04-56_12-45-00.JPG', 'шт', '25 шт', 0, 0, 0, 'Прекрасный вариант утреннего чая. Яркий, свежий вкус с терпкой ноткой и долгим приятным послевкусием.\n', '', 'зеленый нефрит, мята. Обладает тонизирующим, оздоравливающим эффектом. Чайный бленд с большим содержанием мяты не рекомендуется употреблять сильной половине человечества после семи часов вечера. Можно употреблять как самостоятельный продукт, можно использовать, как добавку.', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1OToiaHR0cDovL2NvZmZlZWdyb3VwLnJ1L3N0b3JlLzEwMDM1MTEzLzEwMDM1MTE1Lz9wb3M9MTAyNDIxNjgiO30='),
('TC-1-4-063', 0, 1717, '', 'Belvedere', 'Чай в пакетиках', 'Зеленый чай  Голубое Небо', 'не знаю', 'Германия', 0, 23, 0, 0, 'шт', '2017-09-2914-04-45_12-45-39.JPG', 'шт', '25 шт', 0, 0, 0, 'Нежнейшее сочетание зеленого китайского чая. ', '', 'цветов мальвы, василька, лепестков сафлора, подсолнечника и бутонов роз.  Смесь придает чаю нежность и сладость вкуса, а аромат наполняет прекрасным ароматом весеннего луга.', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo2ODoiaHR0cDovL2NvZmZlZWdyb3VwLnJ1L3N0b3JlLzEwMDM1MTEzLzEwMDU1NzkwLzEwMDU1Nzk3Lz9wb3M9MTAzMDQ4NzgiO30='),
('TC-1-4-063', 1, 1718, '', 'Belvedere', 'Чай в пакетиках', 'Черный чай Ассам', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-04-35_12-46-13.JPG', 'шт', '25 шт', 0, 0, 0, 'Высококачественный индийский чай с лучших плантаций Северного Ассама.\n', '', ' верхние листья чайного куста и нераспустившиеся почки. Знаменитый чай с тонким нежным ароматом и слегка терпким послевкусием.\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo2ODoiaHR0cDovL2NvZmZlZWdyb3VwLnJ1L3N0b3JlLzEwMDM1MTEzLzEwMDU1NzkwLzEwMDU1Nzk3Lz9wb3M9MTAzMDQ4NzciO2k6MTtzOjA6IiI7fQ=='),
('TC-1-4-063', 1, 1719, '', 'Belvedere', 'Чай в пакетиках', 'Чай черный Английский Завтрак', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-04-29_12-47-01.JPG', 'шт', '25 шт', 0, 0, 0, 'Традиционный утренний чай. ', '', 'смесь цейлонского и индийского черного чая. Насыщенный крепкий вкус и богатый аромат. Отлично сочетается с молоком, сладостями, выпечкой.\n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czozMToiaHR0cDovL3d3dy5sYXR0ZS5ydS90b3Zhci8xMDQ2MSI7fQ=='),
('TC-1-4-063', 1, 1720, '', 'Belvedere', 'Чай в пакетиках', 'Фруктовый чай  Ройбуш Карамель', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-04-18_12-48-06.JPG', 'шт', '25 шт', 0, 0, 0, 'Уникальный напиток премиум-класса, приготовленный с добавлением кусочков карамели. ', '', 'южноафриканский ройбуш, карамель, клубника,  ваниль.  Цельные листики южноафриканского растения ройбуш, раскрываясь в горячей воде, дают настой насыщенно- медового цвета. Обладающий тонким ароматом ванили и клубники, этот десертный напиток придется по душе любителям сладостей. ', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo4NzoiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9CZWx2ZWRlcmUtVGVhLVJvb2lib3MtQ2FyYW1lbC1Gb3ItRHVtbWllcy02LWctMTItcGNzIjt9'),
('TC-1-4-063', 1, 1721, '', 'Belvedere', 'Чай в пакетиках', 'Фруктовый микс чай', 'не знаю', 'Германия', 119, 23, 0, 0, 'шт', '2017-09-2914-04-12_12-48-39.JPG', 'шт', '25 шт', 0, 0, 0, 'Нежнейший купаж на основе фруктов и трав.', '', 'гибискус, кокосовая стружка, кусочки банана, виноград, яблоко, лепестки роз, цукаты ананаса и папайи, цветки василька.Обладающий легкой кислинкой бленд строится на основе популярного каркаде. Тропический аромат формируют кокос, виноград, банан, папайя и ананас. Часть богатых витаминами фруктов представлена в виде сладких цукатов, придающих настою особую нежность. \n', '', 'Belvedere', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToyOntpOjA7czo4MToiaHR0cDovL3d3dy50ZWEtY29mZmVlLnJ1L0JlbHZlZGVyZS9UZWEtQmVsdmVkZXJlLUZydWl0LU1peC1Gb3ItRHVtbWllcy04LWctMTItcGNzIjtpOjE7czozMjoiaHR0cDovL3d3dy5iZWx2ZWRlcmV0ZWEucnUvcGFjay8iO30='),
