('Корзина', 1, 1948, NULL, 'Ичалки', 'Olider сыр', NULL, 'твёрдый', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-39-02_08-58-34.JPG', 'кг', NULL, 0, 0, 0, 'Твердый сыр «Олидер». Сыр \"Новинка\", который уже понравился большинству наших потребителей. Не менее 3 месяцев выдерживаемый сыр приобретает выделяющийся среди сыров вкус и аромат.\n\nСыр вырабатывается из высококачественного молока по специальной технологии', NULL, NULL, '8 мес. (при температуре 0-6 °С, влажности 80-85%)', 'ООО «СЫРОДЕЛЬНЫЙ КОМБИНАТ \"ИЧАЛКОВСКИЙ\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, '45%', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
