('Корзина', 1, 1950, NULL, 'Ичалки', 'Диетический легкий сыр', NULL, 'полутвёрдый', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-38-51_09-00-07.JPG', 'кг', NULL, 0, 0, 0, 'Сыр «Диетический», с пониженным содержанием жира, изготовлен из натурального коровьево молока без применения консервантов и растительных добавок. Сыр с нежным молочным вкусом и ароматом. Консистенция нежная и эластичная.\n\nБлагодаря низкому содержанию жира,', NULL, 'Составе: пастеризованное молоко, с использованием мезофильных молочнокислых микроорганизмов, сычужного фермента животного происхождения NATUREN, поваренная пищевая соль. Сыр содержит витамины группы В, D, Н и РР, а также нужные организму минеральные вещества: калий, кальций, магний, железо, фосфор и натрий, способствующие укреплению костной ткани и эмали зубов.', '8 мес. (при температуре 0-6 °С, влажности 80-85%)', 'ООО «СЫРОДЕЛЬНЫЙ КОМБИНАТ \"ИЧАЛКОВСКИЙ\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '164 ккал', NULL, '27%', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Корзина', 1, 1951, NULL, 'Ичалки', 'Пошехонский сыр', NULL, 'полутвёрдый', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-38-44_09-00-35.JPG', 'кг', NULL, 0, 0, 0, 'Натуральный сычужный сыр с выраженным сырным вкусом, пластичная одноразовая консистенция. Этот сыр получил большую популярность среди потребителей, прекрасно подходит к салатам и бутербродам.', NULL, NULL, '8 мес. (при температуре 0-6 °С, влажности 80-85%)', 'ООО «СЫРОДЕЛЬНЫЙ КОМБИНАТ \"ИЧАЛКОВСКИЙ\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, '45%', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
