('Корзина', 1, 1954, NULL, 'Починки', 'Мраморный сыр', NULL, 'полутвёрдый', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-38-05.JPG', 'кг', NULL, 0, 0, 0, 'Готовят его из молока коровы используя 2 разных продуктов, благодаря натурального красителя получается сыр похожа на мрамор', NULL, 'Мраморный– полутвердый сыр содержит полезные витамины и минералы  к примеру, омега 3 и омега 6, а также фосфор и кальций, которые необходимы для жизнедеятельности.\nБелки: 24.8 г.\nЖиры: 25.2 г.\nУглеводы: 0 г.', '180 суток', 'АО МСЗ «Починковский»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '326', '24.8', '25.2', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 1955, '', '', 'Лангустины живые', 'Лангустины живые', 'Лангусты', 'Австралия', 8000, 20, 0, 0, '', '2017-11-1314-25-25_23-07-33.JPG', 'кг', '', 0, 0, 0, 'Лангустин — один из самых вкусных видов омаров. Мясо его, является деликатесом, мягкое, и сладковатое на вкус. В кулинарии занимает одно из первых мест. Подаётся с различными соусами, а также прекрасно подходит для тех кто соблюдает диету, этот продукт низкокалорийный.\n', '200 -300 гр.', '', '5 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '99', '20,6', '1,510', '2,43', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 1956, '', '', 'Морской еж живой', 'Морской еж живой', 'Морской еж', 'Россия', 1300, 20, 0, 0, '', '2017-11-1314-24-48_23-11-38.JPG', 'кг', '', 0, 0, 0, ' Живые морские ежи – самый полезный морской деликатес.Мясо и икра морского ежа считаются эликсиром молодости и красоты.Регулярное употребление принесет неоценимую пользу для организма человека.. Чрезвычайно ценится среди гурманов икра морского ежа. ', '', '', '7 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '86', '13,8', '4,3', '2,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
