('TC-1-3-039', 1, 2057, '', 'ЭкоТаймыр', 'Оленина свежемороженная', 'Оленина свежемороженная без кости окорок в вакууме', 'Оленина', 'Россия', 1000, 18, 0, 0, '', '2017-11-1415-37-48_21-26-20.JPG', 'кг', '', 0, 0, 0, 'Мясо оленя – это экзотика.  Особую ценность оленина получила из-за нежного своеобразного вкуса и сочности. Ее относят к лечебным и диетическим продуктам, ', '', 'Оленина свежемороженная без кости окорок в вакууме', '12 месяцев', '', -4, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '141', '20,5', '6,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-3-039', 1, 2058, '', 'ЭкоТаймыр', 'Фарш из оленины 100%', 'Фарш из оленины 100% ', 'оленина', 'Россия', 659, 20, 0, 0, '', '2017-11-1415-37-29_21-27-00.JPG', 'кг', '', 0, 0, 0, 'Фарш из оленины- 100%, несоленый. Наивкуснейший продукт для диетического питания.Оленина – источник полноценного белка, насыщена минеральными веществами(железо, фосфор', '', 'Фарш из оленины- 100%, несоленый. Наивкуснейший продукт для диетического питания.\n\nОленина – источник полноценного белка, насыщена минеральными веществами(железо, фосфор', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '172', '20,0', '10,0', '0', '', ';', '', 0, 'YToxOntpOjA7czoxMDI6ItCk0LDRgNGIINC40Lcg0L7Qu9C10L3QuNC90YsgMTAwJSDQvdC1INGB0L7Qu9C10L3Ri9C5INGB0LLQtdC20LXQvNC+0YDQvtC20LXQvdC90YvQuSDQsiDQstCw0LrRg9GD0LzQtSI7fQ=='),
('TC-1-3-039', 1, 2059, '', 'ЭкоТаймыр', 'Биточки из оленины', 'Биточки из оленины таймырские свежемороженные в вакууме', 'Биточки из оленины', 'Россия', 720, 20, 0, 0, '', '2017-11-1415-36-45_21-27-41.JPG', 'кг', '', 0, 0, 0, 'Популярное на северных просторах оленье мясо знаменито не только своим вкусом, но и пользой. Ведь мясо дичи богато белком, следовательно, дарит насыщение даже от небольшой порции, при этом, ни сколько не вредя здоровью, так как практически не содержит холестерина.«Что можно приготовить из оленины?», любой среди любителей дичи сразу посоветует вам сделать биточки. Блюда из фарша оленины при верном приготовлении чрезвычайно нежны и пикантны.\n\n\n', '', ' Оленина, сердце оленя 50%, лук, чеснок, соль, перец .', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '261,4', '13,3', '19,4', '87', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-3-039', 1, 2060, '', 'ЭкоТаймыр', 'Оленина шпигованная', 'Оленина шпигованная', 'Оленина шпигованная', 'Россия', 940, 18, 0, 0, '', '2017-11-1415-36-11_21-28-15.JPG', 'кг', '', 0, 0, 0, 'Мясо оленя отличается высоким содержанием полезных компонентов. Из-за низкой калорийности оленину полезно включать в меню людям, ведущим здоровый образ жизни, а также пожилым людям, детям, спортсменам.Крупные куски оленины шпигуют шпиком, нарезанным брусочками, заливают маринадом и выдерживают в течение 25-30 мин. Затем вынимают, обжаривают с двух сторон и тушат с добавлением маринада и соуса красного (основного).\nПри отпуске шпигованную оленину нарезают на 1-2 куска на порцию, гарнируют, поливают соусом, в котором она тушилась.\nГарниры - макароны отварные, картофель отварной, картофель жареный из вареного, картофель жареный из сырого, капуста тушеная.\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '215,41', '8,36', '14', '6,31', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
