('Птица СЦ', 1, 2079, NULL, 'Утолина', 'Тушка утенка', 'Тушка утенка охлажденая', 'Утка', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1415-24-47_21-42-36.JPG', 'кг', NULL, 0, 0, 0, 'Тушка утенка - это полезный продукт, который несмотря на свою жирность, имеет сбалансированный и оптимальный состав, обладающий профилактическими и лечебными свойствами .Тушка отличается нежным, сочным вкусом и небольшим количеством подкожного жира, позволяющим готовить утку гораздо быстрее и проще обычной.', NULL, NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '245', '16', '20', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 2080, NULL, 'Роскар', 'Тушка курицы', 'Тушка курицы замороженная', 'Курица', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1415-24-13_21-43-05.JPG', 'кг', NULL, 0, 0, 0, 'Курица – продукт самый распространенный во всём мире. Неисчислимое количество блюд готовятся во всех уголках нашей планеты. Мясо курицы (домашней) считается легко усваиваемым и полезным. Один из самых простых и полезных первых блюд признан – куриный бульон, при правильном приготовление, суп получается прозрачным и аппетитным.', '1000-1200 кг.', NULL, '180 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '219', '18,1', '16,1', '0,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 2081, NULL, '', 'Цыпленок Халяль', 'Цыпленок Халяль замороженая', 'Курица', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1415-23-52_21-43-34.JPG', 'кг', NULL, 0, 0, 0, 'Мясо цыпленка является диетическим продуктом и его можно употреблять, практически на любых диетах, кроме вегетарианских. Этот продукт обычно готовят на белковых диетах. Цыпленок бройлер – это продукт для приготовления множества блюд: супов и бульонов, вторых блюд и даже закусок. Цыпленка можно обжаривать на сковороде, запекать в духовке, готовить на гриле или мангале.', '1,2-1,5 гр.', NULL, '180 суток', NULL, 0, 170, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '219', '18,7', '16,1', '05', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
