('Консерв СЦ', 1, 2164, NULL, '5 морей', 'Сайра натуральная', NULL, 'Сайра', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1614-02-05_14-55-25.JPG', 'шт', NULL, 0, 0, 0, 'Сайра — стайная рыба, образующая в определенные периоды жизни большие скопления.Питается сайра мелкими животными, обитающими в поверхностном слое воды.', NULL, 'Сайра содержит  витамины D, А и В, минеральными веществами, быстро усваиваемыми белками и незаменимыми аминокислотами.Постоянное употребление сайры способствует восполнению дефицита кальция, фосфора, магния, железа, нормализует работу желудка и кишечника, а также является профилактикой кариеса, артрита и остеопороза.', '2 года', 'ОАО ХК \"Дальморепродукт\", Владивосток.', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '270', '18', '22', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
