('Консерв СЦ', 1, 2169, NULL, '5 морей', 'Горбуша натуральная', NULL, 'Горбуша', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1614-01-07_14-59-48.JPG', 'шт', NULL, 0, 0, 0, 'Горбуша - это рыба семейства лососевых. Второе название этой рыбы - розовый лосось.\nПродукт соответствует обязательным требованиям безопасности в части определенных лабораторных показателей.', '1,2', 'Мясо горбуши сбалансировано и питательно, это источник витамина РР, пиридоксина, натрия и фтора. \nТакже рыба содержит жирные кислоты и водорастворимые витамины В12.\nСрок хранения: 2 года, при t = +0 до + 15 С.', '2 года', 'ООО “Буревестник”, Сахалин', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '138', '21', '6', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Консерв СЦ', 1, 2170, NULL, '5 морей', 'Тунец натуральный филе', NULL, 'Тунец', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1614-00-53_15-00-25.JPG', 'шт', NULL, 0, 0, 0, 'Вкусные рыбные консервы. Вкус насыщенный, тонкий рыбный аромат.', NULL, 'Никаких костей в рыбе нет, только мясо, стерилизованный тунец ( сольи специи, конечно, есть).\nВ баночке содержится 185 г филе.\nСрок хранения: 2 года, при t = +0 до + 25 С и относительной влажности воздуха не более 75%', '2 года', 'Таиланд Голден Прайз', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '663', '4', '66', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Консерв СЦ', 1, 2171, NULL, '5 морей', 'Шпроты в масле', NULL, 'Шпроты', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1614-00-48_15-00-53.JPG', 'шт', NULL, 0, 0, 0, 'Шпроты крупные в масле.', NULL, 'Копченая рыба, рост. масло, соль, /без консервантов. \nПищевая ценность в 100 г продукта.\nСрок хранения: 2 года при t = 0 + 25 С.\nХранить при температуре от 0°С до +20°С и относительной влажности воздуха не более 75%. Хранить в холодильнике после вскрытия не более 24 часов.', '2 года', 'ООО “Ранда” Латвия', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '356', '17', '32', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Консерв СЦ', 1, 2172, NULL, '5 морей', 'Шпроты в масле', NULL, 'Шпроты', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1614-00-42_15-02-54.JPG', 'шт', NULL, 0, 0, 0, 'Шпроты в масле \"5 морей\" из балтийской кильки\nШпроты обладают удовлетворительными органолептическими свойствами, нежной консистенцией. \nТара: жестяная банка.\nНетто: 175 г.', NULL, 'Рыба копченная, масло подсолнечное, соль пищевая. ГОСТ 280-2009.\nШпроты обладают удовлетворительными органолептическими свойствами, нежной консистенцией.\nХранить при температуре от 0°С до +20°С и относительной влажности воздуха не более 75%. Хранить в холодильнике после вскрытия не более 24 часов.', '730 дней', 'ООО \"Пролив\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '360', '17', '32', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
