('Соления', 1, 2222, NULL, '', 'Морская капуста', 'Морская капуста', 'Морская капуста', 'Россия', 225, 15, 125, 2, 'кг', '2017-11-1613-18-28_16-03-17.JPG', 'кг', NULL, 0, 0, 0, 'Морская капуста благоприятно влияет на нервную систему, стимулирует мозговую деятельность, нормализует уровень холестерина.Защищает организм от вирусов.Ещё морская капуста способна очищать организм от вредных шлаков и токсинов. При постоянном употреблении морской капусты происходит омоложение организма, снижение веса, лечение и профилактика онкологических заболеваний, некоторых заболеваний щитовидной железы.', NULL, NULL, '10 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '61', '1', '5', '3', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2223, NULL, '', 'Спаржа', 'Спаржа', 'Спаржа', 'Россия', 315, 15, 175, 2, 'кг', '2017-11-1613-18-19_16-04-47.JPG', 'кг', NULL, 0, 0, 0, 'Полезные свойства маринованной спаржи заключаются в наличии в ней витаминов С, РР, В1, В2, В5,В6, а также уникального вещества аспарагина. Много в маринованной спарже минеральных веществ: фосфора, натрия, магния, кальция.', NULL, NULL, '7 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '15', '1,8', '0,2', '1,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2224, NULL, '', 'Кальмары', 'Кальмары соленые', 'Кальмары', 'Россия', 1080, 15, 600, 2, 'кг', '2017-11-1613-18-16_16-05-17.JPG', 'кг', NULL, 0, 0, 0, 'Мясо кальмара обладает не только отменным вкусом, питательной ценностью, но и целебными свойствами, не случайно этого моллюска называют «морским женьшенем».', NULL, NULL, '14 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '201,1', '43,1', '2,4', '1,3', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2225, NULL, '', 'Опята', 'Опята соленые', 'Опята', 'Россия', 765, 15, 425, 2, 'кг', '2017-11-1613-17-54_16-09-28.JPG', 'кг', NULL, 0, 0, 0, 'Маринованные опята обладают прекрасной питательной ценностью и пользой (calorizator). Биохимический состав опят включает большое количество витаминов: С, Е, РР и группы В. Наделены они и микроэлементами например, фосфором, кальцием, калием, медью, цинком, железом и другими). Также в них присутствуют природные сахара, ценные аминокислоты, зола и клетчатка. По содержанию фосфора и кальция опята могут конкурировать с рыбой.', NULL, NULL, '14 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '22', '2,2', '1,2', '0,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
