('Соления', 1, 2228, NULL, '', 'Улитки', 'Улитки маринованые', 'Улитки', 'Россия', 1080, 15, 600, 2, 'кг', '2017-11-1613-17-13_16-16-08.JPG', 'кг', NULL, 0, 0, 0, 'Полезные свойства мяса улиток связаны прежде всего с их диетичностью, калорийность составляет всего 90 ККал на 100 граммов, причем 70% объема калорий приходится на белок, которого здесь больше, чем в курином яйце. Также состав улиток содержит незаменимые жирные кислоты, способствующие снижению уровня холестерина в крови и укрепляющие сердечно-сосудистую систему.', NULL, NULL, '14 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '90', '16,1', '1,4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2229, NULL, '', 'Морковь по-корейски', 'Морковь по-корейски', 'Морковь', 'Россия', 225, 15, 125, 2, 'кг', '2017-11-1613-17-10_16-16-51.JPG', 'кг', NULL, 0, 0, 0, 'Морковь по-корейски рекомендуется употреблять людям, у которых в рационе недостает витаминов и микроэлементов. Поскольку в этом продукте есть клетчатка, и относится он к низкокалорийным, его можно включить в меню в период диеты. Грубые волокна, которые есть в морковке по-корейски, улучшают моторику пищеварительного тракта, что позволяет использовать ее при запорах.', NULL, NULL, 'до 20 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '1126', '1,2', '8,2', '9', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2230, NULL, '', 'Томаты выленые', 'Томаты выленые', 'Томаты', 'Россия', 1980, 15, 1100, 2, 'кг', '2017-11-1613-16-52_16-18-58.JPG', 'кг', NULL, 0, 0, 0, 'Вяленые томаты имеют среднюю калорийность, в связи с этим их можно употреблять в период диеты. Главное – знать меру. Вяленые томаты рекомендуется употреблять в пищу при авитаминозе, недостатке в организме микроэлементов, сниженном иммунитете.Вяленые томаты являются прекрасным антидепрессантом, так как они улучшают работу нервной системы.', NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '258', '14,1', '3', '43,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2231, NULL, '', 'Оливки', 'Оливки с косточкой', 'Оливки с косточкой', 'Россия', 1080, 15, 600, 2, 'кг', '2017-11-1613-16-45_16-22-02.JPG', 'кг', NULL, 0, 0, 0, 'Оливки богаты пищевыми волокнами, положительно влияющими на деятельность пищеварительного тракта и улучшающими перистальтику кишечника, содержат антиоксиданты, борющиеся со старением (calorizator). Полиненасыщенные жирные кислоты снижают уровень глюкозы в крови, уменьшают образование тромбов и сохраняют эластичность стенок сосудов.', NULL, NULL, '3-4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '115', '08', '10,7', '6,3', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
