('Соления', 1, 2235, NULL, '', 'Соленый перец', 'Соленый перец острый', 'Оливки', 'Россия', 315, 15, 175, 2, 'кг', '2017-11-1613-16-25_16-24-02.JPG', 'кг', NULL, 0, 0, 0, 'Регулярное употребление горького перца даже в маринованном виде стимулирует выработку эндофрина, его еще называют «гормоном счастья». Когда человек чувствует острый вкус, головной мозг получает сигнал о возможной опасности.', NULL, NULL, '3- 4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '17,0', '1,3', '0', '4,9', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2236, '', '', 'Чеснок маренованный', 'Чеснок маренованный', 'Перец', 'Россия', 495, 15, 275, 2, 'кг', '2017-11-1613-16-14_16-24-45.JPG', 'кг', '', 0, 0, 0, 'Польза маринованного чеснока при бактериальных вирусных заболеваниях, атеросклерозе и цинге. Его могут рекомендовать для снижения опасного холестерина, а также при профилактике и лечении болезней сердца и сосудов. ', '', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42,4', '1,8', '0,1', '9,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2237, '', '', 'Чеснок маренованный', 'Чеснок маренованный', 'Чеснок', 'Россия', 495, 15, 275, 2, 'кг', '2017-11-1613-16-09_16-25-19.JPG', 'кг', '', 0, 0, 0, 'Польза маринованного чеснока при бактериальных вирусных заболеваниях, атеросклерозе и цинге. Его могут рекомендовать для снижения опасного холестерина, а также при профилактике и лечении болезней сердца и сосудов. ', '', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42,4', '1,8', '0,1', '9,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2238, NULL, '', 'Помидоры соленые', 'Помидоры соленые', 'Помидоры соленые', 'Россия', 180, 15, 100, 2, 'кг', '2017-11-1613-16-01_16-25-57.JPG', 'кг', NULL, 0, 0, 0, 'Соленые помидоры содержат в себе практически все полезные вещества идентичные свежим плодам. В этом овоще находится природный и очень полезный антиоксидант – ликопин. Таким образом, употребление в пищу соленых помидоров в умеренном количестве помогает значительно уменьшить риск возникновения заболеваний поджелудочной и предстательной железы. Кроме этого плоды, приготовленные таким образом, улучшают состояние сердца, сосудов и шейки матки.', NULL, NULL, '3 - 4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '13', '1,1', '0,1', '1,6', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2239, '', '', 'Листья виноградные', 'Листья виноградные соленые', 'Листья виноградные', 'Россия', 315, 15, 175, 2, 'кг', '2017-11-1613-15-58_16-26-30.JPG', 'кг', '', 0, 0, 0, 'Благодаря присутствию этого витамина виноградные листья полезны при заболеваниях органов зрения, падении его остроты, хронической усталости глаз. Регулярное включение в меню блюд из листьев винограда способствует улучшению качества кожи и волос. А вместе с кальцием каротин благотворно влияет на нервную систему и состояние мышц.', '', '', '3 - 4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '93', '5,6', '2,12', '6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 2240, NULL, '', 'Огурцы соленые', 'Огурцы соленые', 'Огурцы', 'Россия', 180, 15, 0, 0, NULL, '2017-11-1613-15-50_16-32-39.JPG', 'кг', NULL, 0, 0, 0, 'огурцы заключается в их химическом составе, в который ходит богатый набор микроорганизмов, обладающих контролирующим воздействием на развитие и рост вредных кишечных бактерий.', NULL, NULL, '3-4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0,84', '0,6', '0,08', '2,03', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
