('Вода СЦ', 1, 2393, NULL, 'Baikal Pearl', 'Питьевая вода', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-10-0317-26-25_13-24-26_13-24-59_15-29-57.JPG', 'шт', '1250 мл', 0, 0, 0, 'Столовая негазированная вода.\nДопускается естественный осадок минеральных солей.', NULL, 'Гидрокарбонатная магниево-кальциевая.\nМинерализация: 0,19-0,31г/л. \nАнионы, мг/л: гидрокарбонаты 148-220; сульфаты 1-6; хлориды 1-8.\nКатионы мг/л: кальций 28-45; магний 5-13; натрий + калий 5-20.\nХранить в проветриваемых затемненных помещениях при температуре от +5\'С до +20\'С.\nПосле вскрытия упаковки продукт хранить при температуре от +2\'С до +6\'С с закрытой крышкой не более суток', '24 месяцев', 'АО ГК \"Море Байкал\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czozOToiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzY3LzI5MDkyNTk0Ijt9'),
('Вода СЦ', 1, 2394, NULL, 'Baikal Pearl', 'Питьевая вода', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-10-0317-26-14_13-28-28_13-29-05_15-30-22.JPG', 'шт', '280 мл', 0, 0, 0, 'Столовая негазированная вода.\nЛегендарный Байкал пополняется реками, которые спускаются с окружающих озеро байкальских гор, и родниками, бьющими из-под земли.', NULL, 'Бикарбонаты:	186.1 мг/л\nКремний:	13.3 мг/л\nНитраты:	2.7 мг/л\nКалий:	8.38 мг/л\nКальций:	40.9 мг/л\nМагний:	8.8 мг/л\nХлориды:	< 2 мг/л\nСульфаты:	< 4 мг/л\nХранить в проветриваемых затемненных помещениях при температуре от +5\'С до +20\'С.\nПосле вскрытия упаковки продукт хранить при температуре от +2\'С до +6\'С с закрытой крышкой не более суток', '24 месяцев', 'ЗАО «Байкал»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, ''),
