('Вода СЦ', 1, 2407, NULL, 'Baikal Pearl', 'Питьевая вода', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-10-0317-23-20_14-53-04.JPG', 'шт', '530 мл', 0, 0, 0, 'Столовая негазированная вода.\nПриродная питьевая вода Baikal Pearl добывается из подземных источников, не подверженных внешнему влиянию.', NULL, 'Она богата минеральными веществами, полезными для здоровья. Поскольку вода негазированная, она прекрасно походит как для приготовления пищи, так и для утоления жажды.\nГидрокарбонатная магниево-кальциевая.\nМинерализация: 0,19-0,31г/л. \nАнионы, мг/л: гидрокарбонаты 148-220; сульфаты 1-6; хлориды 1-8.\nКатионы мг/л: кальций 28-45; магний 5-13; натрий + калий 5-20.\nРекомендуется хранить при температуре от +2°С до +25°С', '24 месяцев', 'АО ГК \"Море Байкал\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czo3NDoiaHR0cHM6Ly9mcmVzaGJyb2Njb2xpLnJ1L2NhdGFsb2cvMTgyM19iYWlrYWwtcGVhcmwtYmV6LWdhemEtc3Rla2xvLTAtNTMtbC8iO30='),
('Вода СЦ', 1, 2408, NULL, 'Baikal Pearl', 'Газированная вода', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-10-0317-23-02_15-01-21_15-06-29_15-08-33.JPG', 'шт', '530 мл', 0, 0, 0, 'Вода Baikal Reserve- минеральная лечебно-столовая слабогазированная. \n Она рождается на глубине 352 метра, а ее путь на поверхность занимает около 300 лет.', NULL, 'Гидрокарбонаты	225-350, сульфаты	600-1100, хлориды 200-460, кальций	200-320, магний	50-150, натрий+калий 100-350.\n Проходя сквозь слои горных и подземных пород, вода обогащается минеральными и органическими веществами, приобретая в итоге свой уникальный химический состав.', '12 месяцев', 'АО ГК \"Море Байкал\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '0', '0', '0', '0', '0', ';', NULL, 0, 'YToyOntpOjA7czoxNTI6Imh0dHBzOi8vd3d3LnBlcmVrcmVzdG9rLnJ1L2NhdGFsb2cvc29raS12b2R5LW5hcGl0a2kvdm9keS1taW5lcmFsbnllLXBpdGV2eWUvYmFpay1yZXMtdm9kYS1pcmstYmF5ay16YXAtb2wtZ2F6LTAtNTNsLS0zMTA2MTk/c2VhcmNoUGhyYXNlPUJhaWthbCUyMFBlYXJsIjtpOjE7czowOiIiO30='),
