('TC-1-2-037', 1, 2426, '', '', 'Говядина - филейный край', 'Толстый филейный край', 'Говядина', 'Россия', 0, 0, 0, 0, '', '6ааа.JPG', 'кг', '', 0, 0, 0, 'Филейная вырезка говяжья — эта ценнейшая часть говяжьей туши является внешней частью спины животного. Из говяжьей вырезки нарезают знаменитый ростбиф, структура его волокон рыхлая и нежная.Говяжья вырезка борется с анемией, укрепляет мышцы, иммунитет, сердечно - сосудистую систему.\n\n', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '113', '20,1', '3,5', '0', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2427, '', '', 'Говядина - филейный край', 'Тонкий филейный край', '', 'Россия', 0, 0, 0, 0, '', '7aaa.JPG', 'кг', '', 0, 0, 0, 'Филейная вырезка говяжья — эта ценнейшая часть говяжьей туши является внешней частью спины животного. Из говяжьей вырезки нарезают знаменитый ростбиф, структура его волокон рыхлая и нежная.Говяжья вырезка борется с анемией, укрепляет мышцы.', '', '', '10 дней', 'Астра', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '142,75', '20', '6,5', '0', '', ';', 'https://aydaeda.ru/blogs/1', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2428, '', '', 'Пашина - говяжья', 'Пашина - говяжья', 'Говядина', 'Россия', 0, 0, 0, 0, '', '5ааа.JPG', 'кг', '', 0, 0, 0, 'Говяжья пашина – это мясо из брюшной части тушки коров.Пашина относится к мясу первого сортаак как пашина – это вырезка из грудной части тушки, она имеет небольшую жировую прослойку, плотное мясо и не имеет костей. ', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '225', '18,9', '16,6', '0', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2429, '', '', 'Лопатка говяжья', 'Лопатка говяжья', '', 'Россия', 0, 0, 0, 0, '', '8aaa.JPG', 'кг', '', 0, 0, 0, '  Говядина считается самым низкокалорийным видом мяса, не удивительно, что многие люди выбирают именно её для приготовления различных блюд.Лопатка считается одной из наиболее вкусных частей коровьей туши. Там находится самое нежное и сочное мясо, которое можно тушить, жарить или запекать в духовке.', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '137', '19,4', '6,6', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2430, '', '', 'Грудинка говяжья', 'Грудинка говяжья', '', 'Россия', 0, 0, 0, 0, '', '10aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжья грудинка — это мясо, которое вырезано из передней части говяжьей туши, верхнего отдела  грудной клетки.Структура грудинки слоистая, с множеством соединительных волокон и жировой тканью.Грудинка  — хороший источник белка и всех жизненно необходимых для человека веществ.', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '224,6', '12', '17,4', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2431, '', '', 'Шея говяжья', 'Шея говяжья', '', 'Россия', 0, 0, 0, 0, '', '9aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжья шейная часть – это часть говяжьей туши, которая известна как затылок. Это мясо имеет прослойки жира и сухожилия. За свои полезные качества говядина популярна во всём мире, а её шейная часть  богата витаминами и минералами.Содержит в себе ценный коллаген и эластин – главный строительный материал связок между суставами. Употребление говядины, приносит только пользу нашему организму.', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '135', '19,4', '6,4', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2432, '', '', 'Рёбра говяжьи', 'Рёбра говяжьи', '', 'Россия', 0, 0, 0, 0, '', '11aaa.JPG', 'кг', '', 0, 0, 0, 'Говяжьи ребра -  Отличается наличием жировых прослоек, а также прекрасными вкусовыми качествами. Употребляется в пищу в тушеном, отварном, реже в жареном виде.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '263', '48,6', '51,33', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2433, '', '', 'Корейка свиная', 'Корейка свиная свежая', 'Корейка свиная', 'Россия', 0, 0, 0, 0, '', '1zzz.JPG', 'кг', '', 0, 0, 0, 'Свиная корейка - шейная и спинная часть туши домашней свиньи. Включает в себя шею, реберное каре и филе. Эта часть свиной туши отличается в меру упругим сочным однородным мясом, окрашенным в темно-красный цвет и окруженным тонким слоем жира.', '', '', ' 12  суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '172', '67,9', '32,06', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2434, '', '', 'Ребра свиные очищенные', 'Ребра свиные очищенные свежие', 'Ребра свиные очищенные', 'Россия', 0, 0, 0, 0, '', '2zzz.JPG', 'кг', '', 0, 0, 0, 'Это часть грудинки (верхняя), которая состоит из мышечного слоя, средней части ребер и небольшого количества жира. Самым вкусным является мясо межреберных промежутков - оно нежное, сочное и просто тает во рту. Свиные ребра обладают всеми полезными свойствами свинины - они содержат большое количество белка, витамины, минералы и микроэлементы, необходимые для жизнедеятельности человека. ', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '321', '15,2', '29,3', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2435, '', '', 'Окорок свиной б/к', 'Окорок свиной б/к', 'Свинина', 'Россия', 0, 0, 0, 0, '', '3zzz.JPG', 'кг', '', 0, 0, 0, 'Наиболее востребованной частью свиньи является окорок. Эта часть идеально подходит и для запекания в духовке, и для обжаривания на вертеле, и для фарша, и для копчения.', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '261', '18', '21,3', '0,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2436, '', '', 'Лопатка свиная б/к', 'Лопатка свиная б/к', 'Свинина', 'Россия', 0, 0, 0, 0, '', '4zzz.JPG', 'кг', '', 0, 0, 0, ' Мясо свиной лопатки – это одна из самых лучших частей свиньи.Свиная лопатка годится для приготовления таких блюд, как шашлык, отбивные, эту часть свинины используют для фарша, а вообще для приготовления практически любого блюда из свинины подойдет свиная лопатка.\n', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '325', '14,7', '29,4', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2437, '', '', 'Карбонад свиной б/к', 'Карбонад свиной б/к', 'Свинина', 'Россия', 0, 0, 0, 0, '', '5zzz.JPG', 'кг', '', 0, 0, 0, 'Свиной карбонад высоко ценится гурманами по сему миру.', '', '', '12 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '301', '17,0', '25,0', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2438, '', '', 'Баранина -  шейка', 'Баранина  шейка  на кости', '', 'Россия', 0, 0, 0, 0, '', '1qqq.JPG', 'кг', '', 0, 0, 0, ' Шурма, лагман и другие вкуснейшие супы готовятся на основе бульона из бараньей шеи. Очень популярное и вкусное мясо, требующее неспешного приготовления и радующее вас своим вкусом.', '', '', '7 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '220', '14', '18', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2439, '', '', 'Баранина - грудинка', 'Баранина - грудинка', '', 'Россия', 0, 0, 0, 0, '', '2qqq.JPG', 'кг', '', 0, 0, 0, '.Грудинка баранья,,содержит достаточно большое количество жировых прослоек, поэтому лучше всего порезать ее на небольшие кусочки и приготовить плов, рагу, азу, шашлык или суп харчо. Баранина - популярное в мировой кулинарии мясо.\n\n\n\n\n', '', '', '7суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '222,6', '14', '17,4', ',0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-037', 1, 2440, '', '', 'Баранина - лопатка', 'Баранина лопатка  на кости', '', 'Россия', 0, 0, 0, 0, '', '3qqq.JPG', 'кг', '', 0, 0, 0, ' Лопатка баранья на кости – это передняя часть баранины. Идеально подходит для любых блюд из баранины, особенно для запекания При обжарке или запекании баранья лопатка приобретет красивую хрустящую корочку и станет главным блюдом любого праздничного или обеденного стола.', '', '', '7 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '225', '17', '17,7', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
