('TC1-3-028', 1, 2466, '', 'Новиков', 'Императорская ветчина', 'Императорская ветчина', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-11-1615-13-43_13-38-35.JPG', 'кг', '', 0, 0, 0, 'Один их самых народных продуктов.Вырабатывается из нежирной свинины,\nотличается нежной консистенцией,\nхарактерным рисунком и прекрасными вкусо-\nвыми качествами.', '', '', '30 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '277,0', '10,0', '25,0', '3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 2467, '', '', 'Кровяная с чесноком', 'Кровяная с чесноком', 'Свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-11-55_13-39-17.JPG', 'кг', '', 0, 0, 0, 'Кровяная колбаса готовится из свиной, телячьей и бычьей крови, а также из специального фарша .Кровяная колбаса является не только вкусным самостоятельным продуктом, ее также используют для приготовления разных блюд.', '', 'Кровянка имеет в своём составе и достаточное количество полноценного белка. Много в ней и важных аминокислот: лизина, гистидина, триптофана и валина (калоризатор). А вот благодаря высокому содержанию железа эта колбаса может стать достойной альтернативой лекарственных средств. В частности, для лечения железодефицитной анемии.', '3 дня', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '379', '58,4', '31,05', '5,16', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 2468, '', '', 'Телячья домашняя', ' Телячья домашняя рубленная', '', 'Белоруссия', 0, 0, 0, 0, '', '2017-11-1615-09-51_13-40-25.JPG', 'кг', '', 0, 0, 0, 'В отличие от всех остальных сортов колбасы, рубленная колбаса получается на вкус более мясистой, в ней ощущаются кусочки мяса.Такое блюдо украсит любой праздничный стол, а мясоеды будут в восторге.', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '318', '12', '30', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 2469, '', '', 'Украинская', 'Украинская', 'не знаю', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-08-41_13-41-12.JPG', 'кг', '', 0, 0, 0, 'Ароматная домашняя колбаса по-украински, незаменимый продукт праздничного стола, по праву называется королевой всех колбас. Поэтому, побаловать себя и своих родных вкуснейшей колбасой из свежего натурального мяса можно, не дожидаясь праздника. ', '', ' полужирное свиное мясо (почеревок или щеки) — 1 кг;\n\n— смесь перца молотого (черного и душистого) — ¼ ч.л.;\n\n— соль 15-20 г;\n\n— чеснок 1-2 дольки;', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '379', '34', '58,6', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-041', 1, 2470, '', 'Слобода', 'Подсолнечное масло', 'Масло Слобода подсолнечное рафинированное дезодорированное', 'Подсолнечник', 'Россия', 137, 23, 0, 0, 'шт', '2017-11-1614-04-32_14-29-42.JPG', 'шт', '1,8 л', 0, 0, 0, 'Благодаря гармоничному сочетанию полнозрелых семян подсолнечника и семян молочной спелости, его состав насыщен кислотами Омега-9.\nА высокое содержание витамина Е поддерживает работу сердца, заботясь о Вашем здоровье.', '', 'получено из смеси отборных семян подсолнечника молочной спелости и полнозрелых семян. Уникальная технология обработки сохраняет все полезные свойства и позволяет создавать продукт с оптимальным содержанием витаминов и жирных кислот (особенно много в нем насыщенных кислот Омега-9). \n\n', '', 'ОАО \"Эфко\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-066', 1, 2471, '', 'Олейна', 'Подсолнечное масло', 'Масло Олейна Классическая подсолнечное рафинированное дезодорированное ', 'Подсолнечник', 'Россия', 0, 0, 0, 0, 'шт', '2017-11-1614-04-25_14-51-02.JPG', 'шт', '2 л', 0, 0, 0, 'Универсально в применении. Отлично подойдет как для жарки, домашнего консервирования, \nзаправки салатов и прочего.', '', ' из отборных семян подсолнечника, прошедших строгий контроль качества и многоступенчатую систему натуральной очистки с помощью горячей воды, природной глины, длительного охлаждения, фильтрации и высоких температур. Не содержит холестерин. Богат витаминами A, E и D, а также незаменимыми жирными кислотами. \nХранить в сухом, тёмном и прохладном месте. После вскрытия бутылку хранить в холодильнике.\n', '18 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '899', '', '99.9', '', '', ';', '', 0, 'YToxOntpOjA7czozODoiaHR0cHM6Ly93d3cudXRrb25vcy5ydS9pdGVtLzQzLzExNTk0MDEiO30='),
