('Рыба СЦ', 1, 2494, NULL, '', 'Oсетр', 'Осетр горячего копчения', 'не знаю', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-15-45_09-07-00.JPG', 'кг', NULL, 0, 0, 0, 'Это нежное, достаточно жирное мясо, богатое белком, витаминами, микроэлементами, важными аминокислотами и ненасыщенными жирными кислотами. Осетрина горячего копчения - идеальное блюдо для больших семейных праздников и роскошных фуршетов!', '2,5 -3,5 кг.', NULL, '10 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '167', '17', '11', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2495, '', '', 'Устрицы Хасанские', 'Устрицы Хасанские', 'Устрицы', '', 200, 0, 0, 0, 'шт', '2017-11-1314-22-45_23-19-32.JPG', 'шт', '150г', 0, 0, 0, '  Устрицы живые Хасанские – это высококачественный морской продукт,  характерным йодистым морским вкусом с тонкой сладковатой ноткой. Дегустируйте живых устриц со свежим лимонным соком или винным уксус.Насладитесь вкусом самой знаменитой русской устрицы! \"Хасанские\" известны гурманам всего мира своим неповторимым букетом, в котором лёгкие цитрусовые ноты сочетаются со сладкими карамельными. Урожай этих устриц собирают на подводных скалах. Причудливые, многоцветные, необыкновенно красивые раковины моллюсков украсят любой стол.\n', '150г', '', '5 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '7,2', '9', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
