('Рыба СЦ', 1, 2497, NULL, '', 'Осетрина', 'Осетрина горячего копчения в коже', 'не знаю', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-16-35_09-06-23.JPG', 'кг', NULL, 0, 0, 0, 'Осетр - настоящий царский деликатес. Нежная, вкусная рыба, показатель высокого статуса. Это еще и очень полезная рыба - в осетре есть кислоты, которые редко встречаются в продуктах питания. Осётр - это ценнейшая рыба, блюда из которой всегда считались лучшие.', '2,5 -3,5 кг.', NULL, '10 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '234', '23,5', '15,6', '0', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
