('TC-1-17-034_ост', 1, 2499, '', '', 'Вонголе', 'Вонголе', 'не знаю', '', 1000, 20, 0, 0, '', '2017-11-1314-24-17_23-12-33.JPG', 'кг', '', 0, 0, 0, 'Вонголе — морские моллюски, которых добывают в Неапольском заливе в регионе Кампания. В Италии с ними готовят пасту, соусы и пиццу, а в США употребляют в свежем виде, доставая прямо из раковины. Вонголе не только вкусны, но и супер-полезны. Вот список витаминов: РР, В12, В9, В6,В5, В2, В1, Е, D, А. А вот — минеральных веществ: цинк, селен, медь, марганец, железо, фосфор, натрий, магний, кальций, калий. Хотите витаминов — ешьте Вонголе!', '', '', '5 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '59', '14,67', '0,96', '3,57', '', ';', 'Россия', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2500, '', '', 'Устрицы сахалинские', 'Устрицы сахалинские живые', 'Устрицы', 'Россия', 200, 20, 0, 0, '', '2017-11-1314-23-57.JPG', 'шт', '', 0, 0, 0, 'Те, кто пробовал устриц с Сахалина, говорят, что после этого типичные французские просто отдыхают.  Устрицы с Дальнего Востока крупнее европейских собратьев, у них солоноватый вкус и запах моря.У этого моллюска богатый химический состав. Они укрепляют нервную систему, делают глаза более зоркими. Сахалинские устрицы станут изюминкой любово праздничного стола.   ', '200 гр.', '', '5 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '72', '9,5', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2501, '', '', 'Гребешок', 'Гребешок ', 'не знаю', 'Россия', 1200, 20, 0, 0, '', '2017-11-1314-23-47_23-14-49.JPG', 'кг', '', 0, 0, 0, 'Мягкая мясистая текстура и деликатно мягкий сладковатый аромат морских гребешков нравится даже тем, кто не особенно любит рыбу или другие морские продукты. Как и многие морепродукты, морской гребешок относится к деликатесам. Содержащие жирные кислоты Омега-3 и с относительно низким содержанием калорий, они являются одними из самых богатых источников белка. Еще в этом морском деликатесе многим нравится их универсальность, они могут быть приготовлены самыми разными способами, начиная от простого обжаривания или гриля и заканчивая супами, рагу, и другими блюдами.', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '92', '17', '2', '3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
