('Много_рыбы', 1, 2507, '', '', 'Мраморная говядина', 'Мраморная говядина шоковая заморозка', 'Мраморная говядина', 'Россия', 0, 0, 0, 0, '', '2017-11-1314-17-50_09-05-31.JPG', 'кг', '', 0, 0, 0, 'Мраморная говядина относится к деликатесным видам мяса. Равномерное распределение жира в толще мышечной ткани делает его необычайно сочным и мягким. По мнению японцев, мраморная говядина — это мясо для тех, у кого нет зубов. Изысканный внешний вид, сочность и мягкость мраморной говядины позволяют ее использовать при приготовлении сырой нарезки — тартаров и карпаччо.', '', '', '8-10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '170', '18', '10', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
