('TC-1-17-034_ост', 1, 2512, '', '', 'Устрицы жемчужные', 'Устрицы жемчужные свежие', 'Устрицы', 'Новая Зеландия', 200, 20, 0, 0, 'шт', '2017-11-1314-23-05_23-17-54.JPG', 'шт', '200г', 0, 0, 0, 'У устриц нежное, с ярко выраженным вкусом и морским ароматом мясо.', '200г', '', '7 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '7,2', '9', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2513, '', '', 'Устрицы Хасанские', 'Устрицы Хасанские живые', 'Устрица', 'Россия', 200, 20, 0, 0, 'шт', '2017-11-1314-23-14_23-17-05.JPG', 'шт', '150г', 0, 0, 0, 'Необычайно экзотический вкус делают этих устриц самым желанным деликатесом.Вкусовая гамма формируется из сочетаний вкуса различных ее частей: от слабосоленого до пикантного сладкого. К тому же, это, пожалуй, самая красивая устрица из всех известных в дикой природе. ', '150 гр.', '', '5 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '7,2', '9', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2514, '', '', 'Устрицы  Соловьевская', 'Устрицы  Соловьевская', 'Устрицы', 'Сахалин', 750, 20, 0, 0, 'шт', '2017-11-1314-23-22_23-16-24.JPG', 'шт', '340г', 0, 0, 0, 'Вкусовые и полезные свойства устрицы ценятся многими гурманами, поэтому данный моллюск относится к элите гастрономического мира. Содержание витаминов, минералов, жиров и белка способно полностью удовлетворить суточную потребность организма в необходимых веществах.\nИзвестно также, что в мясе сырых устриц содержатся две очень редкие аминокислоты, которые стимулируют выработку гормонов, ответственных за сексуальное влечение.', '340г', '', '7 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '7,2', '9', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-034_ост', 1, 2515, '', '', 'Устрицы Анивские', 'Устрицы Анивские', 'не знаю', '', 750, 20, 0, 0, '', '2017-11-1314-23-34_23-15-48.JPG', 'кг', '', 0, 0, 0, 'Вкусовые и полезные свойства устрицы ценятся многими гурманами, поэтому данный моллюск относится к элите гастрономического мира. Эту устрицу можно назвать тонкой натурой с сильным  характером.', '340 гр.', '', '7 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '7,2', '9', '4,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2525, NULL, '', 'Чак ролл стейк', NULL, 'не знаю', 'Россия', 800, 5, 0, 0, NULL, '2017-11-2313-50-03_21-14-32.JPG', 'кг', NULL, 0, 0, 0, 'Чак ролл стейк из мраморной говядины охлажденный', NULL, NULL, NULL, NULL, 0, 900, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2519, '', '', 'Рибай из говядины', 'Рибай из говядины б/к зачищенный охлажденный', 'не знаю', 'Россия', 2200, 5, 0, 0, '', '2017-11-2313-51-31_21-09-41.JPG', 'кг', '', 0, 0, 0, ' Рибай из говядины - это классика.   Самая универсальная часть мраморной говядины.Содержит достаточное количества жира за счет высокой мраморности, так что мясо получается мягким, вкусным и абсолютно не требует жира при жарке.', '', '', '8 суток', '', 0, 2300, 0, '0000-00-00', '0000-00-00', 1, 1, '', '190', '17,5', '14', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2521, '', '', 'Кострец говяжий', 'Кострец говяжий б/к охлажденный', 'не знаю', 'Россия', 530, 5, 0, 0, '', '2017-11-2313-51-03_21-10-42.JPG', 'кг', '', 0, 0, 0, 'Кострец отличается своей мягкостью и имеет хорошие вкусовые качества. Его можно запекать большим куском, жарить тонкими ломтиками на гриле (предварительно отбив), использовать для фарша и тушения.Это исключительная мякоть - наиболее полезное и простое в приготовлении мясо.Благодаря отсутствию жил, блюда получаются мягкими и приятными на вкус, наличие небольшой прослойки жира, позволяет сделать стейк сочным и очень аппетитным.', '', '', '8 суток', '', 0, 630, 0, '0000-00-00', '0000-00-00', 1, 1, '', '187', '18,9', '12,0', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2522, '', '', 'Стейк пикантный', 'Стейк пикантный из мраморной говядины', 'не знаю', 'Россия', 900, 5, 0, 0, '', '2017-11-2313-50-49_21-12-54.JPG', 'кг', '', 0, 0, 0, ' Это стейк из тонкого края. Отруб располагается в поясничной части туши бычка. Отличается он своей продолговатой формой, более плотными волокнами, чем у рибая и аппетитной жировой прослойкой с одного края.', '', '', '7 дней', '', 0, 1000, 0, '0000-00-00', '0000-00-00', 1, 1, '', '170', '18', '10', '0', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2520, '', '', 'Вырезка говяжья', 'Вырезка говяжья с цепочкой б/к охлажденная', 'не знаю', 'Россия', 2200, 5, 0, 0, '', '2017-11-2313-51-18_21-10-09.JPG', 'кг', '', 0, 0, 0, 'Самая нежная, мягкая и вкусная часть туши, которая лучше всего подходит для быстрого приготовления - обжаривания или короткого запекания. Мясо почти не содержит жира и отличается превосходной нежной текстурой. Из вырезки можно приготовить большое количество праздничных блюд, которые покорят сердца всех ваших гостей.', '', '', '8 дней', '', 0, 2300, 0, '0000-00-00', '0000-00-00', 1, 1, '', '106', '20,20', '2,8', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30=');
