('TC-1-2-009', 1, 2517, '', '', 'Шейка свиная', 'Шейка свиная в/у', 'Свинина', 'Россия', 360, 5, 0, 0, '', '2017-11-2313-51-56_21-08-35.JPG', 'кг', '', 0, 0, 0, 'Свиная шея, для которой характерна мягкость, нежность и наличии жировых прожилок. Мясо, срезанное со свиной шеи, хорошо тем, что в нем нет никаких жилок и накачанных мускул. . Употребляется в пищу преимущественно в жареном или запеченном виде.', '', '', '15 суток', '', 0, 460, 0, '0000-00-00', '0000-00-00', 1, 1, '', '198', '61,08', '38,92', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-009', 1, 2518, '', '', 'Мраморная Чак ролл', 'Мраморная  говядина Чак ролл', 'не знаю', 'Россия', 780, 20, 0, 0, '', '2017-11-2313-51-47_21-09-05.JPG', 'кг', '', 0, 0, 0, 'Эта мышца из шеи мясного бычка придется вам по душе. Богатый и насыщенный вкус вкупе с хорошим балансом мяса и нежного жирка делают её прекрасным кандидатом для ароматного фарша.', '', '', '8 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '163', '16', '11', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
