('TC-1-3-073', 1, 2536, NULL, '', 'Имбирь для суши', 'Имбирь маринованный для суши', 'Имбирь', NULL, 100, 20, 0, 0, 'шт', '2017-11-2313-36-50_21-25-51.JPG', 'шт', '1,4 кг', 0, 0, 0, 'Маринованный имбирь пришел к нам в виде приправы, которая традиционно подается с суши. И это не просто вкусная приправа, но и очень полезный для пищеварения продукт. Сильный и пряный аромат имбиря в процессе маринования усиливается.Маринованный имбирь приносит организму такую же пользу, как и сырой. В процессе маринования имбирь не теряет своих полезных свойств.', '1,4 кг', 'Свежий имбирь и маринад.', '24 месяца', NULL, 0, 100, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '51', '0,2', '0,3', '125', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
