('TC-1-3-073', 1, 2539, NULL, '5 Stagioni', 'Мука для пиццы', NULL, 'не знаю', 'Италия', 90, 20, 0, 0, 'шт', '2017-11-2313-36-18_21-27-24.JPG', 'шт', '1 кг', 0, 0, 0, 'Мука для пиццы Pizza Napoletana. Farina di Grano Tenero.\nСпециальная эластичная мука для приготовления традиционной неаполитанской.', NULL, 'Мука из мягких сортов пшеницы. \nбелки - 11,5 г, углеводы - 70,7 г, жиры - 0,8 г.\nЭнергетическая ценность: 336 кКал.\nМаксимальная влажность: 15,5%.\n Содержит минимальные протеинов: 28%\nглютена 28%.\nУсловия хранения: хранить в прохладном сухом месте при комнатной температуре.', '12 месяцев', 'Le 5 Stagioni', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
