('TC-1-3-073', 1, 2552, NULL, 'Alto Concetto', 'Говядина сыровяленая', NULL, 'Сыровяленые', 'Россия', 190, 20, 0, 0, 'шт', '2017-11-2313-32-19_21-37-03.JPG', 'шт', '100 гр', 0, 0, 0, 'Вкус этого замечательного деликатеса не оставит равнодушным ни одного гурмана. Аппетитная говядина станет украшением праздничного стола или поможет внести разнообразие в повседневное меню.', NULL, 'Состав: говядина, соль, вино, глюкоза, перец черный молотый, орех мускатный молотый, перец белый молотый, гвоздика, стартовая культура, фиксаторы окраски – нитрит натрия, нитрат калия.\nУсловия хранения и сроки годности: Общий срок годности при температуре от 0 до 6\'С не более 140 дней.', '140 дней', 'ТД \"ВИК\", ИП \"Печура С.Н.\"', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '168', '15', '12', '0', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
