('TC-1-3-073', 1, 2556, '', 'Праймбиф', 'Мраморная говядина б/к', 'Наружная часть для запекания', 'не знаю', 'Россия', 480, 20, 0, 0, '', '2017-11-2313-30-27_21-43-11.JPG', 'кг', '', 0, 0, 0, 'Самое дорогое и красивое мясо в мире – это говядина, но не простая, а мраморная! Свое необычное название она получила благодаря потрясающему рисунку на мясе. Жировые прослойки на красных волокнах мяса образуют тонкую узорчатую паутинку, которая выгладит очень аппетитно. А во время приготовления этот мраморный рисунок тает и наполняет все мясо горячим соком, делая стейк сочным и нежным.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
