('TC-1-2-091', 1, 2796, '', 'La Tourangelle', 'Льняное масло', 'Льняное масло La Tourangelle, нерафинированное', 'не знаю', 'Франция', 0, 0, 0, 0, 'шт', '2017-11-2215-43-39_15-53-39_15-55-02.JPG', 'шт', '250 мл', 0, 0, 0, 'Превосходно подходит для гарниров, овощей, пасты с травами и оливками, холодных салатов и закусок. НЕ рекомендуется использовать при высоких температурах и нагревании.', '', 'Масло льняного семени, изготовленное вручную во Франции. Глубокий аромат, золотисто-желтый цвет.', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo4MzoiaHR0cDovL3d3dy5lb2lscy5ydS9wcm9kdWN0L21hc2xvLWxueWFub2UtbGEtdG91cmFuZ2VsbGUtbmVyYWZpbmlyb3Zhbm5vZS1mcmFudHNpeWEiO30='),
('TC-1-2-091', 1, 2797, NULL, 'La Tourangelle', 'Масло авокадо', 'Масло авокадо La Tourangelle', 'не знаю', 'Франция', 0, 0, 0, 0, 'шт', '2017-11-2215-43-32_15-55-37.JPG', 'шт', '250 мл', 0, 0, 0, 'Сочетается с салатами, с заправками. Подходит к соленым блюдам. И удивительно гармонично с фруктами. Вы можете сбрызнуть свежие грейпфрут или дыню. Идеально для жарки, тушения, выпечки. Или просто добавьте немного масло авокадо в готовое блюдо.', NULL, 'Деликатное масло авокадо, произведенное вручную из лучших плодов. Изумрудный цвет, фруктовый вкус. Для создания 250 мл масла требуется примерно 15-20 авокадо.', NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czo4NjoiaHR0cDovL3d3dy5lb2lscy5ydS9jb2xsZWN0aW9uL2F2b2thZG8vcHJvZHVjdC9tYXNsby1pei1hdm9rYWRvLWxhLXRvdXJhbmdlbGxlLWF2b2NhZG8iO30='),
