('TC-1-2-091', 1, 2799, NULL, 'La Tourangelle', 'Масло фундука', 'Масло лесного ореха (фундука) La Tourangelle', 'не знаю', 'Франция', 0, 0, 0, 0, 'шт', '2017-11-2215-43-23_14-34-30.JPG', 'шт', '250 мл', 0, 0, 0, 'Масло фундука держится в секрете у многих шеф-поворов в мире. Для заправки прекрасно сочетается с бальзамическим уксусом, но многие говорят, что с лимоном даже лучше. Отлично подходит к пасте, картофелю, фасоли. Превосходно с рыбой. И стоит открыть новый вкус, используя масло фундука с карпаччо или сыром.', NULL, 'Масло лесного ореха (фундука) La Tourangelle  Hazelnut, обжаренное (смесь рафинированного и нерафинированного), в железной банке.', NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-091', 1, 2800, NULL, 'La Tourangelle', 'Масло аргановое', 'Масло аргановое La Tourangelle, нерафинированное, ORGANIC (Bio)', 'не знаю', 'Франция', 0, 0, 0, 0, 'шт', '2017-11-2215-43-19_14-34-59.JPG', 'шт', '250 мл', 0, 0, 0, 'Аргановое масло -  это драгоценное масло.  Секрет красоты, молодости и кулинарного совершенства.', NULL, 'Аргановое масло содержит незаменимые жирные кислоты, в том числе линолевую (омега 6), которая участвует в укреплении эпидермиса.Масло произведено в соответствии с правилами и законами Органического земледелия. Это гарантирует натуральность продукта и отсутствие химических удобрений, пестицидов.', NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czoxMTg6Imh0dHA6Ly93d3cuZW9pbHMucnUvY29sbGVjdGlvbi9hcmdhbm92b2UvcHJvZHVjdC9tYXNsby1hcmdhbm92b2UtYXJnYW4tbmVyYWZpbmlyb3Zhbm5vZS1sYS10dXJhbnpoZWwtdi16aGVsZXpub3ktYmFua2UiO30='),
('TC-1-2-091', 1, 2801, NULL, 'Appel', 'Соус соевый', NULL, 'не знаю', 'Германия', 0, 0, 0, 0, 'шт', '2017-11-2215-43-11_14-35-35.JPG', 'шт', '250 мл', 0, 0, 0, 'Соус соевый Worcester Sauce- отличная добавка для блюд из рыбы, морепродуктов.', NULL, 'Вода питьевая, уксус солодовый, сахар, уксус винный, соус соевый (вода, соевые бобы, пшеница, соль) , соус чатни из манго (сахар, манго, приправы, соль, регулятор кислотности: уксусная кислота) соль, винные добавки, паста томатная, специи (сельдерей, горчица), сироп смородиновый ( глюкозно-фруктозный сироп, сок смородины, сахар), краситель E 150\nРекомендуется хранить в сухом прохладном месте.', '48 месяцев', 'Tabasco', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '67', '8.7', '0', '12.4', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-091', 1, 2802, '', 'Iliada', 'Оливковое масло', 'Оливковое масло Extra Virgin нерафинированное ILIADA с ароматом трюфеля ', 'не знаю', 'Греция', 0, 0, 0, 0, 'шт', '2017-11-2215-42-52_14-37-10.JPG', 'шт', '250 мл', 0, 0, 0, 'Оливковое масло ароматизированное трюфелем. Ароматизированные масла - это оригинальный вкус и наслаждение, которое длится и длится.Идеально для уже приготовленного блюда. Так Вы сохраните аромат, пользу и придадите исключительный вкус. Превосходно для гарниров, салатов, соусов или добавьте масло к заправке. Рыба, мясо, тушеные овощи откроются в новом свете и превзойдут все ожидания. Свежие ароматы масел оставляют легкий шлейф исключительности и тайны рецепта.', '', 'масло оливковое нерафинированное высшего качества с ароматом  трюфеля', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
