('TC-1-2-091', 1, 2806, NULL, 'Aroy-D', 'Молоко кокосовое', NULL, 'Кокос', 'Таиланд', 0, 0, 0, 0, 'шт', '2017-11-2215-42-22_15-02-12.JPG', 'шт', '400 мл', 0, 0, 0, 'Кокосовое молоко получают из мякоти созревшего кокоса. На вкус оно слегка сладкое с едва уловимой кислинкой. \n Тип упаковки- Железная банка', NULL, 'Кокосовое молоко хорошо сочетается с морепродуктами и рыбой, придавая блюду утонченный сливочный вкус. Кстати, французы часто используют кокосовое молоко в разнообразных десертах вместо сливок.\nПереработаная мякоть кокосового ореха 60%, вода 40%\nТемпература хранения мин. 2 ℃\nТемпература хранения макс. 30 ℃', '1095 дней', 'Thai Agri Foods', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '185', '1,6', '19', '2', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-091', 1, 2807, NULL, 'Aroy-D', 'Кокосовые сливки', NULL, 'Кокос', 'Таиланд', 0, 0, 0, 0, 'шт', '2017-11-2215-42-16_15-02-51.JPG', 'шт', '560 мл', 0, 0, 0, 'Кокосовые сливки Aroy-D 70%,\nУпаковка- Алюминиевая банка', NULL, 'переработанная мякоть кокосового ореха 70%, вода 30%. После вскрытия хранить не более 2 дней в холодильнике.\nЧтобы восстановить оригинальную текстуру после охлаждения, поместить\nбанку с продуктом в емкость с горячей водой на 5-10 минут и перемешать.\nХранить при температуре от +3\'C до +30\'C.', '36 месяцев', 'Thai Agri Foods Public CL.', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '187', '1,6', '21', '1,95', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-091', 1, 2808, NULL, 'Aroy-D', 'Молоко кокосовое', NULL, 'Кокос', 'Таиланд', 0, 0, 0, 0, 'шт', '2017-11-2215-42-09_15-03-22.JPG', 'шт', '1 л', 0, 0, 0, 'Кокосовое молоко получают из мякоти созревшего кокоса. На вкус оно слегка сладкое с едва уловимой кислинкой.', NULL, 'переработанная мякоть кокосового ореха 60%, вода 40%.\nКокос содержит множество целебных веществ, натуральных масел и антиоксидантов. В кокосе содержится калий, кальций, магний, фосфор, витамин Е, С, и клетчатка. Кокос обладает противовоспалительным, антимикробным действием. \nРекомендуется хранить при комнатной температуре от +2°С до +30°С. Срок годности 3 года. Открытый продукт хранить в холодильнике не более 2 суток.', '17 месяцев.', 'Thai Agri Foods Public CL.', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '181', '4', '27', '6', '0', ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-2-091', 1, 2809, NULL, 'Kotanyi', 'Перец черный горошек', NULL, 'не знаю', 'Австрия', 0, 0, 0, 0, NULL, '2017-11-2215-41-22_15-03-50.JPG', 'шт', NULL, 0, 0, 0, 'Перец Kotanyi черный горошек\nЧерный перец придает блюдам пикантную остроту.', NULL, 'Может содержать следы глютеносодержащих злаков, яиц, сои, сельдерея,\nкунжута, молока (лактозы), орехов и горчицы.\nХранить плотно закрытым в сухом месте.', '4 года', 'Kotanyi GmbH', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '311', '11', '3.3', '52', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
