('TC-1-2-091', 1, 2879, NULL, 'Kotanyi', 'Французские травы', NULL, 'не знаю', 'Австрия', 0, 0, 0, 0, NULL, '2017-11-2215-25-13_17-20-54.JPG', 'шт', NULL, 0, 0, 0, 'Душистая смесь прованских трав, типичных для юга Франции. Интенсивный аромат приправы \"Kotanyi\" придаст вашим блюдам характерную нотку средиземноморской кухни. Придает изысканный вкус рыбе и мясу, блюдам, приготовленным на гриле, ароматному маслу, уксусу и маринадам. Мельница имеет две степени помола.', NULL, 'соль морская йодированная (соль морская, калия йодат), розмарин, тимьян, петрушка, паприка, базилик, чабер садовый, эстрагон, куркума, пажитник.\nМожет содержать следы глютеносодержащий злаков, яиц, сои, сельдерея, кунжута, орехов, молока (лактозы).Хранить плотно закрытым в сухом темном месте.', '36 месяцев', 'Kotanyi GmbH', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
