('Рыба СЦ', 1, 3447, NULL, '', 'Сибас 6oo/8oo', 'Сибас  охлажденный', 'не знаю', 'Турция', 0, 0, 0, 0, 'шт', '2017-12-0812-24-05_10-29-06.JPG', NULL, NULL, 0, 0, 0, 'Сибас – деликатесная рыба класса \"премиум\" с нежным мясом, почти не содержащая костей. Белое мясо сибаса обладает великолепным вкусом и пользуется широкой популярностью. Идеален для приготовления на гриле, для запекания и приготовления на пару.', '600 -800 гр.', NULL, '7 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '138', '20,9', '5,4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3446, NULL, '', 'Форель Радужная', 'Форель Радужная охлажденная', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-24-24_10-29-44.JPG', 'шт', '50г', 0, 0, 0, 'Радужная форель совсем не случайно получила статус одной из вкусных, а главное – полезных, рыб семейства лососевых. Она содержит железо, магний, фосфор, цинк, так необходимые для организма.', '250 -300 гр.', NULL, '6 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '90', '20,87', '5,4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3445, NULL, '', 'Судак охлажденный', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-24-32_10-30-11.JPG', NULL, NULL, 0, 0, 0, 'Мясо судака не жирное,белое,мало костей.Самая\nхорошая рыба для заливного.', '1,5 - 2,5 кг', NULL, 'не более 24 часа', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '84', '18,4', '1,1', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3444, NULL, '', 'Кефаль охлажденный', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-24-52_10-30-42.JPG', NULL, NULL, 0, 0, 0, 'Нежнейшее мясо кефали.Состав кефали  благотворно влияют на состояние сосудов.Делает их стенки толще,чем предотвращает множество патологических состояний и болезней.', '600 - 800 гр.', NULL, '72 часа', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '88', '18', '2', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3443, NULL, '', 'Треска охлажденная', 'Треска охлажденная без головы потрашенная', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-25-00_10-31-13.JPG', NULL, NULL, 0, 0, 0, 'Треска - это очень вкусная и полезная рыба, которая чаще других появляется в рационе многих наших сограждан. Популярность трески объясняется удачным сочетанием высокой пользы, отличного вкуса и доступной цены.', '1.5 - 2кг.', NULL, '7 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '69', '16', '0,6', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3442, NULL, '', 'Сазан охлажденный', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-25-13_10-33-37.JPG', NULL, NULL, 0, 0, 0, 'Охлажденный сазан -  вкусная и полезная рыба.Очень богат витаминами группы В,А,Е,РР,а также фосфором,йодом и железом.Сазан станет настоящим украшением вашего стола!', '1,5 - 2,5 кг', NULL, 'не более 24 часа', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '112', '19', '4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3441, NULL, '', 'Сибас 4oo/6oo', 'Сибас охлажденный', 'не знаю', 'Турция', 0, 0, 0, 0, 'шт', '2017-12-0812-25-30_10-34-42.JPG', NULL, NULL, 0, 0, 0, 'Сибас охлаждённый – один из главных компонентов большого количества деликатесных блюд. Рыба весом -400 - 600 г имеет самое нежное мясо, она богата витаминами (А, В1, В2, Е) и микроэлементами – фтор, йод, калий, цинк.', '400 - 600 гр.', NULL, '7 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '138', '20,9', '5,4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 3439, NULL, '', 'Утка Муларда', 'Утка Муларда охлажденная', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-42-35_21-47-21.JPG', 'шт', '3,0 - 4,5 кг', 0, 0, 0, 'Мулард – гибрид индоутки и пекинской утки. Гурманы считают, что мясо муларда  вкуснее мяса других уток.У муларда большая грудка – самая полезная, диетическая часть птицы. Вес костей меньше, чем у других видов уток. Жира тоже значительно меньше.', '3,0 - 4,5 кг', NULL, '15 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '271', '25', '23', '0', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 3438, NULL, '', 'Индоутка', 'Индоутка охлажденая', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-41-23_23-42-06.JPG', 'шт', '3,0 - 4,0 кг.', 0, 0, 0, '.Мясо индоутки не имеет специфического «утиного» привкуса и запаха, оно нежнее утиного, сочнее индюшачьего и насыщеннее по вкусу куриного. Готовить индоутку можно разными способами – варить, тушить, запекать целиком или порционно.', '3,0 - 4,0 кг.', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '271', '25', '23', '0,2', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 3436, NULL, '', 'Утка', 'Утка охлажденная', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-31-11_23-47-17.JPG', 'шт', '1,8 - 2,8 кг.', 0, 0, 0, 'Мясо утки - диетическое мясо, сбалансированное по своему составу, богатое витаминами и аминокислотами. Блюда из вареной утки полезны здоровым, физически активным людям. Они насыщают организм всеми нужными витаминами и минералами. Утиный жир способствует очищению организма от канцерогенных веществ.', '1,8 - 2,8 кг.', NULL, '15 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '308', '13,5', '28,6', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 3435, NULL, '', 'Петушок', 'Петушок охлажденный', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-29-55_23-47-51.JPG', 'шт', '1,1 - 1,2 кг.', 0, 0, 0, 'Мясо петуха является полноценным источником уникальных аминокислот и белковых соединений, улучшающих выносливость и повышающих иммунитет.  При достаточно высокой калорийности, мясо петуха отлично усваивается организмом, считаясь классическим диетическим продуктом, которое нередко назначали больным и выздоравливающим, как укрепляющее и антибактериальное средство.', '1,1 - 1,2 кг.', NULL, '5 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '238', '18,2', '18,4', '0,2', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
