('Птица СЦ', 1, 3433, NULL, '', 'Цыпленок - 0,5 кг', 'Цыпленок охлажденный', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-25-40_23-50-21.JPG', 'шт', '500 гр.', 0, 0, 0, 'Мясо цыпленка является диетическим продуктом и его можно употреблять, практически на любых диетах, кроме вегетарианских. Этот продукт обычно готовят на белковых диетах.', '500 гр.', NULL, '5 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '219', '18,7', '16,1', '0,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
