('Птица СЦ', 1, 3431, NULL, '', 'Цыпленок - 0,9 кг', 'Цыпленок бройлер охлажденный', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-24-38_23-53-33.JPG', 'шт', '900 г', 0, 0, 0, 'Мясо цыпленка является диетическим продуктом и его можно употреблять, практически на любых диетах, кроме вегетарианских. Этот продукт обычно готовят на белковых диетах. Цыпленок бройлер – это продукт для приготовления множества блюд: супов и бульонов, вторых блюд и даже закусок. Цыпленка можно обжаривать на сковороде, запекать в духовке, готовить на гриле или мангале.', '900 гр.', NULL, '5 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '219', '18,7', '16,1', '0,5', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Птица СЦ', 1, 3430, NULL, '', 'Курица домашняя', 'Курица домашняя охлажденная', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0715-23-58_23-54-21.JPG', 'шт', '1,7 кг.', 0, 0, 0, 'Курица – продукт, видимо, самый распространенный во всём мире. Неисчислимое количество блюд готовятся во всех уголках нашей планеты. Мясо курицы (домашней) считается легкоусваиваемым и полезным. Один из самых простых и полезных первых блюд признан – куриный бульон, при правильном приготовление, суп получается прозрачным и аппетитным , который помогает человеку восстановить силы.', '1,7 кг', NULL, '5 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '174', '19', '11', '0,13', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
