('Рыба СЦ', 1, 3450, NULL, '', 'Дорадо 4oo/6oo', 'Дорадо охлажденный', 'не знаю', 'Турция', 0, 0, 0, 0, 'шт', '2017-12-0812-23-29_10-25-55.JPG', NULL, NULL, 0, 0, 0, 'Дорадо (морской карась) – одна из самых простых в приготовлении видов рыб. В ней почти нет костей, поэтому чаще всего ее запекают или жарят целиком. Нежное белое мясо дорадо очень богато витаминами и микроэлементами. Достаточно 20 минут – и рыба готова к употреблению!', '400 - 600 гр.', NULL, '7 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '206', '18,77', '14,57', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
