('TC-1-17-044', 1, 3501, NULL, 'Бригантина', 'Скумбрия', 'Скумбрия х /к', 'Скумбрия', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-27-19_22-51-37.JPG', 'шт', '50г', 0, 0, 0, 'Скумбрия – рыба универсальная. Она вкусна в отварном, жареном или запеченном виде, и просто в качестве холодной закуски (соленая, копченая, в маринаде).', '300 гр.', NULL, '15суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '221', '20.7', '15.5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-044', 1, 3502, NULL, '', 'Сельдь с/с в/у', 'Сельдь с/с в/у', 'Сесльдь', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-27-25_22-50-29.JPG', 'шт', '50г', 0, 0, 0, 'Сельдь – одна из самых распространённых и полезных рыб, употребляемых человеком. Сельдь соленая содержит Омега-3 полиненасыщенные жирные кислоты, которые являются основной профилактикой возникновения атеросклероза.', '400 -600 гр.', NULL, '30  суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '217', '19.8', '15,4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-044', 1, 3503, NULL, 'Райская рыба', 'Скумбрия в\\у', 'Скумбрия слабосоленая в\\у', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-27-34_22-49-39.JPG', 'шт', '50г', 0, 0, 0, 'Употребление скумбрии в пищу - это хорошая профилактика сердечно-сосудистых заболеваний, предохранение организма от риска возникновения тромбоза, а также способствует кровообращению в капиллярах.Скумбрия — ценная промысловая рыба с высоким содержанием богатого незаменимыми полиненасыщеными жирными кислотами омега-3 жиром, благодаря чему она отлично подходит для копчения. Скумбрия холодного копчения — не только вкусный, но и полезный продукт, в котором сохраняются полезные вещества.', '350 гр.', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '221', '20,7', '15,5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
