('TC-1-17-044', 1, 3516, '', 'Мерка', 'Щупальца осьм. х/к', 'Щупальца осьм. х/к', 'Осьминог', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-31-29_22-35-57.JPG', 'шт', '1 кг', 0, 0, 0, 'Щупальца осьминога на вкус немного сладковаты, но при этом удивляют своим насыщенным морским вкусом.Коптят осьминого на ольхе, благодаря чему мы получаем утонченный вкус этого предстваителя моллюсков.Щупальца осьминога - приятное дополнение в качестве изысканной закуски , а также они используются для приготовления  салатов.\n\n\n\n', '1 кг.', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '263', '58', '1,0', '3,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
