('TC-1-17-044', 1, 3518, '', 'Государыня Рыбка', 'Мидии вяленые в/у', 'Мидии вяленые в/у', 'Мидии', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-32-18_22-33-35.JPG', 'шт', '500 г', 0, 0, 0, 'Вяленые мидии сочные очень вкусные с ярко выраженным «мидийным» ароматом. На вид моллюски, в вялено-сушеном виде, отнюдь не красавцы, но стоит только их попробовать они нежно влюбляют в себя, растворяясь во рту без остатка.\nОценят по достоинству любители мидий, ценители вяленых морепродуктов. Попробуйте и убедитесь сами.\nВ мидиях содержится белка гораздо больше, чем в любой рыбе или мясе, при этом отличаются невысокой калорийностью. ', '1 кг', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '189', '38,7', '3,8', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
