('Рыба СЦ', 1, 3538, NULL, '', 'Горбуша г/к', 'Горбуша г/к', 'Горбуша', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-41-38_22-17-36.JPG', 'шт', '50г', 0, 0, 0, 'Нежное, не жирное розовое мясо.Горбуша горячего копчения не только обладает удивительным приятным вкусом, но и приносит значительную пользу организму. В нем содержится необходимое количество фтора, фосфора, йода и натрия, а также полиненасыщенных жирных кислот.', '450- 700 гр.', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '160', '23', '6,8', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
