('Рыба СЦ', 1, 3540, NULL, '', 'Лещ х/к', 'Лещ х/к', 'Лещ', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-42-23_22-14-58.JPG', 'шт', '50г', 0, 0, 0, 'Лещ холодного копчения имеет несравненный вкус, с легким «запахом дымка», мясо рыбы нежное, жирное и прекрасно дополняет светлые сорта пива.Лещ  это аппетитное и очень популярное блюдо в нашей стране. Ароматный вкус мяса леща знает каждый.', '750 - 1 кг', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '105', '17,1', '44', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3541, NULL, 'Райская Рыба', 'Брюшки семги х/к', 'Брюшки семги х/к', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-43-34_22-13-38.JPG', 'шт', '50г', 0, 0, 0, 'Брюшки семги считаются самой жирной и калорийной частью рыбины. Калорийность брюшек составляет 310 ккал на 100 грамм продукты.', '150 - 350 гр.', NULL, '20 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '310', '25', '24', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3542, NULL, '', 'Теша форели х/к', 'Теша форели х/к', 'Форель', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-44-11_22-13-16.JPG', 'шт', '50г', 0, 0, 0, 'Теша форели холодного копчения - это филе натурального холодного копчения без применения концентрированных продуктов горения древесины (жидкого дыма).', '150 250 гр.', NULL, '20 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '300', '24', '20', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
