('Рыба СЦ', 1, 3544, NULL, '', 'Рулет скумбрии г/к', 'Рулет горбуши и скумбрии г/к', 'Горбуша', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-44-53_22-11-50.JPG', 'шт', '50г', 0, 0, 0, 'Нежнейшее мясо скумбрии в сочетании с мясом горбуши ,не оставит Вас равнодушным к этому деликатесу.Украсит Ваш праздничный стол.', '450 - 750 гр.', 'Скумбрия и горбуша', '10 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3545, NULL, '', 'Сиг г/к', 'Сиг г/к', 'Сиг', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-45-24_22-10-38.JPG', 'шт', '50г', 0, 0, 0, 'Рыба семейства лососевые, имеет белое мясо, плотную жирную структуру. Ценится за свои высочайшие вкусовые качества, является близким родственником омуля.', '~1200кг', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '88', '17,5', '2', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3546, NULL, '', 'Сиг х/к', 'Сиг х/к', 'Сиг', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-45-40_22-08-36.JPG', 'шт', '50г', 0, 0, 0, 'Вкусная и полезная рыба. По вкусу напоминает лосось, только мясо белое и имеет больший процент жирности. При копчении все свойства сохраняются.', '1000 -1200 гр', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '120', '16', '5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3547, NULL, '', 'Скумбрия х/к', 'Скумбрия х/к', 'Скумбрия', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0716-45-56_22-07-38.JPG', 'шт', '50г', 0, 0, 0, 'Скумбрия сама по себе вкусная, а при копчении она становится более вкусной и полезной, потому что содержание полезных веществ на высоте. Употребление скумбрии в пищу - это хорошая профилактика сердечно-сосудистых заболеваний.', '+ 400', NULL, '15 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '221', '20,7', '15,5', NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
