('Рыба СЦ', 1, 3611, NULL, '', 'Семга стейки', 'Стейки семги свежемороженые', 'Семга', 'Чили', 0, 0, 0, 0, 'шт', '2017-12-0811-48-24_21-34-48.JPG', 'шт', '50г', 0, 0, 0, 'Ну, во-первых, сёмга состоит из вкуснейшего мяса, благодаря которому она и считается деликатесом. А во-вторых, этот вид лосося обладает весьма ценным набором витаминов, микроэлементов, белков и жирных кислот. И за это его любят не только гурманы, но и все.', '350 - 600 гр.', NULL, '12 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '140', '21,6', '6', '0', NULL, ';', NULL, 1, 'YToxOntpOjA7czowOiIiO30='),
