('Рыба СЦ', 1, 3629, NULL, '', 'Чехонь', 'Чехонь вяленый', 'Чехонь', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-01-32_21-47-10.JPG', 'шт', '50г', 0, 0, 0, 'Обладает высокими вкусовыми качествами и является хорошей закуской. Мясо вяленой чехони имеет приятный вкус и аромат, такая рыба хорошо подойдет к легким спиртным напиткам или в качестве продукта в составе походного меню.', '350  - 500 гр', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '112.7', '19.6', '4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
