('Рыба СЦ', 1, 3631, NULL, '', 'Вобла', 'Вобла вяленая', 'Вобла', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-02-44_21-48-30.JPG', 'шт', '50г', 0, 0, 0, 'Вяленая вобла невероятно богата хромом-110% в 100 граммах мякоти. Он очень полезен тем людям, чей организм недостаточно хорошо усваивает углеводы (например, пожилые люди).Особенность вяленой рыбы состоит в том, что её можно употреблять в пищу и без кулинарной обработки. Вяленая рыба, в особенности достаточно обезвоженная, хорошо и долго сохраняется.', '200 - 250 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '235', '46,4', '5,5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3632, NULL, '', 'Щука', 'Щука вяленая', 'Щука', 'Росиия', 0, 0, 0, 0, 'шт', '2017-12-0812-03-19_21-49-23.JPG', 'шт', '50г', 0, 0, 0, 'Щука – вкусная закуска к пиву.', '450 - 600 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '138,6', '25,4', '2,46', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3633, NULL, '', 'Судак', 'Судак вяленый', 'Судак', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-04-22_21-50-09.JPG', 'шт', '50г', 0, 0, 0, 'Вяленый судак - одна из вкуснейших рыб, которая замечательно подчеркивает вкус пива любого сорта. Белое нежное постное мясо судака является диетическим - содержание жиров минимально,  а пищевая ценность очень велика.', '350 -400 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '84', '18,0', '1,0', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3634, NULL, '', 'Красноперка', 'Красноперка вяленая', 'Красноперка', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-04-54_21-50-39.JPG', 'шт', '50г', 0, 0, 0, 'Красноперка вяленая – королева на пивной кухне. Бокал прохладного пенного напитка и кусочек вяленой красноперки – прекрасный тандем для вечерних посиделок. Идеальное сочетание соленой рыбы и солодкового вкуса, многим придется по душе.', '250 -350 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3635, NULL, '', 'Бычки', 'Бычки вяленые', 'Бычки', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-06-08_21-51-13.JPG', 'шт', '50г', 0, 0, 0, 'Одна из самых любимых закусок к пиву — вяленые бычки Маленькая, да удаленькая рыба бычок может стать вкусным и полезным продуктом питания для людей всех возрастов.', '150 - 200 гр.', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '141', '24', '5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3636, NULL, '', 'Сиг', 'Сиг вяленый', 'Сиг', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-06-36_21-51-46.JPG', 'шт', '50г', 0, 0, 0, 'Вяленый сиг – великолепная закуска к пиву, которую обязательно оценят даже самые искушенные гурманы. Эта рыба невероятно вкусная, почти не содержит мелких костей. Нежное мясо с золотистым оттенком и прозрачной текстурой напоминает янтарь. Сиг не имеет выраженного запаха тины.', '300 -400 гр.', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '144', '19', '17.5', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3637, NULL, '', 'Синец', 'Синец', 'Синец', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-07-11_21-52-25.JPG', 'шт', '50г', 0, 0, 0, 'Его мясо отличается превосходными вкусовыми качествами, оно жирное и сочное с косточками, в вяленном виде гораздо вкуснее леща. Синец придется по вкусу ценителям рыбы и любителям редких видов рыб.', '250  - 300 гр.', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '131', '18', '1.1', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3638, NULL, '', 'Камбала', NULL, 'Камбала', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-07-49_21-52-54.JPG', 'шт', '50г', 0, 0, 0, 'Вяленая камбала имеет необыкновенные вкусовые качества, отличающие эту рыбу от других морепродуктов. Оригинальная закуска под светлые сорта пива с лёгкой горчинкой.', '250 - 500 гр.', 'Свежая камбала,крупная соль.', '2 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '90', '15,7', '3', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3639, NULL, '', 'Камбала крупная', 'Камбала вяленая крупная', 'Камбала', NULL, 0, 0, 0, 0, 'шт', '2017-12-0812-08-15_21-55-00.JPG', 'шт', '50г', 0, 0, 0, 'Вяленая камбала имеет необыкновенные вкусовые качества, отличающие эту рыбу от других морепродуктов. Оригинальная закуска под светлые сорта пива с лёгкой горчинкой.', '300 - 500 гр.', 'Свежая камбала,крупная соль', '6 месяцев', 'Россия', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '90', '15,7', '3,0', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30=');
