('Рыба СЦ', 1, 3640, NULL, '', 'Судак', 'Судак вяленый', 'Судак', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0812-09-23_21-55-25.JPG', 'шт', '50г', 0, 0, 0, 'Вяленый судак - одна из вкуснейших рыб, которая замечательно подчеркивает вкус пива любого сорта. Белое нежное постное мясо судака является диетическим - содержание жиров минимально,  а пищевая ценность очень велика. Огромным преимуществом перед другими видами рыб является низкое содержание костей. Непревзойденные вкусовые качества судака возвели его в ранг рыбного деликатеса.\n\nВяленый судак имеет нежное мясо, которое считается диетическим: оно совсем нежирное и не костлявое, поэтому как нельзя лучше подходит в качестве закуски к пиву. Вяленое мясо судака имеет светлый, серовато-розовый оттенок, легко разделяется на волокна. Мякоть его плотная и упругая, совсем не похожая на тарань или леща, а напоминающая, скорее, треску. Мясо судака не имеет сильного «болотного» запаха, присущего многим речным рыбам.', '350 -450 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '84', '18', '1', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
