('TC-1-17-044', 1, 3644, '', '', 'Креветки очищ. 1oo/2oo', 'Креветки очищенные 100/200', 'Креветки', 'Китай', 0, 0, 0, 0, 'шт', '2017-12-0812-12-07_21-57-34.JPG', 'шт', '1 кг', 0, 0, 0, 'Отличительной особенностью вкуса креветок является привкус йода. Салатную креветку, как следует из названия, в основном, применяют для различных кулинарных миксов, в составе салата, такие креветки отлично подчеркивают общий вкус.', '1 кг.', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '100', '21,0', '1,1', '2,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-17-044', 1, 3645, '', '', 'Креветки очищ. 2oo/3oo', 'Креветки очищенные 200/300 сырые', 'Креветки', '', 0, 0, 0, 0, 'шт', '2017-12-0812-12-28_21-58-04.JPG', 'шт', '1 кг', 0, 0, 0, 'Очищенные креветки - изысканное деликатесное лакомство. Они нашли широкое применение в кулинарии.Существует огромное множество салатов, вторых блюд, где главным ингредиентом и изюминкой является очищенная креветка. ', '1 кг.', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
