('TC-1-16-036', 1, 3787, '', '', 'Морской коктейль', 'Морской коктейль замороженый', 'Морской коктейль', 'Китай', 180, 20, 0, 0, '', '2017-12-0812-47-12_22-14-38.JPG', 'шт', '1 кг.', 0, 0, 0, 'Морской коктейль считается низкокалорийным, диетическим продуктом.Уникальность замороженного морского коктейля состоит в том, что в нём присутствуют только натуральные продукты. В замороженном виде моллюски могут долго сохранять свои полезные и питательные свойства (calorizator). Как правило, морепродукты в морском коктейле уже очищены и обработаны, их остается только приготовить.', '1 кг.', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '124', '2,1', '3,6', '1,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
