('TC-1-16-036', 1, 3789, NULL, '', 'Сельдь с/с', 'Филе сельди с/с в/у', 'не знаю', 'Россия', 90, 20, 0, 0, 'шт', '2017-12-0812-47-46_22-13-27.JPG', 'шт', '200г', 0, 0, 0, 'Эта рыба хоть и считается довольно жирной, но калорийность соленой сельди совсем невелика и составляет всего 88 ккал на 100 граммов. Отличается она светло-коричневым мясом и продается не только в соленом виде, но и копченом, а также свежемороженой. Известно, что самыми вкусными и ценными признаются жирные слабосоленые тихоокеанские и атлантические сельди.', '300 -350 гр.', NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '217', '19.8', '15.4', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
