('TC-1-16-036', 1, 3791, '', '', 'Тушка кальмара', 'Тушка кальмара заморожен.очищеный', 'Кальмар', 'Китай', 290, 20, 0, 0, 'шт', '2017-12-0812-49-20_22-08-34.JPG', 'шт', '1 кг', 0, 0, 0, 'За свои оригинальные вкусовые качества мясо этого моллюска полюбилось многим и теперь довольно часто заменяет на повседневном столе курятину и говядину .Кальмар  — очень ценный пищевой продукт, так как содержит много полезных свойств в виде витаминов, кислот и минералов. Помогает поддерживать здоровье человека на максимуме. Основным показателем ценности продукта есть тот факт, что он может своим составом заменить мясо, яйца.', '1000г', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '86', '18', '2,3', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
