('Рыба СЦ', 1, 3876, '', '', 'Мидии в/у', 'Мидии в/у', 'Мидии', '', 0, 0, 0, 0, 'шт', '2017-12-0815-29-11_20-46-37.JPG', 'шт', '50г', 0, 0, 0, 'Мясо мидий – это высококачественный чистый белок, оно богато фосфатидами. Это достаточно жирные моллюски, однако в состав его входят такие полезные компоненты, как полиненасыщенные жирные кислоты. Мясо мидий – это настоящий Клондайк таких микроэлементов, как: йод и цинк, марганец и медь, кобальт и незаменимые для человека 20 аминокислот.', '1 кг.', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77', '11,5', '2,0', '3,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
