('Рыба СЦ', 1, 3878, '', '', 'Тунец филе', 'Тунец филе замороженный в в/у', 'Тунец', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-29-51_20-45-30.JPG', 'шт', '50г', 0, 0, 0, 'Тунец - это один из наиболее популярных морских обитателей. Его нежное мясо, имеющее красный цвет на срезе, зачастую сравнивают с говядиной или телятиной. Это обусловлено тем, что по своей консистенции мясо тунца достаточно плотное и восхитительно вкусное. Оно богато легкоусвояемым белком, по содержанию которого тунец - истинный рекордсмен, а также кислотами Омега-3 и Омега-6, витаминами, минералами и другими ценными веществами. Таким образом, польза этой рыбы доказана и превосходит все ожидания. ', '', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '139', '24,4', '4,6', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
