('Рыба СЦ', 1, 3885, NULL, '', 'Кижуч', 'Кижуч', 'Кижуч', NULL, 0, 0, 0, 0, 'шт', '2017-12-0815-33-01_20-40-37.JPG', 'шт', '1г', 0, 0, 0, 'Рыба имеет мясо красного цвета  Мясо у нее намного мягче, вкуснее и не такое жирное как у других видов. Рыба эта очень ценится издавна и является ценной породой промысловых рыб.', '1-1,8кг', NULL, '18 месяцев', 'Рорссия', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3886, NULL, 'Anchor', 'Треска', 'Треска', 'Треска', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-33-23_20-40-10.JPG', 'шт', '50г', 0, 0, 0, 'В этой северной морской рыбе много калия и йода. По статистике, каждый шестой житель России страдает от йододефицита, поэтому врачи всем (и особенно детям) рекомендуют регулярно употреблять треску. Треска содержит витамины группы В, РР, D, каротин, жирные кислоты омега - 3 и много других полезных веществ.', '1.5 - 2,0 кг', NULL, '18 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '69', '16', '0.6', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
