('Рыба СЦ', 1, 3890, '', '', 'Осьминог мороженый', 'Осьминог мороженый', 'Осьминог', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-37-02_20-32-26.JPG', 'шт', '50г', 0, 0, 0, 'Сладковатое мясо напоминает вкус кальмара, но гораздо мягче и нежней, поэтому пользуется неизменным успехом в кулинарии всего мира.Осьминог, благодаря пищевой ценности и низкой калорийности, считается диетическим продуктом. Является источником калия, селена, фосфора, витаминов группы «В». Лидирует среди морских обитателей по наличию витамина В12. ', '', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '82', '14,9', '1,04', '2,2', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
