('Рыба СЦ', 1, 3893, '', '', 'Лангустины', 'Лангустины с головой в/м', 'Лангусты', 'Австралия', 0, 0, 0, 0, 'шт', '2017-12-0815-39-24_20-28-00.JPG', 'шт', '2 кг', 0, 0, 0, 'Лангустины – это ближайшие родственники лангустов.Нежный и изысканный вкус мяса  высоко оценен европейскими гурманами. Мясо содержится преимущественно в хвосте. А вкус, не передать словами.', '2 кг.', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '112', '20,6', '1,510', '2,430', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3894, NULL, '', 'Тарань', 'Тарань Вяленая', 'Тарань', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-39-43_20-27-03.JPG', 'шт', '50г', 0, 0, 0, 'Вяленая таранка (снек) — традиционно русская закуска для любителей пива и любителей вяленой рыбки.', '150 - 300 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '217,2', '42,8', '2,87', '2,13', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3895, NULL, '', 'Уклейка', 'Уклейка  вяленая', 'Уклейка', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-40-21_20-26-23.JPG', 'шт', '50г', 0, 0, 0, 'Уклейка  может стать отличной закуской к пиву. В этой рыбе содержится много жира, и если завялить ее правильно, то она приятно удивит вас своими вкусовыми качествами. Вяленая уклейка – простое, несложное в приготовлении блюдо, по вкусу не уступающее лещу.', '100 -200 гр.', NULL, '6 месяцев', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '139', '17,5', '4,6', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3896, '', '', 'Креветки морож. 70/90', 'Креветки морож. 70/90', 'Креветки', 'Греландия', 0, 0, 0, 0, 'шт', '2017-12-0815-45-10_20-25-34.JPG', 'шт', '50г', 0, 0, 0, 'Креветки – это легкий диетический продукт, при минимальной калорийности мясо мелких рачков утоляет голод на длительное время.. Креветки являются подвидом морских ракообразных существ. В отличие от своих сородичей, только северные креветки носят икру под брюшком.\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3897, '', '', 'Креветки Лангусттино', 'Креветки Лангусттино мороженые очищенные L1', 'Креветки', 'Аргентина', 0, 0, 0, 0, 'шт', '2017-12-0815-46-29_20-24-51.JPG', 'шт', '50г', 0, 0, 0, 'У лангустина очень тонкий и нежный вкус, благодаря этому блюда из них занимают первые места в списках всемирно известных ресторанов морской кухни. Самую большую ценность составляет хвостовая часть лангустина.  ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3898, '', '', 'Креветки мороженые', 'Креветка Батан варено-мороженые', 'Креветки', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-46-58_20-24-07.JPG', 'шт', '50г', 0, 0, 0, 'Креветки – это настоящий морской деликатес,очень мало калорийны. Креветки являются очень вкусным морепродуктом, более того они необычайно полезны для организма. Этот морепродукт используется во многих блюдах, потому как соответствует всем кулинарным требованиям. Креветки пользуются популярностью среди мужчин, поскольку идеально подходят в сочетании с пивом. Главное богатство креветок заключается в наличии белка, который отвечает за выработку тестостерона. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3899, '', '', 'Креветки мороженые', 'Креветки мороженые', 'Креветки', 'Гренландия', 0, 0, 0, 0, 'шт', '2017-12-0815-47-40_20-23-19.JPG', 'шт', '50г', 0, 0, 0, ' Креветки - это десятиногие ракообразные широко распространенные в соленых водах (моря, океаны) земного шара.креветки поступают в варено-мороженом виде, поэтому их достаточно всего лишь разморозить.Подают их к столу в качестве закуски в отварном виде с лимоном, лаймом и всевозможными соусами .', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3900, '', '', 'Креветки мороженые', 'Креветки Северная варено - мороженные', 'Креветки', 'Россия', 0, 0, 0, 0, 'шт', '2017-12-0815-48-10_20-22-18.JPG', 'шт', '50г', 0, 0, 0, 'Креветки – это один из даров моря, который считается деликатесом во многих странах мира удаленных от моря. Креветки являются подвидом морских ракообразных существ. В отличие от своих сородичей, только северные креветки носят икру под брюшком.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба СЦ', 1, 3901, '', '', 'Креветки мороженые', 'Креветки варено-мороженые', 'Креветки', 'Гренландия', 0, 0, 0, 0, 'шт', '2017-12-0815-48-45_20-19-48.JPG', 'шт', '50г', 0, 0, 0, 'Дары моря – это настоящая кладовая полезных веществ. В первую очередь они дают нам нежнейшее и чрезвычайно ценное диетическое мясо, которое легко усваивается организмом.Уникальные свойства продукта заключаются в его составе, богатом минеральными элементами и витаминами. В креветках содержится много железа, которое повышает выносливость организма и предупреждает болезни крови. Кальций, которым богаты рачки, легко усваивается. Он необходим для укрепления костной системы и зубов. Поэтому креветки – один из продуктов, который особенно полезен детскому организму в период интенсивного роста.\n\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '77,5', '15,43', '1,35', '0,15', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
