('TC-1-10-028', 1, 3903, '', '', 'Кинза', 'Кинза', 'Кинза', 'Россия', 0, 0, 0, 0, '', '2017122117-10-36_18-02-08.JPG', '', '', 0, 0, 0, 'Полезные свойства кинзы Зелень кинзы имеет болеутоляющие, мочегонные, противоцинготные, отхаркивающие и глистогонные свойства. Очень полезна кинза для пищеварения, она возбуждает аппетит, улучшает моторику кишечника, снижает уровень кровяного давления, помогает при бессоннице, тонизирует и дарит бодрость.', '', '', '7 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '2,1', '0,5', '1,9', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
