('TC-1-10-028', 1, 3906, '', '', 'Огурцы Миранда', 'Огурцы Миранда', 'Огурцы', 'Азербайджан', 0, 0, 0, 0, '', '2017122117-07-42_18-04-54.JPG', '', '', 0, 0, 0, 'Огурцы цилиндрические, слаборебристые, с короткой шейкой и бугорками среднего размера. \nКожица толстая, зеленаяМякоть хрустящая, ароматная, без горечи.подойдет и для потребления в свежем виде, и для консервирования.\n\n', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '14', '0,8', '0,1', '2,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3907, '', '', 'Огурцы Герман', 'Огурцы Азербайджанские Герман', 'Огурцы', 'Азербайджан', 0, 0, 0, 0, '', '2017122117-06-47_18-05-29.JPG', '', '', 0, 0, 0, ' Мякоть огурцов не имеет горечи, со сладковатым привкусом, светло-зеленого цвета и средней плотности. Благодаря своим вкусовым качествам, сорт огурцов Герман подходит не только для засолки на зиму, но и для употребления в свежем виде в салатах.', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '14', '0,8', '0,1', '2,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3908, '', '', 'Мандарин', 'Мандарин', 'Чеснок', 'Морокко', 0, 0, 0, 0, '', '2017122117-05-32_18-06-58.JPG', '', '', 0, 0, 0, 'Мандарины считаются ценным диетическим продуктом. Они способствуют улучшению аппетита, усиливают обменные процессы в организме человека. Зимой они могут дать нам большое количество необходимых витаминов.Мандарины благотворно влияют на пищеварение, предотвращают возникновение холестериновых бляшек, уменьшают отёчность. Давно известно, что мандарины не только имеет свойства антидепрессанта, но и способен укреплять нервную систему.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '33', '0,8', '0,2', '7,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
