('TC-1-10-028', 1, 3910, '', '', 'Грибы Шампиньоны', 'Грибы Шампиньоны', 'Грибы', 'Россия', 0, 0, 0, 0, '', '201722117-05-18_18-08-43.JPG', '', '', 0, 0, 0, 'Хорошая новость для любителей шампиньонов. Эти грибы очень низкокалорийные – 27,4 ккал на 100 г, – поэтому полезны для поддержания фигуры и для здорового образа жизни.Они отлично справляются с приступами головной боли, улучшают состояние кожи, внимание и память благодаря наличию в их составе лизина и аргинина .\n\n', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '27', '0,1', '4,3', '1,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3911, '', '', 'Чеснок', 'Чеснок', 'Чеснок', 'Россия', 0, 0, 0, 0, '', '2017122117-04-50_18-09-45.JPG', '', '', 0, 0, 0, 'Употребляя чеснок, вы повысите аппетит, улучшите работу кишечника, желудка, печени. Уже давно доказан противоглистный, мочегонный, болеутоляющий, противомикробный, спазмолитический эффект растения.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '143', '6,5', '0,5', '29,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3912, '', '', ' Стручковая фасоль', 'Стручковая фасоль', 'не знаю', 'Кения', 0, 0, 0, 0, '', '2017122117-03-58_18-10-13.JPG', '', '', 0, 0, 0, 'Сегодня спаржевая фасоль популярна во всем мире и считается полезным диетическим продуктом. Благодаря приятному вкусу и простоте приготовления, широко применяется в кулинарии. Она содержит много белка и клетчатки. .', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '24', '2', '0.2', '3.6', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3913, '', '', 'Перец Чили', 'Перец Чили', 'Перец', 'Тайланд', 0, 0, 0, 0, '', '2017122117-03-52_18-10-44.JPG', '', '', 0, 0, 0, 'Красный жгучий чили - перец, который обладает самыми удивительными свойствами.Такой перец весьма полезен для человеческого здоровья и, ко всему прочему, вызывает у нас положительные эмоции и мысли.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '40', '2.0', '0.2', '9.5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3914, '', '', 'Хрен', 'Корень хрена', 'Хрень', '', 0, 0, 0, 0, '', '2017122117-03-39_18-11-15.JPG', '', '', 0, 0, 0, 'Вкус хрена — острый, приятно-пикантный, а запах яркий и насыщенный. Обычно его используют свежим. Хрен способен разбудить аппетит и обогатить вкус различных блюд. Широко используют в народной медицине, из него делают разнообразные настойки, маски, отвары и примочки.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '59', '3.2', '0.4', '3.1', '', ';', 'Голандия', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3915, '', '', 'Кукуруза свежая', 'Кукуруза свежая', 'не знаю', 'Тайланд', 0, 0, 0, 0, '', '2017122117-03-33_18-11-50.JPG', '', '', 0, 0, 0, 'Как и все миниатюрные овощи, кукуруза мини представляет собой плод карликового сорта обыкновенной кукрузы, выращенной специальным образом. Маленькие кукурузные початки размером с палец удобно мариновать целиком или жарить на шпажках на гриле.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '80', '3.8', '3.5', '21', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3916, '', '', 'Салат Радичио', 'Салат Радичио', 'Салат Радичио', 'Италия', 0, 0, 0, 0, '', '2017122117-03-00_18-12-37.JPG', '', '', 0, 0, 0, 'Салат радичио имеет потрясающий внешние и вкусовые свойства. Для салатных листьев характерна темно-бордовая окраска с крупными прожилками белого цвета, расположенными по всему диаметру.из него часто делают необычный оригинальные салатники, а также подставки для разнообразных закусок. Обычно салат радичио используют в сочетании с чесноком, луком и тмином.', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '20', '1,5', '0,2', '3,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
