('TC-1-10-028', 1, 3918, '', '', 'Горох зеленый стручковый', 'Горох зеленый стручковый', 'не знаю', 'Израиль', 0, 0, 0, 0, '', '144444141255225254777.JPG', '', '', 0, 0, 0, 'Стручковый горох – незрелые зелёные плоды травянистого растения из семейства Бобовых, к Молодые стручки гороха настолько нежные и сладкие, что в пищу действительно можно употреблять все части плод .Витамины в составе гороха помогают поддерживать жизненный тонус даже в зимнее время.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '73', '5', '0.2', '13.8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3919, '', '', 'Лимонная трава', 'Лимонная трава', 'Лимонная травка', 'Тайланд', 0, 0, 0, 0, '', '2017122117-01-41_18-15-40.JPG', '', '', 0, 0, 0, 'Лимонная трава – очень полезное многолетнее растение, известное также под названиями лемонграсс, цитронелла, лимонное сорго. Растение обладает приятным ароматом лимона и цитрусовым вкусом.Полезные свойства лимонной травы обусловлены наличием природного антиоксиданта – витамина А. Растение используют для того, чтобы очистить организм от токсинов.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '99', '1,82', '0,49', '25,31', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3920, '', '', 'Спаржа зеленая', 'Спаржа зеленая', 'не знаю', 'Тайланд', 0, 0, 0, 0, '', '2017122117-01-29_18-16-09.JPG', '', '', 0, 0, 0, 'Спаржа считается лидером среди овощей по содержанию в ней витаминов. Это малокалорийный овощ,Полезные вещества в составе спаржи помогают выведению из организма шлаков.\n\n', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '21', '1.9', '0.1', '3.1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3921, '', '', 'Дайкон', 'Дайкон', 'Дайкон', 'Китай', 0, 0, 0, 0, '', '2017122117-01-04_18-16-50.JPG', '', '', 0, 0, 0, 'Дайкон оказывает успокаивающее действие на нервную систему, способствует восстановлению душевного равновесия и концентрации внимания. Больщое содержание кальция, незаменимого для костей, зубов и волос.Дайкон лишен явного горького привкуса редиса и редьки. Его употребляют в свежем и вареном виде, можно тушить и добавлять в супы, солить и мариновать. Молодые листья используют в салатах.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '21', '1,2', '0', '4,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3922, '', '', 'Кабачки', 'Кабачки', 'Кабачки', 'Турция', 0, 0, 0, 0, '', '2017122117-00-18_18-17-23.JPG', '', '', 0, 0, 0, 'Кабачки — излюбленный овощ средиземноморской кухни. Их тушат, жарят, маринуют, солят, делают из них овощные рагу и икру. В южных странах из кабачков готовят даже компоты и морсы, добавляя к ним кисло-сладкие ягоды. Это прекрасный легкий гарнир для тяжелых мясных блюд, они облегчают переваривание пищи и не дают откладываться лишним жирам. Кабачковая икра — продукт, который не теряет полезных свойств даже при консервации.\n\n', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '24', '0,6', '0,3', '4,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3923, '', '', 'Яблоко Лигольд', 'Яблоко Лигольд', 'Яблоки', 'Молдова', 0, 0, 0, 0, '', '2017122116-59-31_18-18-05.JPG', '', '', 0, 0, 0, 'Яблоки обладают теми полезными веществами, которые благоприятно сказываются на организме человека. Содержание в них витаминов и полезных веществ делает их незаменимым продуктом.', '', '', 'до 6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '0,4', '0,4', '9,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3924, '', '', 'Помидор № 5', 'Помидор № 5', 'Помидоры', 'Узбекистан', 0, 0, 0, 0, '', '2017122116-58-52_18-19-28.JPG', '', '', 0, 0, 0, 'Помимо своего необычного вкуса, помидор славится невероятным количеством разных витаминов, кислот, минералов и полезных элементов. Иногда не укладывается в голове, как один помидор может сочетать в себе столько соединений.\n', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '20', '1,1', '0,8', '37', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3925, '', '', 'Помидор Бакинский № 8', 'Помидор Бакинский № 8', 'Помидоры', 'Азербайджан', 0, 0, 0, 0, '', '2017122116-58-35_18-20-36.JPG', '', '', 0, 0, 0, 'Помимо своего необычного вкуса, помидор славится невероятным количеством разных витаминов, кислот, минералов и полезных элементов. Иногда не укладывается в голове, как один помидор может сочетать в себе столько соединений.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '20', '1,1', '0,2', '8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
