('TC-1-10-028', 1, 3927, '', '', 'Бананы', 'Бананы', 'Бананы', 'Юго-Восточная Азия', 0, 0, 0, 0, '', '2017122116-57-20_18-23-31.JPG', '', '', 0, 0, 0, 'Вкусный экзотический фрукт получил широкое распространение. Бананы – еда не просто вкусная, но и чрезвычайно полезная, хотя и довольно калорийная.Банан – ценный источник калия и клетчатки. Это продукт, который быстро восполняет энергопотери. Поэтому плоды обязательно нужно употреблять людям, занимающимся тяжелым физическим трудом.\n\n', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '96', '1,5', '0,5', '21', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3928, NULL, '', 'Помело', 'Помело свежий', 'Помело', 'Китай', 0, 0, 0, 0, 'шт', '2017122116-56-51_18-24-27.JPG', 'шт', '900 - 1700 гр', 0, 0, 0, 'Польза Помело  для человеческого организма является поистине большой. В плодах содержится огромное количество эфирных масел и витамина С. Вследствие чего помело  фрукт прекрасно справляется с ОРЗ, гриппом и ОРВИ.', '900 - 1700 гр', 'Помело свежий', '2 - 4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '34,34', '0,68', '0,21', '6,53', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3929, '', '', 'Перец острый', 'Перец острый', 'Перец острый', 'Армения', 0, 0, 0, 0, '', '201712216-56-22_18-25-12.JPG', '', '', 0, 0, 0, 'Из-за своего острого вкуса, пряного аромата этот плод непременно присутствует в кулинарии всех народов мира. Жгучесть стручкам придаёт алкалоид капсаицина, который присутствует в горьких сортах перца, особенно в его перегородках и семенах.Именно острый перец может похвастаться наибольшей концентрацией витаминов и минералов. Он богат антиоксидантами, ликопеном и рутинном.', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '40', '1,3', '0,3', '7,2', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3930, NULL, '', 'Кокос', 'Кокос свежий', 'Какос', 'Индонезия', 0, 0, 0, 0, 'шт', '2017122116-55-02_18-26-05.JPG', 'шт', '450 -1700 гр.', 0, 0, 0, 'Кокосовый орех обладает лекарственными и лечебными свойствами, хорошее средство от таких болезней, как диарея. Содержит витамины В и С, а также необходимые человеческому организму минеральные соли, натрий, кальций, железо, калий, а также до 5% глюкозы, фруктозы и сахарозы.', '450 -1700 гр.', 'Кокос свежий', '3 недели', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '354', '3,4', '33,5', '6,2', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3931, NULL, NULL, 'о', NULL, 'Помидоры', NULL, 0, 0, 0, 0, NULL, '2017122116-54-33_18-27-08.JPG', NULL, NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL),
('TC-1-10-028', 1, 3932, '', '', 'Смесь салатов Радичио ', 'Смесь салатов Радичио + Корн', 'Салат микс', 'Израиль', 0, 0, 0, 0, '', '2017122116-54-21_18-27-38.JPG', '', '', 0, 0, 0, 'Все сорта салата очень полезны, поскольку содержат целый комплекс витаминов и минеральных веществ. Листья корна обладают нежной текстурой, сладковато-ореховым привкусом и еле заметной терпкостью. Корн прекрасно сочетается с любыми видами салатов, а в этом примере его мягкость и нежный вкус приятно контрастирует с горечью радичио. Салаты в этой смеси богаты железом и флавоноидами, которые укрепляют капилляры и помогают лучшему усвоению витамина С. В 100 граммах этого салата содержится половина ежедневной потребности организма человека в витамине В9, регулирующего метаболические процессы в организме и способствующего быстрой регенерации клеток.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '12', '1,2', '0,3', '1,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3933, '', '', 'Руккола', 'Руккола', 'Руккола', 'Израиль', 0, 0, 0, 0, '', '2017122116-54-13_18-28-17.JPG', '', '', 0, 0, 0, 'Польза Рукколы в том, что она содержит большое количество витаминов и микроэлементов, в числе которых преобладают витамин C и йод. Как известно, аскорбиновая кислота – это отличный антиоксидант, который поможет сохранить и продлить молодость каждой клеточки организма. Именно его наличие делает зелень отличным средством для поддержания иммунитета и жизненного тонуса. ', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
