('TC-1-10-028', 1, 3935, '', '', 'Кресс- салат', 'Кресс- салат', 'Кресс-салат', 'Иран', 0, 0, 0, 0, '', '2017122116-53-55_18-29-31.JPG', '', '', 0, 0, 0, 'Очень популярный во всем мире и пока еще только набирающий популярность в нашей стране кресс-салат обладает уникальными полезными свойствами. Если Вы ведете здоровый образ жизни и заботитесь о своем здоровье, то смело включайте эту замечательную травку в свой рацион питания. ', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '11', '2,3', '1,0', '1,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3936, '', '', 'Кукуруза в/у', 'Кукуруза в/у', 'Кукуруза', 'Тайланд', 0, 0, 0, 0, '', '2017122116-53-38_18-30-00.JPG', '', '', 0, 0, 0, 'Кукуруза обладает таким замечательным свойством, как предупреждение развития заболеваний сердечно-сосудистой системы и злокачественных новообразований. Прекрасно справляется и с очищением организма от шлаков и токсинов. Полезна кукуруза и детям – помогает хорошо набирать массу тела, при этом снабжая растущий организм необходимыми микроэлементами и основными витаминами.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '80', '3,8', '3,5', '21', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3937, '', '', 'Цветная капуста', 'Цветная капуста', 'Цветная Капуста', '', 0, 0, 0, 0, '', '2017122116-53-27_18-30-41.JPG', '', '', 0, 0, 0, 'Цветная капуста – уникальный диетический продукт, с мягким нежным вкусом и упругой консистенцией. В ней содержится огромное количество витамина С, что помогает делать сосуды эластичными. ', '', '', '20  дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '30', '2,5', '0,3', '5,4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3938, '', '', 'Редька зеленая', 'Редька зеленая', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017122116-52-47_18-31-15.JPG', '', '', 0, 0, 0, '\nЗеленая редька имеет такой же состав, как и черная, более распространенная у нас в стране. Однако она немного мягче по вкусу, немного схожая с редисом и дайконом. Корнеплоды имеют зеленый оттенок и белый кончик. Вкус у мякоти немного горький, цвет же ее также зеленый.\n', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '30', '2', '0.2', '6.5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3939, '', '', 'Свекла', 'Свекла', 'Свекла', 'Россия', 0, 0, 0, 0, '', '2017122116-52-21_18-31-54.JPG', '', '', 0, 0, 0, 'Свекла хороший источник витамина C, меди и фосфора. Свекла устраняет токсины в организме. Листья свеклы содержат много витамина А, а корни витамин C. Прием в пищу свеклы предотвращает появление или рост злокачественных опухолей.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '43', '1,5', '0,1', '8,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-10-028', 1, 3940, '', '', 'Репа ', 'Репа', 'Репа', 'Узбекистан', 0, 0, 0, 0, '', '2017122116-51-20_18-32-16_09-33-06.JPG', '', '', 0, 0, 0, 'Репа обладает рядом полезных свойств для организма.Например, сок репы оказывает болеутоляющее, успокаивающее и отхаркивающее действие, растворяет камни в почках, возбуждает сердечную деятельность, благоприятно действует при заболевании суставов ревматического и не травматического происхождения.\n\n', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '30', '1,5', '0,1', '6,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
