('ТС-1- 11-002', 1, 3951, NULL, '', 'Голубика', 'Голубика свежая', 'не знаю', 'Россия', 0, 0, 0, 0, 'шт', '2017122116-35-16_09-28-42.JPG', 'шт', '200 гр.', 0, 0, 0, 'Голубика – это огромное количество витаминов и минералов, незаменимых для человеческого организма.Высокий антиоксидантный потенциал ягоды помогает бороться с болезнями, вызванными наличием свободных радикалов в организме, такими, как инфаркт, рак, инсульт. Частота простудных заболеваний сводится к минимуму при регулярном употреблении голубики.', '200 гр.', 'Голубика свежая.', '2- 3 дня', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '35', '1,0', '0', '8,2', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3952, NULL, '', 'Малина', 'Малина свежая', 'не знаю', NULL, 0, 0, 0, 0, 'шт', '2017122116-34-59_18-33-09.JPG', 'шт', '200 гр.', 0, 0, 0, 'Малина одна из самых вкусных ягод, которую любят и взрослые, и дети. Богатая витаминами, антиоксидантами, пищевыми волокнами и еще многими полезными веществами, малина приносит очень много пользу для здоровья.Достаточно богата малина минералами, среди которых такие важные, как марганец, калий, медь, железо.', '200 гр.', 'Малина свежая.', '2 - 3 дня.', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '42,97', '0,82', '0,31', '10,12', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3953, NULL, '', 'Клубника', 'Клубника свежая', 'не знаю', NULL, 0, 0, 0, 0, 'шт', '2017122116-34-20_18-33-40.JPG', 'шт', '300 - 400 гр.', 0, 0, 0, 'Клубника – ароматная ягода, которая обладает уникальными пищевыми, лекарственными и полезными свойствами. Она содержит большое количество сахаров, витаминов, фолиевую кислоту, клетчатку, каротин, пектины, железо, кобальт, кальций, фосфор и марганец. Такое растение оказывает мощное оздоровительное влияние на человеческий организм.', '300 - 400 гр.', 'Клубника свежая.', '4 - 5 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '33,4', '0,58', '0,35', '7,2', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3954, '', '', 'Лук зеленый', 'Лук зеленый', 'Лук зеленый', 'Россия', 0, 0, 0, 0, '', '2017122116-33-12_18-34-19.JPG', '', '', 0, 0, 0, 'Полезные свойства зеленого лука не менее известны и многообразны, чем свойства и применение репчатого лука. А некоторые ученые убеждены, что польза зеленого лука выше. зеленый лук известен своими профилактическими свойствами в борьбе с простудными заболеваниями. Эта зелень повышает иммунитет и способствует общему укреплению человеческого организма. Зеленый лук помогает противостоять стрессовым ситуациям, возвращает истощенные физические силы и утраченную бодрость духа.', '', '', '10 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '2,0', '1,3', '0,1', '3,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3955, '', '', 'Лук зеленый', 'Лук зеленый', 'Лук зеленый', 'Россия', 0, 0, 0, 0, '', '2017122116-33-00_18-34-55.JPG', '', '', 0, 0, 0, 'Зелёный лук всегда являлся прекрасным дополнением к любым блюдам благодаря своей пикантности и остроте. Он обладает массой полезных свойств, и даже витаминов в нём больше, чем в самой луковице.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '2,0', '1,3', '0,1', '3,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3956, '', '', ' Салат Латук', ' Салат Латук', ' Салат Латук', 'Россия', 0, 0, 0, 0, '', '2017122116-32-44_18-35-59.JPG', '', '', 0, 0, 0, 'Салат богат фолиевой кислотой, которая помогает поддерживать умственные функции человека. Поэтому листья салата рекомендуется употреблять малым детям и пожилым, чтобы уберечь свою нервную систему.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '12', '1,2', '0,3', '1,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3957, '', '', 'Салат Лолло россо ', 'Салат Лолло россо', 'Салат Лолло россо', 'Россия', 0, 0, 0, 0, '', '2017122116-32-18_18-36-31.JPG', '', '', 0, 0, 0, 'Лолло россо - настоящий чемпион среди необходимой нам зелени. В нем есть кальций, цинк, кобальт, йод, магний и фосфор. Но больше всего в лолло россо калия, столь нужного сердцу и мозгу, и железа, необходимого для укрепления иммунитета и избавляющего от усталости. Другие микроэлементы позволяют организму качественно усваивать железо и калий, предоставляя ему по-настоящему сбалансированное питание.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '16', '1,5', '0,2', '20', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3958, '', '', 'Щавель', 'Щавель', 'Щавель', 'Россия', 0, 0, 0, 0, '', '2017122116-31-45_18-37-07.JPG', '', '', 0, 0, 0, 'Полезные свойства очень хорошо себя зарекомендовали в кулинарии. Самым популярным блюдом являются зелёные щи. Однако щавель часто добавляют и в салаты, горячие блюда, выпечку, соусы. Он отлично сочетается с кинзой, чёрным молотым перцем, шпинатом, цедрой, фенхелем, зеленью молодой крапивы, луком-пореем (читайте про свойства лука-порея) и репчатым луком, луком-шалот и шнитт-луком, мелиссой, мятой, укропом и петрушкой.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '1,5', '0,3', '29', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3959, '', '', 'Петрушка', 'Петрушка', 'Петрушка', 'Россия', 0, 0, 0, 0, '', '2017122116-31-20_18-37-41.JPG', '', '', 0, 0, 0, 'Петрушка очень необходимый продукт. Ее лечебные и полезные свойства неограничны. Петрушка часто применяется в народной и традиционной медицине, и помогает избавиться от многих недугов. Петрушка чрезвычайно богата полезными веществами и минералами.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '3,7', '0,4', '7,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3960, '', '', 'Шпинат', 'Шпинат', 'Шпинат', 'Россия', 0, 0, 0, 0, '', '2017122116-30-53_18-38-08.JPG', '', '', 0, 0, 0, 'Шпинат насыщает, снабжает организм питательными веществами, выводит шлаки и токсины. Только в моркови содержится больше каротина, чем в шпинате, а благодаря довольно высокому содержанию железа шпинат помогает гемоглобину стать активнее и лучше снабжать клетки кислородом; он улучшает обмен веществ и способствует выработке организмом энергии.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '2,9', '0,3', '2,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3961, '', '', 'Укроп', 'Укроп', 'Укроп', 'Россия', 0, 0, 0, 0, '', '2017122116-29-43_18-38-35.JPG', '', '', 0, 0, 0, 'Содержащихся в укропе витаминов достаточно много. Больше всего в нём витамина С. Его содержание достигает 100 мг. Также две лидирующие позиции занимают бета-каротин и витамин E. Их содержится более 1 мг. Остальные витамины, такие как: витамин A, PP и витамины группы B, также входят в состав зелени, но их содержание не превышает 1 мг. Тем не менее, в совокупности эти невидимые доктора способны излечивать различные болезни. ', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '40', '2,5', '0,5', '30', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3962, '', '', 'Редиска', 'Редиска', 'Редиска', 'Россия', 0, 0, 0, 0, '', '2017122116-28-32_18-39-46.JPG', '', '', 0, 0, 0, 'Редис показан к употреблению при проблемах с избыточным весом, поэтому его часто включают во многие диеты в качестве обязательного ингредиента в салатах. Он предупреждает развитие сердечно-сосудистых заболеваний, стимулирует выделение желудочного сока, благодаря чему улучшается пищеварение.', '', '', '7 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '19', '1,2', '0,1', '3,4', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3963, '', '', 'Грейпфрут', 'Грейпфрут', 'не знаю', 'Израиль', 0, 0, 0, 0, '', '2017122116-27-40_18-40-15.JPG', '', '', 0, 0, 0, 'Грейпфрут представляет собой сочетание двух фруктов в одном – апельсина и помело.Плод грейпфрута богат витаминами и минеральными веществами.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '35', '0,7', '0,2', '6,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3964, '', '', 'Брокколи', 'Брокколи', 'Брокколи', '', 0, 0, 0, 0, '', '2017122116-26-19_18-40-40.JPG', '', '', 0, 0, 0, 'Брокколи - прекрасный диетический продукт для предупреждения и лечения онкологических, сердечно-сосудистых заболеваний, нервных расстройств, заболеваний желудочно-кишечного тракта, нарушений обмена веществ, подагры.Брокколи можно подавать к столу сырой, отварной, приготовленной на пару, быстро обжаренной. Кроме этого, брокколи часто используется как ингредиент в супах, соусах для пасты, пирогах, омлетах, овощных гарнира.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '28', '2,8', '0,4', '6,7', '', ';', 'Испания', 0, 'YToxOntpOjA7czowOiIiO30=');
