('ТС-1- 11-002', 1, 3965, '', '', 'Имбирь', 'Имбирь', 'Имбирь', 'Китай', 0, 0, 0, 0, '', '2017122116-25-28_18-41-16.JPG', '', '', 0, 0, 0, 'Полезные свойства корня имбиря в свежем виде давно оценили на Востоке и там его чаще всего используют как пряность.Имбирь - это прекрасный иммуномодулятор, так как он обладает способностью выводить вредные токсины из организма человека. Именно благодаря этому свойству его применение просто необходимо в качестве профилактики простудных заболеваний либо во время болезни. ', '', '', '4 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '80', '1,8', '0,8', '15,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3966, '', '', 'Капуста красная', 'Капуста красная', 'Капуста красная', 'Россия', 0, 0, 0, 0, '', '2017122116-25-15_18-41-45_09-22-32.JPG', '', '', 0, 0, 0, 'Полезные свойства краснокочанной капусты ... Целебные свойства краснокочанной капусты обусловлены также содержанием в ней большого количества солей калия, магния, железа, ферментов, фитонцидов. По сравнению с белокочанной капустой она суховата, зато более богата питательными веществами и витаминами', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '24', '0,8', '0', '7,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3967, '', '', 'Гранат', 'Гранат', 'Гранат', 'Иран', 0, 0, 0, 0, '', '2017122116-23-50_18-42-24.JPG', '', '', 0, 0, 0, 'Уникальный фрукт гранат, польза  для здоровья которого определены его качествами, известен человечеству с древнейших времен. Недаром его называли фруктом из рая и использовали все части растения для оздоровления.Он полезен как для мужчин так и для женщин.\n\n', '', '', '2 - 3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '72', '0,7', '0,6', '14,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3968, '', '', 'Яблоко Голден', 'Яблоко Голден', 'Яблоко', 'Молдова', 0, 0, 0, 0, '', '2017122116-21-48_18-42-46_09-23-00.JPG', '', '', 0, 0, 0, 'Яблоки олден содержат в себе много полезных веществ. К примеру, каротин, который необходим для зрения и роста костей, а также он положительно сказывается на состоянии волос и ногтей.', '', '', '1 месяц', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '53', '0,5', '0,2', '10,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3969, '', '', 'Китайская капуста', 'Китайская капуста', 'Китайская капуста', 'Китай', 0, 0, 0, 0, '', '2017122116-21-02_18-43-20.JPG', '', '', 0, 0, 0, 'Продукт является одним из лучших овощей, который можно применять от авитаминоза и анемии.\n\nОгромное количество аскорбиновой кислоты будет способствовать укреплению иммунитета, улучшению сопротивляемости инфекциям.\n', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '12', '1,1', '0,3', '1,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3970, '', '', 'Салат Романо', 'Салат Романо', 'Салат Романо', 'Росиия', 0, 0, 0, 0, '', '2017122116-20-52_18-43-49.JPG', '', '', 0, 0, 0, 'Полезный свойства салата Романо обусловлены его богатым составом. Зеленые листья содержат витамины А и С, аминокислоты, магний, селен, железо, калий и кальций. Салат важно употреблять свежим, поскольку его хранение разрушает витамин С в составе листьев, а сам продукт становится вялым и не таким аппетитным.', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '17', '1,8', '1,1', '2,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3971, '', '', 'Виноград Кишмиш', 'Виноград Кишмиш', 'Виноград', '', 0, 0, 0, 0, '', '2017122116-19-09_18-45-02.JPG', '', '', 0, 0, 0, 'Полезные свойства винограда кишмиш возможны благодаря тому, что в его состав входит много витаминов и микроэлементов. Есть в ягодах калий, который положительно сказывается на состоянии сердечнососудистой системы и предотвращает возникновения различных заболеваний сердца. Виноград кишмиш рекомендуется включать в рацион питания людям с вегетососудистой дистонией, гипертонией и аритмией.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '69', '0,72', '0,16', '17,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3972, '', '', 'Виноград Молдова', 'Виноград Молдова', 'Виноград', 'Молдова', 0, 0, 0, 0, '', '2017122116-17-58_18-45-40.JPG', '', '', 0, 0, 0, 'Виноград ценился испокон веков, существует даже легенда, согласно которой после потопа первое растение, посаженное в землю, было именно виноградом. Древние греки настолько уважали ягоды этого растения, что разработали целую лечебную систему на ее основе – ампелотерапию (виноградотерапию) – лечение соком и свежими виноградными ягодами многих хронических заболеваний, простуды, упадка сил и прочего.\n\n', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '65', '0,31', '0,11', '16,65', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3973, '', '', 'Виноград красный', 'Виноград красный', 'Виноград', 'Молдова', 0, 0, 0, 0, '', '2017122116-16-56_18-46-20.JPG', '', '', 0, 0, 0, 'Виноград ценился испокон веков, существует даже легенда, согласно которой после потопа первое растение, посаженное в землю, было именно виноградом. Древние греки настолько уважали ягоды этого растения, что разработали целую лечебную систему на ее основе – ампелотерапию (виноградотерапию) –лечение соком и свежими виноградными ягодами многих хронических заболеваний, простуды, упадка сил и прочего.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '69', '0,31', '0,11', '16,65', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3974, '', '', 'Слива', 'Слива', 'Сливы', 'Эстония', 0, 0, 0, 0, '', '2017122116-15-57_18-47-02.JPG', '', '', 0, 0, 0, 'Благодаря богатому витаминно-минеральному составу, слива с давних времен является не только замечательным лакомством, но и превосходным целебным средством, которое способно защитить наше здоровье от разных болезней.', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '49', '0,8', '0,3', '9,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3975, '', '', 'Слива Молдова', 'Слива Молдова', 'Сливы', 'Молдова', 0, 0, 0, 0, '', '2017122116-14-58_18-47-27.JPG', '', '', 0, 0, 0, 'Гармоничный вкус, богатство витаминов и минералов, содержащихся в сливе, делают этот полезный фрукт одним из самых любимых десертов. Кроме отличного вкуса, слива отличается множеством полезных свойств.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '49', '5,6', '0,3', '9,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3976, '', '', 'Aйва', 'Айва', 'Aйва', 'Турция', 0, 0, 0, 0, '', '2017122116-14-38_18-47-55.JPG', '', '', 0, 0, 0, 'В Древней Греции плод айвы был символом любви и плодородия. Именно айву преподнес Парис Афродите, богине любви (и с тех пор она называется «яблоком раздора» или «золотым яблоком»). В средневековой Европе преподнесение в дар айвы считалось признанием в любви. Айва обладает общеукрепляющими, кровоостанавливающими, антисептическими, мочегонными и вяжущими свойствами.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '48', '0,6', '0,5', '9,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3977, '', '', 'Манго', 'Манго', 'Манго', 'Южная Африка', 0, 0, 0, 0, '', '2017122116-14-14_18-49-12.JPG', 'шт', '800 -1,2 кг.', 0, 0, 0, '\nГлавная страница ->  Питание и диеты\nМанго: польза и вред, состав и калорийность. Когда фрукт может принести пользу организму, а когда - навредить здоровью\n \n07.03.2016 12:15 Автор: Елена Козырева\nВсе чаще на столе у ценителей всего экзотического стал появляться манго.\n\nЕго родиной принято считать Индию.\n\nПо древней легенде, манго – подарок верховного индийского бога Шивы, который он преподнёс супруге в знак свой вечной любви к ней.\n\nС того самого времени и начали выращивать манго в Индии.\n\n\n \nСвою популярность этот ароматный, сочный и сладкий фрукт получил благодаря своему пикантному вкусу и множеству полезных свойств.Манго содержит массу тех веществ, при дефиците которых невозможна полноценная деятельность организма. Полезные для здоровья вещества находятся не только в его мякоти. Их достаточно в кожице и листьях. Полезность и ценность фрукта можно легко определить по составу.', '800 - 1,2 кг.', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '70', '0,5', '0,4', '7,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3978, '', '', 'Китайская груша', 'Китайская груша', 'Груша', 'Китай', 0, 0, 0, 0, '', '2017122116-13-51_18-49-43.JPG', '', '', 0, 0, 0, 'Китайская груша не только вкусная, а и полезная. В состав фрукта входят пищевые волокна, которые очищают кишечник и положительно сказываются на работе пищеварительной системы.Плоды обладают сладким вкусом с ноткой кислинки, придающей им особую пикантность. А в составе мякоти содержится немало компонентов, полезных и даже необходимых для организма человека. \n', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42', '0,5', '0,23', '7,05', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3979, '', '', 'Яблоко Рихард', 'Яблоко Рихард', 'Яблоко', 'Молдова', 0, 0, 0, 0, '', '2017122116-12-35.JPG', '', '', 0, 0, 0, 'Состав яблока неописуемо богат и разнообразен. В частности, в составе яблока присутствуют витамины В, С, Е, РР, а также калий, железо, кальций, магний, йод.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '0,4', '0,4', '9,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3980, '', '', 'Груша Форель', 'Груша Форель', 'Груша Форель', 'Аргентина', 0, 0, 0, 0, '', '2017122116-12-16_18-50-36.JPG', '', '', 0, 0, 0, 'Форель – сорт очень древний. Груши содержат много влаги и являются хорошим источником калия. Недозревшие плоды оказывают слабительное действие, а спелые обладают мочегонными и успокоительными свойствами.\n\nГруша Форель служит прекрасным украшением стола и сладким, ароматным десертом. Она почти не фигурирует в рецептах из-за своего маленького размера.\n\n,', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42', '0,4', '0,3', '10,6', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3981, '', '', 'Яблоко Фуджи', 'Яблоко Фуджи', 'Яблоко', 'Китай', 0, 0, 0, 0, '', '2017122116-11-45_18-51-13.JPG', '', '', 0, 0, 0, 'Яблоки обладают теми полезными веществами, которые благоприятно сказываются на организме человека. Содержание в них витаминов и полезных веществ делает их незаменимым продуктом.', '', 'Свежее яблоко', '3-4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '0,4', '0,4', '47', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3982, '', '', 'Хурма 5', 'Хурма 5', 'Хурма', 'Азербайджан', 0, 0, 0, 0, '', '2017122116-11-35_09-23-39.JPG', '', '', 0, 0, 0, 'Хурма защищает, лечит и восстанавливает все жизненно важные функции организма. Польза хурмы для организма бесценна, ведь она богата различными витаминами, минералами и другими питательными веществами. Ее включают в состав комплексной терапии заболеваний органов зрения и дыхания, пищеварения, мочеполовых органов, сердца и сосудов.\n', '', '', '1 месяц', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '67', '0,5', '0,4', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3983, '', '', 'Груша Аббат', 'Груша Аббат', 'Груша Аббат', 'Мороко', 0, 0, 0, 0, '', '2017122116-11-06_18-53-05.JPG', '', '', 0, 0, 0, 'Груша относится к многочисленному семейству розановых. Это теплолюбивая культура. Аббат Феттель – французский осенний сорт.Плоды обладают великолепными вкусовыми качествами. Белая или кремовая мякоть отличается тонким ароматом и сладким приятным пряным вкусом. Груша Аббат Феттель универсального назначения.\n', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46,33', '0,41', '0,5', '10,18', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3984, '', '', 'Груша Дюшес', 'Груша Дюшес', 'Груша', '', 0, 0, 0, 0, '', '2017122116-10-38_09-24-13.JPG', '', '', 0, 0, 0, 'Удивительный вкус и аромат груш описывал ещё древнегреческий поэт Гомер, рассказывая о необычных фруктах, которые произрастали в роскошных садах персидского царя.Многие диетологи называют груши неиссякаемым источником энергии, отмечая их уникальные питательные свойства при низкой калорийности.По своему составу они превосходят многие известные овощи и фрукты. ', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42', '0,4', '0,3', '7,05', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3985, NULL, '', 'Дыня', 'Дыня свежая', 'Дыня', NULL, 0, 0, 0, 0, 'шт', '2017122116-10-14_18-54-21.JPG', 'шт', '1,1 - 2,5 кг', 0, 0, 0, '.Дыня бесподобная, в ней всё полезно и можно съесть: сладкую мякоть, кожуру, семена. Дыня для организма необходима, ведь содержание необходимых и полезных элементов в дыне очень велико: фолиевая кислота, каротин, аскорбиновая кислота, жиры, витамины А, Р, С, минеральные соли Fe, K, Na, сахар, клетчатка. Несмотря на сладость, она очень хорошо справляется с жаждой. Зачастую, дыню употребляют в сыром, первозданном виде. Ещё её вялят, делают мёд, варят джем, цукаты.', '1,1 - 2,5 кг', 'Свежая дыня', '3- 4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '24', '0,8', '0,2', '8', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3986, NULL, '', 'Арбуз', 'Арбуз свежий', 'Арбуз', NULL, 0, 0, 0, 0, 'шт', '2017122116-09-39_18-55-25.JPG', 'шт', '3,0 - 12,0 кг.', 0, 0, 0, 'Арбуз – это всеми любимая ягода. Она содержит в себе множество полезных веществ, клетчатку и вкусный, ароматный сок, что ставит ее на главенствующие позиции летнего рациона .', '3,0 - 12,0 кг.', 'Свежий арбуз', '3 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '25', '0,6', '0,1', '5,8', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3987, NULL, '', 'Дыня', 'Дыня', 'Дыня', NULL, 0, 0, 0, 0, NULL, '2017122116-09-18_18-55-52.JPG', NULL, NULL, 0, 0, 0, 'Дыня бесподобная, в ней всё полезно и можно съесть: сладкую мякоть, кожуру, семена. Дыня для организма необходима, ведь содержание необходимых и полезных элементов в дыне очень велико: фолиевая кислота, каротин, аскорбиновая кислота, жиры, витамины А, Р, С, минеральные соли Fe, K, Na, сахар, клетчатка. Несмотря на сладость, она очень хорошо она очень хорошо справляется с жаждой. Зачастую, дыню употребляют в сыром, первозданном виде. Ещё её вялят, делают мёд, варят джем, цукаты.', '3,5 - 5,0 кг.', 'Свежая дыня', '3 - 4 месяца', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '24', '0,8', '0,2', '8', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3988, '', '', 'Груша Лесная Красавица', 'Груша Лесная Красавица', 'Груша Лесная Кравица', 'Росиия', 0, 0, 0, 0, '', '2017122116-08-52_09-24-52.JPG', '', '', 0, 0, 0, 'Лесная красавица — десертный сорт груш.Плоды ценятся за непревзойденный вкус и привлекательную внешнюю характеристику. Вкус – десертный, очень сладкий, с едва уловимым кисловатым послевкусием.. ', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '41,5', '0,2', '0,2', '10,6', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3989, NULL, '', 'Груша конференц', 'Груша конференц', 'Груша', NULL, 0, 0, 0, 0, NULL, '2017122116-08-32_18-57-39.JPG', NULL, NULL, 0, 0, 0, 'Груша \"конференц\", калорийность которой совсем невелика по сравнению с другими плодами, позволяет употреблять ее при различных диетах. Она не нанесет вреда худеющей фигуре. Фрукт этот полезен людям, страдающим болями в сердце, а кроме того, показан к употреблению для повышения иммунитета. Груша \"конференц\", калорийность которой составляет всего 40 ккал, содержит много органических кислот и питательных волокон.', NULL, 'Свежая груша', NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '42', '0,4', '0,3', '10,9', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3990, '', '', 'Ананас', 'Ананас', 'Ананас', 'Южная Африка', 0, 0, 0, 0, '', '2017122116-07-50_18-58-16.JPG', '', '', 0, 0, 0, 'Соплодия ананаса – ценнейший продукт питания – полезный и диетический. Но не только вкусовые качества делают фрукт привлекательным и желанным гостем на нашем столе. В мякоти соплодий содержатся практически все необходимые человеческому организму витамины и микроэлементы. В продукте присутствуют витамины группы В, А, Е, РР, С, К. Ананас богат магнием, калием, железом, натрием, фосфором, медью, цинком, селеном, марганцем, бором, йодом, кальцием и другими минералами.', '', 'Ананас свежий', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '52', '0,3', '0,1', '11,8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3991, '', '', 'Киви', 'Киви', 'Киви', 'Иран', 0, 0, 0, 0, '', '2017122116-07-06_18-58-49.JPG', '', '', 0, 0, 0, 'Тропический, экзотический фрукт - источник калия, кальция, фосфора, магния, железа и др.\n\nВ киви присутствуют белки, жиры, углеводы, органические кислоты, пищевые волокна. В продукте также содержится вода, насыщенные жирные кислоты, крахмал, моно- и дисахариды, зола.', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '0,8', '0,4', '8,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
