('TC-1-7-028', 1, 5181, '', '', 'Шиповник', 'Шиповник', 'Шиповник', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1811-44-24_14-35-402223.JPG', '', '', 0, 0, 0, 'Ягоды шиповника аккумулируют в себе огромное содержание полезных свойств. Польза от богатого состава витаминов и веществ настоя шиповника особенно ощутима в осенне-весенний период, когда организм человека остро в них нуждается.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '51', '1,6', '0', '14', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3995, '', '', 'Пекинская капуста', 'Пекинская капуста', 'Пекинская капуста', 'Китай', 0, 0, 0, 0, '', '2017122116-05-05_19-01-58.JPG', '', '', 0, 0, 0, 'Продукт является одним из лучших овощей, который можно применять от авитаминоза и анемии.\n\nОгромное количество аскорбиновой кислоты будет способствовать укреплению иммунитета, улучшению сопротивляемости инфекциям.\n\n\n\n', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '12', '1,1', '0,3', '1,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3996, '', '', 'Перец  болгарский зелен.', 'Перец  болгарский зеленый', 'Перец', 'Израил', 0, 0, 0, 0, '', '2017122116-04-31_19-02-24.JPG', '', '', 0, 0, 0, ' Болгарский зеленый  перец – универсальный продукт. Твердая хрустящая консистенция и нежный сладкий аромату делает его одним из самых востребованных овощей в кулинарии.. Один плод желтого перца в день полностью восполняет потребность организма в аскорбиновой кислоте.Зеленый  сладкий перец полезен во время беременности — в его составе много кальция.\n\n', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '3,3', '1,3', '0,0', '6,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 3997, '', '', 'Болгарский желтый перец', 'Болгарский желтый перец', 'Перец', 'Израил', 0, 0, 0, 0, '', '2017122116-04-17_19-04-05.JPG', '', '', 0, 0, 0, 'Болгарский желтый перец считается одним из самых полезных овощей, поэтому его включают в состав лечебных диет,Перец дает организму не только витамины и минералы, но ещё и служит антидепрессантом. Болгарский жёлтый перец широко используется в кулинарии, так как его можно мариновать, консервировать, жарить, варить и готовить на гриле', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '27', '1,3', '0,0', '5,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
