('ТС-1- 11-002', 1, 3999, '', '', 'Помидор Московский', 'Помидор Московский', 'Помидоры Московский', 'Росиия', 0, 0, 0, 0, '', '2017122116-03-40_19-10-54.JPG', '', '', 0, 0, 0, 'Помимо своего необычного вкуса, помидор славится невероятным количеством разных витаминов, кислот, минералов и полезных элементов. Иногда не укладывается в голове, как один помидор может сочетать в себе столько соединений.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '20', '1,1', '0,2', '37', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4000, '', '', 'Чеснок молодой', 'Чеснок молодой', 'Чеснок молодой', 'Россия', 0, 0, 0, 0, '', '2017122116-03-06_19-11-26.JPG', '', '', 0, 0, 0, 'Употребляя чеснок, вы повысите аппетит, улучшите работу кишечника, желудка, печени. Уже давно доказан противоглистный, мочегонный, болеутоляющий, противомикробный, спазмолитический эффект растения.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '143', '6,5', '0,5', '29,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4001, '', '', 'Перец красный', 'Болгарский Перец красный', 'Перец красный', 'Израиль', 0, 0, 0, 0, '', '2017122116-02-47_19-14-27.JPG', '', '', 0, 0, 0, ' Болгарский перец – универсальный продукт. Твердая хрустящая консистенция и нежный сладкий аромату делает его одним из самых востребованных овощей в кулинарии.. Один плод красного перца в день полностью восполняет потребность организма в аскорбиновой кислоте.Красный сладкий перец полезен во время беременности — в его составе много кальция.\n\n', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '27', '1,3', '0', '5,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4002, '', '', 'Помидор Розовый № 5', 'Помидор Розовый № 5', 'Помидоры Розовые', 'Дагестан', 0, 0, 0, 0, '', '2017122116-02-25_19-15-25.JPG', '', '', 0, 0, 0, 'Одними из наиболее вкусных и полезных являются розовые помидоры, которые так называются из-за своего нежно-розового цвета. Помидор – это не только продукт питания, но и источник самых разнообразных витаминов и микроэлементов. Например, в нем содержатся в большом количестве витамины группы В и витамин Е, а входящее в состав вещество тирамин способствует повышенной выработке серотонина. Именно поэтому он помогает избежать депрессии и всегда быть в форме.\n', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '0,85', '0,2', '4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4003, '', '', 'Лук белый', 'Лук белый', 'Лук', 'Россия', 0, 0, 0, 0, '', '2017122116-01-14_19-15-57.JPG', '', '', 0, 0, 0, ' Белый лук — древнейшая огородная культура,близкий родственник привычного репчатого. Это не только яркая приправа, улучшающая вкус традиционных блюд, но и полезный овощ, способный насытить организм человека полезными витаминами и микроэлементами.', '', '', '8 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46.63', '1.44', '0.66', '9.99', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4004, '', '', 'Лук красный', 'Лук красный', 'Лук', 'Россия', 0, 0, 0, 0, '', '2017122116-00-51_19-16-24.JPG', '', '', 0, 0, 0, 'Красный лук не только красиво выглядит в салате и других блюдах но, по мнению многих, превосходит обычный репчатый лук по вкусовым качествам.Вкус у красного лука действительно другой. Отличительной чертой является пурпурно-красная цветовая гамма.', '', '', '8 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '42', '1.4', '0', '9.4Лук красный — это один из очень популярных видов обыкновенног', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4005, '', '', 'Перец  зелый', 'Перец зеленый', 'Перец зелый', 'Россия', 0, 0, 0, 0, '', '2017122116-00-37_19-17-08.JPG', '', '', 0, 0, 0, 'Перец сладкий – чемпион среди овощей по содержанию витамина С.В состав сладкого зеленого перца входит алкалоид капсаицин, который, собственно, и придаёт овощу характерный вкус. Это вещество стимулирует работу желудка и поджелудочной железы, возбуждает аппетит, снижает артериальное давление, разжижает кровь и препятствуя образованию тромбов.', '', '', '14 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '33', '1,3', '0', '6,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4006, '', '', 'Огурцы гладкие Азер.', 'Огурцы гладкие  Азербайджан', 'Огурцы', '', 0, 0, 0, 0, '', '2017122116-00-23_19-18-11.JPG', '', '', 0, 0, 0, 'Сочные, ароматные, хрустящие бакинские огурцы, выращенные в экологически чистом районе Азербайджана - с плодородными почвами и свежим воздухом. Имеют вытянутую форму и гладкую кожицу. Отличаются освежающим вкусом.\n', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '14', '0,8', '0,1', '2,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4007, '', '', 'Морковь', 'Морковь', 'Морковь', 'Россия', 0, 0, 0, 0, '', '2017122116-00-05_19-18-38.JPG', '', '', 0, 0, 0, 'Она является одним из самых любимых и популярных корнеплодов.морковь не только обладает приятным вкусом, но также незаменима в здоровом рационе.Особенно ценно высокое содержание в моркови каротина .', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '32', '1.3', '0,1', '6.9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4008, '', '', 'Желтая морковь', 'Желтая морковь', 'Морковь', 'Узбекистан', 0, 0, 0, 0, '', '2017122115-59-03_19-19-00_09-25-52.JPG', '', '', 0, 0, 0, 'Желтая морковь обладает многими полезными свойствами - например, способностью защищать организм человека от развития злокачественных образований. Кроме того, в составе желтой моркови содержится лютеин, который предотвращает различные проблемы с сердечно-сосудистой системой, а также способствует надежной защите сетчатки глаза от неблагоприятного воздействия яркого солнечного света.', '', '', '2 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '3,3', '1,3', '0,1', '7,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
