('ТС-1- 11-002', 1, 4010, '', '', 'Чеснок Соло', 'Чеснок Соло', 'Чеснок Соло', 'Россия', 0, 0, 0, 0, '', '2017122115-56-22_19-20-26.JPG', '', '', 0, 0, 0, 'Употребляя чеснок, вы повысите аппетит, улучшите работу кишечника, желудка, печени. Уже давно доказан противоглистный, мочегонный, болеутоляющий, противомикробный, спазмолитический эффект растения.', '250 гр.', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '143', '6,5', '0,5', '29,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4011, '', '', 'Цукини', 'Цукини', 'Цукини', 'Испания', 0, 0, 0, 0, '', '2017122115-56-10.JPG', '', '', 0, 0, 0, ' Блюда из цукини поражают разнообразием, но неизменно в них одно – все они потрясающе вкусные и полезные. При всех очевидных преимуществах овоща нельзя не отметить еще одно – калорийность цукини составляет всего 16 ккал. на 100 гр., что является более низким показателем, чем у его близкого родственника – кабачка.', '', '', '1 месяц', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '16', '1,5', '0,2', '3,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4012, '', '', 'Сельдерей', 'Сельдерей', 'Сельдерей', '', 0, 0, 0, 0, '', '2017122115-55-10_09-26-39.JPG', '', '', 0, 0, 0, '\nПолезные свойства сельдерея ... Кстати, сельдерей рекомендуют употреблять в больших количествах больным сахарным диабетом. В корнеплодах и листьях растения содержатся ценные аминокислоты: каротин, аспарагин, никотиновая кислота, тирозин, эфирные масла и микроэлементы. Все части сельдерея являются полезными и питательными.', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '13,0', '3,6', '0,9', '8,4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4013, '', '', 'Помидоры Черри', 'Помидоры Черри', 'Помидоры', 'Галандия', 0, 0, 0, 0, '', '2017122115-54-49_09-27-06.JPG', '', '', 0, 0, 0, 'Томаты черри можно использовать не только для приготовления различных блюд, но и для их украшения.Именно к таковым относится томат черри. Это миниатюрная версия привычных помидоров, обладающая высокой питательностью, более сладким вкусом, содержанием витаминов и полезных веществ, а также способностью долгое время храниться в свежем виде, ценится подчас гораздо выше своих крупных собратьев.', '0.5', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '15', '0.8', '0.1', '2.8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4014, '', '', 'Мандарин ', 'Мандарин', 'Апелсин', 'Хорватия', 0, 0, 0, 0, '', '2017122115-54-27_19-20-58.JPG', '', '', 0, 0, 0, 'Мандарины считаются ценным диетическим продуктом. Они способствуют улучшению аппетита, усиливают обменные процессы в организме человека. Зимой они могут дать нам большое количество необходимых витаминов.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '33', '0,7', '0,2', '7,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
