('ТС-1- 11-002', 1, 4016, '', '', 'Яблоко ', 'Яблоко Сезоное', 'Яблоко', 'Молдова', 0, 0, 0, 0, '', '2017122115-53-03_19-21-52.JPG', '', '', 0, 0, 0, 'Яблоки – излюбленный фрукт среди многих россиян.Витамин С – один из важнейших для человеческого организма – содержится в количестве 9мг/100г яблок. Он помогает держать на должном уровне иммунитет и поддерживает нормальное функционирование эндокринной системы.\n\n', '', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '47', '0,4', '0,4', '9,8', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
