('ТС-1- 11-002', 1, 4019, '', '', 'Капуста', 'Капуста', 'Капуста', 'Россия', 0, 0, 0, 0, '', '2017122115-51-02_19-23-15.JPG', '', '', 0, 0, 0, 'Белокочанная капуста содержит достаточное количество витаминов и минеральных веществ, чтобы стать постоянным и полноценным продуктом для всех, кто заботится о состоянии здоровья. В химическом составе капусте находятся: витамины А, В1, В2, В5, С, К, РР, а также калий, кальций, магний, цинк, марганец, железо, сера, йод, фосфор, редкий витамин U, фруктоза, фолиевая кислота и пантотеновая кислота, клетчатка и грубые пищевые волокна.', '', '', '20 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '27', '1,8', '0,1', '4,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4020, '', '', 'Тыква красное солнце', 'Тыква красное солнце', 'Тыква', 'Крым', 0, 0, 0, 0, '', '2017122115-50-21_19-23-58.JPG', '', '', 0, 0, 0, 'Тыква – исключительно полезный диетический продукт. Самую большую ценность представляет та, которая не подвергалась температурной обработке. Содержание большого количества витаминов группы B, каротина, ценного для организма витамина D – незаменимых в детском питании – делает тыкву одним из популярных продуктов для прикорма грудничков.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '28', '1,3', '0,3', '7,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4021, '', '', 'Салат Айсберг', 'Салат Айсберг', 'Капуста', 'Польша', 0, 0, 0, 0, '', '2017122115-50-03_19-24-33.JPG', '', '', 0, 0, 0, 'Хрустящие пузырчатые листья с волнистыми краями приятны на вкус и достаточно долго сохраняют свежесть.данная разновидность более интересна как по своему виду, так и по вкусу. Клетчатка и пищевые волокна, которыми так богат Айсберг - незаменимые помощники для тех, кто стремится постройнеть, питаясь вкусно и разнообразно.', '300 -400 гр.', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '14', '0.9', '0.1', '1.8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4022, '', '', 'Тыква Гитара', 'Мускатная тыква Гитара', 'Тыква Гитара Мускатная', 'Краснодар', 0, 0, 0, 0, '', '2017122115-49-23_19-24-59.JPG', '', '', 0, 0, 0, 'Тыква-красавица Медовая гитара - всем тыквам - тыква! Из неё получается вкуснейшая начинка для пирогов и аппетитные цукаты.. Имеет высокие, питательные, диетические свойства. Используется в домашней кулинарии, для приготовления деликатесных блюд и соков, а также для диетического лечебного питания', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '1', '0,1', '7,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4023, '', '', 'Лук шалот', 'Лук шалот', 'Лук', 'Россия', 0, 0, 0, 0, '', '2017122115-49-09_19-25-57.JPG', '', '', 0, 0, 0, 'Лук шалот не заставит никого плакать, а еще он более сочный, нежный и ароматный.Острый и ароматный  лучок используют во всевозможных супах, мясных блюдах, для маринадов и салатов.\n\n\n\n', '', '', '8 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '15', '0.8', '0.1', '2.8', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4024, '', '', 'Баклажан', 'Баклажан', 'Баклажан', 'Испания', 0, 0, 0, 0, '', '2017122115-48-23_19-27-39.JPG', '', '', 0, 0, 0, 'Баклажаны - это сытный овощ, одновременно обладающий низкой калорийностью,активно используются в кулинарии.Их употребляют в пищу исключительно термически обработанными — тушеными, вареными или обжаренными. Из баклажанов делают разнообразные горячие и холодные закуски, овощные рагу, маринады и соленья.', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '24', '1.2', '0.1', '4.5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4025, '', '', 'Черный Авокадо Хасс', 'Черный Авокадо Хасс', 'Черный Авокадо Хасс', 'Колумбия', 0, 0, 0, 0, '', '2017122115-48-02_19-28-08.JPG', '', '', 0, 0, 0, 'Авокадо — богатый источник важных питательных веществ, витаминов, минералов, а также, что немаловажно, нежного и ненавязчивого вкуса. Поэтому раз оказавшись на вашем столе, он, скорее всего, прочно там обоснуется. Приготовление авокадо не потребует от вас ни сил, ни времени, ведь готовить его не сложнее, чем другие фрукты или овощи.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '160', '2', '14', '2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4026, '', '', 'Французская тыква', 'Французская тыква', 'Тыква Французская', 'крым', 0, 0, 0, 0, '', '2017122115-47-32_19-28-44.JPG', '', '', 0, 0, 0, 'Уникальные свойства тыквы оказывают благотворное действие на организм.Тыква известна своей особенностью, поэтому её рекомендуется добавлять в свой рацион беременным и тем, кто страдает морскою болезнью. Лечебные свойства продукта помогают улучшить работу печени, что немаловажно для людей, которые столкнулись с гепатитом. Побороть гипертонию, бессонницу и избавиться от стресса лучше всего позволит тыквенный сок.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '22', '1', '0,1', '7,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4027, '', '', 'Авокадо', ' Авокадо ', 'Авокадо ', 'Изпаиль', 0, 0, 0, 0, '', '201712215-47-09_19-29-10.JPG', '', '', 0, 0, 0, 'Авокадо — богатый источник важных питательных веществ, витаминов, минералов, а также, что немаловажно, нежного и ненавязчивого вкуса. Поэтому раз оказавшись на вашем столе, он, скорее всего, прочно там обоснуется. Приготовление авокадо не потребует от вас ни сил, ни времени, ведь готовить его не сложнее, чем другие фрукты или овощи.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '160', '2', '14', '2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4028, '', '', 'Физалис', 'Физалис', 'не знаю', 'Южная Америка', 0, 0, 0, 0, '', '2017122115-46-31.JPG', '', '', 0, 0, 0, 'Плоды физалиса применяют как противовоспалительное, болеутоляющее и антисептическое средство. Это растение обладает мочегонным, желчегонным и кровоостанавливающим свойствами. Из физалиса готовят отвар, который применяют при бронхите, отеках, ревматизме, ушибах и подагре. Плоды физалиса используют в лечебных целях для профилактики  мочегоных путей, мочекаменной болезни и заболеваний мочевого пузыря.', '', '', '1 месяц', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '32', '1,0', '1,0', '3,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4029, '', '', 'Красный перец острый', 'Красный перец острый Чили', 'Перец', '', 0, 0, 0, 0, '', '201712211546-12_19-29-38.JPG', '', '', 0, 0, 0, 'Красный жгучий чили - перец, который обладает самыми удивительными свойствами.Такой перец весьма полезен для человеческого здоровья и, ко всему прочему, вызывает у нас положительные эмоции и мысли.', '', '', '', 'Мексика', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '40', '2.0', '0.2', '9.5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4030, '', '', 'Лайм лимон', 'Лайм лимон', 'Лимон', 'Израиль', 0, 0, 0, 0, '', '2017122115-45-52_19-30-04.JPG', '', '', 0, 0, 0, 'Лайм - цитрусовый плод , близкий родственник лимона.У него сочная, нежная мякоть. В лайме больше витаминов, чем в лимоне, а кислота его менее агрессивна.Благодаря лайму улучшается иммунитет, исчезают болезни дыхательных органов, уходит пневмония, грипп, простуда.Используется лайм в кулинарии так же, как другие цитрусовые. Сок лайма кислее, чем у лимона, а аромат цедры – более насыщенный и яркий. Лайм употребляют в пищу в свежем виде, добавляя в напитки и различные блюда для придания им кислоты и аромата.', '', '', '3 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '16', '0.7', '0,2', '7,76', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4031, '', '', 'Перец зелёный острый', 'Перец зелёный острый', 'Перец', '', 0, 0, 0, 0, '', '2017122115-45-32_19-30-52.JPG', '', '', 0, 0, 0, 'Острый перец зеленого цвета – это незрелый чили, который уступает красной разновидности по жгучести, но не по содержанию полезных веществ.Достаточно стручка в день, чтобы забыть о бессоннице, нормализовать сон, и сделать его крепким и спокойным.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '36', '1.79', '0.92', '7.92', '', ';', 'Мексика', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4032, '', '', 'Картофель Батат', 'Картофель Батат', 'Картофель Батат', 'Голландия', 0, 0, 0, 0, '', '2017122115-44-38_19-31-24.JPG', '', '', 0, 0, 0, 'Отварной батат с розовой мякотью своим вкусом напоминает тыкву, сырой  напоминает вкус каштана.Десертный батат характеризуется содержанием большого количества провитамина А и глюкозы. Он намного вкуснее других видов корнеплода. Его мякоть окрашена в насыщенно-желтый цвет.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '61', '2,0', '0', '14,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4033, '', '', 'Лук Порей', 'Лук Порей', 'Лук Порей', '', 0, 0, 0, 0, '', '2017122115-44-07_19-31-51.JPG', '', '', 0, 0, 0, '\nПольза лука порея очевидна при повышенном давлении. При употреблении оно нормализуется из-за содержания калия. Не следует забывать и о том, что содержащиеся в таком луке фосфор, магний и фолиевая кислота воздействуют на клетки нервной системы.', '', '', '30 дней', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '33', '2,0', '0', '8,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4034, '', '', 'Кольраби', 'Кольраби', 'не знаю', 'Испания', 0, 0, 0, 0, '', '2017122115-43-27_19-32-23.JPG', '', '', 0, 0, 0, 'Кольраби похожа на белокочанную капусту, репу или редьку, но превосходит их по некоторым параметрам: более сочная, не встречается привкус горечи или остроты. Кольраби входят 13 витаминов, ', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '44', '2,8', '0,1', '7,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4035, '', '', 'Корень сельдерея', 'Корень сельдерея', 'Корень сельдерея', 'Морроко', 0, 0, 0, 0, '', '2017122115-42-27_19-32-52.JPG', '', '', 0, 0, 0, 'Корень сельдерея способствует очищению и омоложению организма, а также действует как общеукрепляющее средство. Употребление в пищу корня сельдерея положительно сказывается на состоянии кожи, волос и здоровья в целом.Корень сельдерея повышает аппетит аппетит, помогает улучшить переваривание пищи. Полезен корень сельдерея для сосудов, сердца, нервной системы. За счет низкой калорийности его применяют в программе снижения веса. А также сельдерей употребляют для повышения потенции у мужчин, так что полезен он мужчинам.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '32', '1,3', '0,3', '6,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('ТС-1- 11-002', 1, 4036, '', '', 'Гранат ', 'Гранат', 'Гранат', 'Азербайджан', 0, 0, 0, 0, '', '2017122115-32-50_19-33-18_09-27-52.JPG', '', '', 0, 0, 0, 'Благодаря витаминам группы B, которые в большом количестве содержаться в зернах, гранат улучшает память и зрение, стимулирует работу нервной системы.\nl', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '72', '0,7', '0,6', '14,5', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
