('TC-1-7-039', 1, 4270, '', 'Dial Export', 'Масло Рыжиковое', NULL, 'не знаю', '', 100, 30, 0, 0, 'шт', '2017-12-1915-36-2115-02-50.JPG', 'шт', '250 мл', 0, 0, 0, 'Рыжиковое масло – рекордсмен по содержанию Омега-3 и витамина Е; содержит витамин А, фитостеролы, фосфолипиды, хлорофилл и магний, который обеспечивает сбалансированный углеводный и белковый обмен. Масло обладает противоаллергическими свойствами, нормализует уровень сахара в крови, применяется для профилактики заболеваний ЖКТ, мочеполовой системы, остеопороза , простатита, атеросклероза. ', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', ' 898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1NjoiaHR0cDovL2RpYWxleHBvcnQucnUvcnl6aGlrb3ZvZS9yeXpoaWtvdm9lLW1hc2xvLTI1MC1tbC8iO30='),
('TC-1-7-039', 1, 4271, NULL, '', 'Масло Оливковое', NULL, 'не знаю', NULL, 220, 30, 0, 0, 'шт', '2017-12-1915-35-5215-30-46.JPG', 'шт', '250 мл', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-039', 1, 4272, '', 'Dial Export', 'Масло Кукурузное', NULL, 'не знаю', '', 120, 30, 0, 0, 'шт', '2017-12-1915-35-3715-31-23.JPG', 'шт', '250 мл', 0, 0, 0, 'Масло кукурузы получают из зародышей золотистых семян растения, содержащих множество биологических веществ, необходимых человеческому организму. Оно богато линолевой кислотой, которая повышает сопротивляемость организма и регулирует свертываемость крови, а также является ценным источником витаминов. Помимо токоферола, кукурузное масло содержит витамины F, B1, PP, провитамин А.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.\n\n', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', ' 898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1MzoiaHR0cDovL2RpYWxleHBvcnQucnUva3VrdXJ1em5vZS9tYXNsby1rdWt1cnV6bm9lLTAyNS8iO30='),
('TC-1-7-039', 1, 4273, '', 'Dial Export', 'Масло Конопляное', NULL, 'Конопля', '', 320, 30, 0, 0, 'шт', '2017-12-1915-35-0115-31-50.JPG', 'шт', '250 мл', 0, 0, 0, 'Конопляное масло – это продукт, получаемый из семян растения, которое относится к семейству Коноплевых.Масло темное, может иметь зеленоватый оттенок, на вкус – с небольшой кислинкой, запах слабый, приятный. Получают его путем холодного отжима. По содержанию омега-3 и омега-6 — полиненасыщенных жирных кислот, рекомендуемых при профилактике и лечении заболеваний сердечно-сосудистой, нервной системы, ожирении — почти догоняет льняное масло. Богато антиоксидантами, фитостеролами, жирорастворимыми витаминами и минеральными веществами.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1NToiaHR0cDovL2RpYWxleHBvcnQucnUva29ub3BseWFub2UvbWFzbG8ta29ub3BseWFub2UtMDI1LyI7fQ=='),
('TC-1-7-039', 1, 4274, '', 'Dial Export', 'Масло Горчичное', NULL, 'Горчица', '', 100, 30, 0, 0, 'шт', '2017-12-1915-33-4415-32-20.JPG', 'шт', '250 мл', 0, 0, 0, 'Этот вид масла отличает острый аромат и пикантный вкус. Идеально для приготовления традиционных блюд русской кухни: для винегретов, блинов, пирожков, картофеля, мясных отбивных. Выпечка, приготовленная с горчичным маслом, получается пышной и долгое время не черствеет. Горчичное масло стимулирует пищеварение и повышает аппетит, также оно является природным антибиотиков. Способствует профилактике сердечно-сосудистых заболеваний и укрепляет стенки сосудов. На горчичном масле можно жарить.', '', '100% нерафинированное растительное масло.Производится из семян горчицы. Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1NToiaHR0cDovL2RpYWxleHBvcnQucnUvZ29yY2hpY2hub2UvbWFzbG8tZ29yY2hpY2hub2UtMDI1LyI7fQ=='),
('TC-1-7-039', 1, 4275, '', 'Dial Export', 'Масло Арахиса', NULL, 'Арахис', '', 160, 30, 0, 0, 'шт', '2017-12-1915-33-33_15-32-50.JPG', 'шт', '250 мл', 0, 0, 0, 'Его отличает насыщенный ореховый вкус и тонкий, изысканный аромат. Производится из ядер арахиса. Масло арахиса – это питательный пищевой продукт, он обладает высокой энергетической ценностью и способствует быстрому насыщению. Применяется для заправки салатов, жарки и тушения мясных и овощных блюд, для приготовления выпечки. Применяется в косметологии.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-039', 1, 4276, '', 'Dial Export', 'Масло Виноградное', 'Масло виноградной косточки ', 'Виноград', '', 160, 30, 0, 0, 'шт', '2017-12-1915-33-24_15-33-21.JPG', 'шт', '250 мл', 0, 0, 0, 'Традиционный ингредиент средиземноморской кухни, это масло характеризуется легкостью и нейтральными вкусом и ароматом. Идеально для заправки салатов, подходит для тушения и жарки, для приготовления различных десертов. Отличается высоким содержанием витамина Е – природного антиоксиданта, способствует профилактике сердечно-сосудистых заболеваний. Это масло очень легко усваивается.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo2MzoiaHR0cDovL2RpYWxleHBvcnQucnUvdmlub2dyYWRuYXlhLWtvc3RvY2hrYS9tYXNsby12aW5vZ3JhZC0wMjUvIjt9'),
('TC-1-7-039', 1, 4277, '', 'Dial Export', 'Масло Грецкого Ореха', NULL, 'Грецкий орех', '', 250, 30, 0, 0, 'шт', '2017-12-1915-33-16_15-33-48.JPG', 'шт', '250 мл', 0, 0, 0, 'Это изысканное масло для приготовления разных соусов, для заправки салатов, гарниров, горячих мясных блюд. Незаменимо в кавказской кухне. Наряду с полиненасыщенными жирными кислотами Омега-3 и Омега-6 содержит витамины А, Е, С, различные микроэлементы: кобальт, фосфор, цинк, йод, железо, магний. Нормализует липидный обмен, способствует профилактике заболеваний сердечно-сосудистой системы. Нагревать не рекомендуется!', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1OToiaHR0cDovL2RpYWxleHBvcnQucnUvZ3JlY2tpai1vcmVoL21hc2xvLWdyZWNrb2dvLW9yZWhhLTAyNS8iO30='),
('TC-1-7-039', 1, 4278, '', 'Dial Export', 'Масло Кунжутное', NULL, 'Кунжут', '', 200, 30, 0, 0, 'шт', '2017-12-1915-33-10_15-35-33.JPG', 'шт', '250 мл', 0, 0, 0, 'Кунжутное масло применяется в азиатской кухне и подходит для приготовления блюд из птицы, морепродуктов, для заправки различных салатов. Характеризуется содержанием полиненасыщенных жирных кислот Омега-3 и Омега-6, высоким содержанием кальция: в чайной ложке содержится дневная норма этого важнейшего элемента! Является лучшим из всех растительных масел источником фитостерина и меди. Содержит сезамолин - естественный актиоксидант, омолаживающий клетки, регулирующий кислородный обмен в организме и укрепляющий иммунитет.', '', '100% нерафинированное растительное масло.Изготовлено из сырых семян кунжута.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1MzoiaHR0cDovL2RpYWxleHBvcnQucnUva3Vuemh1dG5vZS9tYXNsby1rdW56aHV0bm9lLTAyNS8iO30='),
('TC-1-7-039', 1, 4279, '', 'Dial Export', 'Масло Рисовое', NULL, 'Рис', '', 200, 30, 0, 0, 'шт', '2017-12-1915-32-5715-36-00.JPG', 'шт', '250 мл', 0, 0, 0, 'Производится из рисовых отрубей. Это традиционный продукт восточной кухни – японской, китайской и корейской. Характеризуется высокой температурой дымления, что позволяет хозяйкам жарить на нем без вреда для здоровья. Рисовое масло отличается высоким содержанием полиненасыщенных жирных кислот и природных антиоксидантов, которые замедляют старение организма. Масло широко применяется в кулинарии и косметологии.', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.\n', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1MzoiaHR0cDovL2RpYWxleHBvcnQucnUvbWFzbG8tcmlzb3ZvZS9tYXNsby1yaXNvdm9lLTAyNS8iO30='),
('TC-1-7-039', 1, 4280, '', 'Dial Export', 'Масло Льяное', NULL, 'не знаю', '', 100, 30, 0, 0, 'шт', '2017-12-1915-32-4415-36-29.JPG', 'шт', '250 мл', 0, 0, 0, 'Масло, изготовленное из семян льна, по мнению диетологов, является самым ценным среди всех масел растительного генеза. Его отличает оптимальное для усвоения количество полиненасыщенных жирных кислот Омега-3 и Омега-6. Льняное масло выводит «вредный» холестерин из организма, способствует профилактике атеросклероза, инсульта и инфаркта, благотворно влияет на липидный обмен. Обладает специфическими запахом и вкусом.Масло является диетическим и рекомендовано к употреблению во время религиозных постов.\n\n', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.В открытом виде хранится не более 2 месяцев! Нагревать не рекомендуется!\n\n\n', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo0NzoiaHR0cDovL2RpYWxleHBvcnQucnUvbG55YW5vZS9tYXNsby1sbnlhbm9lLTAyNS8iO30='),
('TC-1-7-039', 1, 4281, '', 'Dial Export', 'Масло Чесночное', NULL, 'Чеснок', '', 200, 30, 0, 0, 'шт', '2017-12-1915-32-3415-37-08.JPG', 'шт', '250 мл', 0, 0, 0, 'Благодаря высокому содержанию фитонцидов, оно повышает сопротивляемость организма к простудным заболеваниям, стимулирует работу желудка и кишечника, способствует развитию нормальной микрофлоры. Основная сфера применения чесночного масла – кулинария, и это немудрено: пикантный вкус и насыщенный аромат делают его удачной заправкой как для салатов, так и для горячих блюд! Попробуйте добавить чесночное масло в отварной картофель или мясные блюда – вкус Вас обязательно порадует!', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. В состав данного продукта входят азотистые соединения, полисахариды, фитонциды, фитостерины, никотиновая кислота, витамины группы B, минеральные соединения (фосфор, железо, йод, калий, кальций и др.).Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '898', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1NToiaHR0cDovL2RpYWxleHBvcnQucnUvY2hlc25vY2hub2UvbWFzbG8tY2hlc25vY2hub2UtMDI1LyI7fQ=='),
('TC-1-7-039', 1, 4282, '', 'Dial Export', 'Масло Тыквенное', NULL, 'Тыква', '', 300, 30, 0, 0, 'шт', '2017-12-1915-32-2515-37-33.JPG', 'шт', '250 мл', 0, 0, 0, 'Произведено из тыквенных семечек, обладает изысканными вкусом и ароматом. Содержит большое количество биологиески активных веществ, витамины В1, В2, С, Р, ненасыщенные и полиненасыщенные жирные кислоты - линоленовую, линолевую, пальмитиновую, стеариновую. Нагревать не рекомендуется!', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1MToiaHR0cDovL2RpYWxleHBvcnQucnUvdHlrdmVubm9lL21hc2xvLXR5a3Zlbm5vZS0wMjUvIjt9'),
('TC-1-7-039', 1, 4283, '', 'Dial Export', 'Масло Расторопши', NULL, 'Расторопша', '', 350, 30, 0, 0, 'шт', '2017-12-1915-32-1615-38-02.JPG', 'шт', '250 мл', 0, 0, 0, 'Получают такое масло методом холодного отжима из семян расторопши. Внешне оно представляет собой маслянистую жидкость, которая имеет цвет от желтого-до темно-желтого и приятный легкий запах и вкус. ', '', '100% нерафинированное растительное масло.Не содержит консервантов и ароматизаторов. Допускается естественный осадок. Хранить в темном месте при температуре 5-20 градусов.', '12 месяцев', 'ООО «Диал-Экспорт»', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czo1ODoiaHR0cDovL2RpYWxleHBvcnQucnUvcmFzdG9yb3BzaGEvbWFzbG8tcmFzdG9yb3BzaGktMjUwLW1sLyI7fQ=='),
