('Соления', 1, 4345, '', '', 'Спаржа с морковью', 'Спаржа с морковью', 'не знаю', '', 0, 0, 0, 0, '', '2017-12-1817-19-56_6-56-44.JPG', '', '', 0, 0, 0, 'Обладает низкой калорийностью, но содержит высокий процент белка, что является несомненным преимуществом при соблюдении диеты. Спаржа по-корейски, рецепт которой отличается простотой и доступностью, готовится с добавлением простых ингредиентов: моркови, чеснока и уксуса.\n\n', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '15', '1,8', '0,2', '1,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4346, '', '', 'Спаржа', NULL, 'не знаю', '', 0, 0, 0, 0, '', '2017-12-1817-19-5116-57-13.JPG', '', '', 0, 0, 0, 'Полезные свойства маринованной спаржи заключаются в наличии в ней витаминов С, РР, В1, В2, В5,В6, а также уникального вещества аспарагина. Много в маринованной спарже минеральных веществ: фосфора, натрия, магния, кальция.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '15', '1,8', '0,2', '1,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4347, '', '', 'Фунчоза', 'Рисовая лапша  с овощами по корейски', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-19-4716-57-41.JPG', '', '', 0, 0, 0, 'Прекрасный выбор для знакомства с китайской кухней! Такой легкий, но в то же время сытный салат может стать отличным ужином и даже обедом, особенно для тех людей, которые стараются следить за своим здоровьем и фигурой.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '136', '8', '8', '10', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4348, '', '', 'Ушки свиные маринованные', 'Ушки свиные маринованные', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-19-4416-58-29.JPG', '', '', 0, 0, 0, 'Маринованные ушки хороши к крепким спиртным напиткам (водке), это отличная закуска перед обедом (ужином), пробуждающая аппетит.Закуска эта совмещает в себе сразу несколько пряностей, которые сочетаясь между собой, придают блюду отличный привкус.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '211', '21', '14,1', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4349, '', '', 'Пророщенная пшеница', 'Пророщенная пшеница', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-19-4116-59-59.JPG', '', '', 0, 0, 0, 'Пророщенная пшеница – самый полезный вид проростков, именуемый как «живая пища». Зерно – дремлющий организм, скрывающий под своей оболочкой энергию для продолжения рода. проростки пшеницы выполняют очищающую функцию в организме человека. ', '', '', '15 сутек', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '198', '7,5', '1,3', '41,4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4350, NULL, '', 'Имбирь маринованный', 'Имбирь маринованный', 'не знаю', NULL, 0, 0, 0, 0, NULL, '2017-12-1817-19-3717-00-42.JPG', NULL, NULL, 0, 0, 0, 'Маринованный имбирь пришел к нам в виде приправы, которая традиционно подается с суши. И это не просто вкусная приправа, но и очень полезный для пищеварения продукт. Сильный и пряный аромат имбиря в процессе маринования усиливается.Маринованный имбирь приносит организму такую же пользу, как и сырой.  В процессе маринования имбирь не теряет своих полезных свойств.', NULL, 'Имбирь и маринад.', NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '51', '0,2', '0,3', '125', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4351, '', '', 'Пекинская маринованная', 'Пекинская маринованная', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-19-2117-01-11.JPG', '', '', 0, 0, 0, ' Желанная закуска на любом столе. Капусту - остренькую и хрустящую, или нежную и сочную - любят практически все. Пекинская капуста обладает превосходным вкусом и восхитительной нежностью. В маринаде она передаёт совершенно новый вкус и становится более пикантной, с приятным пряным оттенком вкуса.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '104', '16.2', '8.88', '5.47', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4352, '', '', 'Морская капуста', 'Морская капуста', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-19-1317-02-11.JPG', '', '', 0, 0, 0, ' морская капуста – практически бесспорный лидер среди продуктов, богатых йодом и натрием. К тому же морская капуста обладает богатым составом, достаточно употреблять ее по 30 грамм в день. Благодаря своей низкокалорийности, она способствует очищению всего организма.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '49', '0.8', '5.1', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4353, '', '', 'Хе по- корейски', 'Хе по- корейски', 'не знаю', '', 0, 0, 0, 0, '', '2017-12-1817-19-1017-02-50.JPG', '', '', 0, 0, 0, 'Хе – знаменитый корейский салат из сырой рыбы.\n Не только очень вкусное, но и внешне красивое блюдо. Оно отличается пикантностью и богатым ароматом. Отменный салат и  закуска для праздничного стола.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '125', '11.5', '6.70', '4.7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30=');
