('Соления', 1, 4354, NULL, '', 'Шиитаке маринованные', 'Шиитаке маринованные', 'не знаю', NULL, 0, 0, 0, 0, NULL, '2017-12-1817-18-4517-03-21.JPG', NULL, NULL, 0, 0, 0, 'Шиитаке — экзотичный гриб, который постепенно завоевывает популярность у отечественного потребителя. Приятный вкус, неподражаемый аромат, внушительное количество полезных свойств — преимущества, привлекающие и взрослых, и детей, постепенно делают ранее незнакомый продукт частым гостем на семейном столе.\nl', NULL, NULL, '10 дней', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '54', '3,0', '3,0', '1,0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
