('Соления', 1, 4357, '', '', 'Морковь маринованная', NULL, 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-3219-53-55.JPG', '', '', 0, 0, 0, 'Морковь маринованная рекомендуется употреблять людям, у которых в рационе недостает витаминов и микроэлементов. Поскольку в этом продукте есть клетчатка, и относится он к низкокалорийным, его можно включить в меню в период диеты. Грубые волокна, которые есть в морковке по-корейски, улучшают моторику пищеварительного тракта, что позволяет использовать ее при запорах.', '', '', '20 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '112,6', '1,2', '8,2', '9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4358, '', '', 'Опята маринованные', 'Опята маринованные', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-2817-04-38.JPG', '', '', 0, 0, 0, 'Это один из самых распространенных и любимых грибов. Они обладают пикантным вкусом и их з Маринованные опята можно использовать как самостоятельное блюдо, а можно готовить на их основе различные салаты и закуски.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '18', '0.4', '1.8', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4359, '', '', 'Чука', 'Чука', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-2417-05-13.JPG', '', '', 0, 0, 0, 'Чука – салат японского происхождения, который состоит из морских водорослей. Такое блюдо весьма характерно для восточной кухни. Его подают в разном виде и с всевозможными соусами. Те, кто ел морскую капусту, почувствуют разницу. Она выражена нежным ароматом моря, но без ярко выраженного запаха йода.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '120', '2.0', '6.0', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4360, '', '', 'Ушки свиные маринованные', 'Ушки свиные маринованные', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-1819-54-24.JPG', '', '', 0, 0, 0, 'Маринованные ушки хороши к крепким спиртным напиткам (водке), это отличная закуска перед обедом (ужином), пробуждающая аппетит.Закуска эта совмещает в себе сразу несколько пряностей, которые сочетаясь между собой, придают блюду отличный привкус.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '211', '21', '14.1', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4361, '', '', 'Корень сельдерея', 'Корень сельдерея маринованный', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-0919-55-06.JPG', '', '', 0, 0, 0, 'Сельдерей по-корейски - это отличная пикантная закуска. В нем содержится просто уйма полезных веществ. Этот острый салат-закуска состоит из минимума компонентов, не требует особых хлопот и позволяет разнообразить арсенал солений и маринованных овощей. В меру обжигающий, возбуждающий аппетит сельдерей по-корейски окажется кстати как в будничном рационе, так и среди изобилия праздничных блюд. \n\n\n \n', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '416.05', '0.40', '44.49', '4.66', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4362, '', '', 'Спаржевая фасоль', 'Спаржевая фасоль стручковая   по корейски', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-18-0319-55-34.JPG', '', '', 0, 0, 0, 'Остренькая, кисло-сладенькая зеленая фасоль  украсит любой праздничный стол.Она  очень полезна, вкусна, и самое главное, малокалорийна. ', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '117.67', '1.6', '7', '11.67', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Соления', 1, 4363, '', '', 'Капуста с морковью ', 'Капуста с морковью  по корейски', 'не знаю', 'Россия', 0, 0, 0, 0, '', '2017-12-1817-17-5919-56-01.JPG', '', '', 0, 0, 0, 'Маринованная капуста по-корейски быстрого приготовления – закуска «с огоньком» для любителей остренького. Такая капуста прекрасно подойдет к любому блюду, учитывая то, что закуска острая, она отлично подойдет к мясу или рыбе.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '30', '1.7', '0.1', '5.4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
