('TC-1-7-028', 1, 5175, '', '', 'Арахис', 'Арахис', 'Арахис', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1811-39-40_14-32-322223.JPG', '', '', 0, 0, 0, 'В состав ореха входят не только витамины и минералы, но и большое количество протеинов. Поэтому люди, которые хотят нарастить мышечную массу и активно занимаются спортом, могут смело употреблять арахис. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '622', '26,3', '45,2', '9,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
