('Свинина вакум', 1, 4381, '', '', 'Печень свиная', 'Печень свиная в вакууме', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-12-1816-57-3622-43-56.JPG', '', '', 0, 0, 0, 'В пищу свиную печень используют в самых разных вариантах - вареную, жареную (на сковороде, гриле, во фритюре), запеченную. Из этого продукта готовят знаменитые печеночные паштеты, оладьи и даже печеночный торт. Из отварной печени делают вкуснейший фарш для колбасы, пирожков и рулетов, ее добавляют в салаты и закуски. ', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '109', '18,8', '3,8', '4,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
