('Свинина вакум', 1, 4389, '', '', 'Сердце свинины в/у', 'Сердце свинины в/у', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-12-1816-55-4022-53-27.JPG', '', '', 0, 0, 0, 'Свиное сердце – очень вкусная и ароматная часть свинины.Его можно варить, жарить, запекать в духовке, тушить.Вареное сердце – идеальный продукт для приготовления салатов и разных закусок.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '118', '16,9', '4,8', '2,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Свинина вакум', 1, 4390, '', '', 'Ноги передн. свин.охлаж', 'Ноги передн. свин.охлаж', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-12-1816-55-3322-54-13.JPG', '', '', 0, 0, 0, ' Этот субпродукт относится к низкой категории. Вообще свиные ноги состоят из шкуры, костей и сухожилий. В них практически нет жира и мяса. Чаще всего используют ноги для получения желирующего эффекта, что дает возможность не использовать желатина или агар-агара для застывании бульона. Для этого субпродукт в течение длительного времени варят.', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '216', '18', '16', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Свинина вакум', 1, 4391, '', '', 'Рулька свиная', 'Рулька свиная в/у', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-12-1816-55-2022-55-20.JPG', '', '', 0, 0, 0, 'Польза свиной рульки заключается как раз в тех веществах, которые и позволяют холодцу стать холодцом. Это животные желерующиевещества, которые содержаться в костях, связках и хрящах. В холодце, который сварен из свиной рульки, содержится большое количество коллагена. Он повышает эластичность тканей и суставов человека. Кроме того, как и вся свинина, свиная рулька богата витаминами группы B и глицином. ', '', '', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '333', '18,6', '24,7', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
