('TC-1-7-028', 1, 5174, '', '', 'Изюм Малаяр ', 'Изюм Малаяр ', 'Изюм ', 'Иран', 0, 0, 0, 0, '', '2017-12-1811-39-12_14-32-032223.JPG', '', '', 0, 0, 0, 'Изюм малаяр – виноград светлых сортов, бережно высушенный на солнце. По полезности почти не уступает свежему винограду, так как сохраняет в себе витамины. Этот сорт изюма содержит бор, который редко поступает в организм с пищей. Данный микроэлемент повышает усвояемость кальция, поэтому купить изюм стоит для профилактики остеопороза и других заболеваний костей.\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '275', '2,95', '0,3', '66', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
