('TC-1-7-028', 1, 4800, '', '', 'Кунжут белый', 'Кунжут белый', 'Кунжут ', 'Индия', 0, 0, 0, 0, '', '2017-12-1812-27-542.JPG', '', '', 0, 0, 0, 'Кунжутное семя — это приправа, которая пришла к нам с Востока. Её добавляют в различные блюда и даже выпечку, чтобы получить неповторимые вкусовые нотки. При этом выделяют у кунжута полезные свойства для организма.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '565', '19,4', '48,7', '12,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
