('TC-1-7-028', 1, 4807, '', '', 'Рис Девзира', 'Рис Девзира', 'Рис Девзира', '', 0, 0, 0, 0, '', '2017-12-1812-35-262.JPG', '', '', 0, 0, 0, 'Рис девзира – считается самым лучшим и самым дорогим сортом риса. Он представляет собой рис темного красно-коричневого цвета. Если его промыть в холодной воде, он становится практически прозрачным и янтарным, это очень красивое зрелище.В кулинарии рис девзира используется очень часто. Этот продукт считается очень питательным, он содержит большое количество углеводов и белковых веществ.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '365', '9,2', '0,8', '80,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4808, '', '', 'Рис Девзира', 'Рис Девзира', 'не знаю', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1812-37-022.JPG', '', '', 0, 0, 0, '', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4809, '', '', 'Белая фасоль', 'Белая фасоль', ' фасоль', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-38-112.JPG', '', '', 0, 0, 0, 'Самый известный во всем мире вид фасоли - белая фасоль. Именно эта фасоль является лидером по содержанию клетчатки, которая легко растворяется и прекрасно усваивается.Область ее применения в кулинарии весьма широка и разнообразна, из нее можно создать массу необыкновенно вкусных и полезных кулинарных шедевров, включая первые блюда и гарниры. Белая фасоль способна украсить собой любой стол.', '', '', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '89', '15,10', '1,730', '36,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4810, '', '', 'Красная фасоль', 'Красная фасоль', 'Красная фасоль', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-39-142.JPG', '', '', 0, 0, 0, ' У красной фасоли самая плотная оболочка, нежная, чуть маслянистая мякоть с приятным ореховым вкусом.Фасоль – идеальная помощница для любой хозяйки, ведь из красной фасоли можно приготовить супы, гарниры, полноценные вторые блюда и множество салатов.', '', '', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '93', '8,4', '0,3', '13,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4811, '', '', 'Фасоль Ласточка', 'Фасоль Ласточка', 'Фасоль ', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-40-022.JPG', '', '', 0, 0, 0, 'Один из лучших видов  сортов зерновой фасоли.Фасоль «Ласточка» содержит большое количество белка, даже большее, чем в говядине или свинине. Качество содержащегося в этой фасоли белка не уступает белку диетических куриных яиц.', '', '', '2 года', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '84', '5,7', '1,0', '13,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4812, '', '', 'Нут', 'Нут', 'Нут', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-40-522.JPG', '', '', 0, 0, 0, 'Популярен он чрезвычайно. С ним готовят и супы, и пловы, и многие второе блюда, даже используют в качестве закуски, пекут лепешки.Он сам по себе ярок и вкусен, поэтому всегда будет украшение блюда.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '309', '20,1', '4,32', '46,16', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4813, '', '', 'Маш', 'Маш', 'Маш', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-41-592.JPG', '', '', 0, 0, 0, 'Горох маш имеет все основания считаться полезным продуктов, потому что его химический состав богат и разнообразен.По вкусу больше всего похож на фасоль, но имеет восхитительный, чуть ореховый привкус.Отлично сочетается с бараниной, со шпинатом, другими бобовыми и рисом, из него получаются замечательные запеканки, котлетки, тушёные рагу и гарниры. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '300', '23,5', '2,0', '46,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4814, '', '', 'Рис Лазер', 'Рис Лазер', 'Рис', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-43-122.JPG', '', '', 0, 0, 0, 'Этот абсолютно белый, красивый рис.Он довольно мягок, крахмалист ,длинной формы зерном,липкость у него вполне умеренная.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '303', '7,5', '2,6', '62,3', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
