('TC-1-7-028', 1, 4817, '', '', 'Инжир Парвиз', 'Инжир Парвиз', 'Инжир ', 'Турция', 0, 0, 0, 0, '', '2017-12-1812-45-122.JPG', '', '', 0, 0, 0, 'Инжир – высокое листопадное дерево, с вкусными, очень сладкими плодами, похожими на небольшую грушу, имеющих множество мелких семян внутри.В плодах инжира содержатся витамины группы В, С, РР, А. Он богат калием, который очень позитивно влияет на работу сердечной мышцы и мягких тканей всего организма, предотвращает утомление, выводит лишнюю жидкость. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '46', '0,7', '0,2', '13,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4818, '', '', 'Халва \"Самарканд\"', NULL, 'Халва', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-45-372.JPG', '', '', 0, 0, 0, 'Говорят, что этот десерт изобрели кулинары персидских царей. Самаркандская (дайма-ойла) – взбивается на яичных белках с пастой из кешью, ванилина, сахара, сливок и патоки. Часть орешков помещается в начинку целиком Халва Самаркандская халва - Невероятно вкусный десерт.\n', '500 гр.', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '297,5', '5,33', '10,26', '47,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
