('TC-1-7-028', 1, 4820, '', '', 'Финик Ajwa', 'Финик Ajwa', 'Финик', 'Израиль', 0, 0, 0, 0, '', '2017-12-1812-46-102.JPG', '', '', 0, 0, 0, 'Аджва – это один из самых старейших сортов.Эти поразительные финики с мягкой коричнево-черной кожицей и слегка сладкой мякотью тают во рту, а их восхитительный вкус напоминает чернослив. Этот сорт полезен для здоровья тем, что благотворно влияет на кровяное давление.', '500 гр.', '', '8 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '274', '2,5', '0,5', '69,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4821, '', '', 'Финик \"MABROOM\"', 'Финик \"MABROOM\"', 'Финик', 'Саудовская Аравия', 0, 0, 0, 0, '', '2017-12-1812-46-222.JPG', '', '', 0, 0, 0, 'Финики – хорошо знакомый нам продукт и любимый многими с детства. Плоды финиковой пальмы издревле считаются лакомством.Он очень полезен. \n\n', '500 гр.', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '274', '2,5', '0,5', '69,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
