('TC-1-7-028', 1, 4824, '', '', 'Кумкват мандарин', 'Кумкват мандарин', 'мандарин', 'Китай', 0, 0, 0, 0, '', '2017-12-1812-49-432.JPG', '', '', 0, 0, 0, 'Сушеный кумкват является разновидностью сухофруктов, которые готовят из небольших плодов вечнозеленых деревьев или кустарников семейства рутовых рода фортунелла. Фрукты кумквата, относящиеся к цитрусовым, могут иметь удлиненную или круглую форму величиной с крупную оливу.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '71', '1,88', '0,86', '9,4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
