('TC-1-7-028', 1, 4830, '', '', 'Цукаты \"Кубик\"', 'Цукаты \"Кубик\"', 'Цукаты', 'Китай', 0, 0, 0, 0, '', '2017-12-1812-58-492.JPG', '', '', 0, 0, 0, 'Цукаты – это ягоды, кусочки фруктов или овощей, которые были выварены в сахарном сиропе, а затем высушены.В цукатах всегда присутствуют клетчатка, растительные белки, органические кислоты, витамины, минералы и другие питательные вещества, которые содержались в аналогичном необработанном продукте.Благодаря обилию сахара цукаты восполняют организм глюкозой и углеводами, насыщая его, тем самым, энергией.\n\n', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '216', '3', '0', '54,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4831, '', '', 'Фундук ', 'Фундук в ойгурте и шоколаде', 'не знаю', 'Грузия', 0, 0, 0, 0, '', '2017-12-1813-02-352.JPG', '', '', 0, 0, 0, 'Великолепное лакомство, которое предлагает наш Интернет-магазин в своем ассортименте – фундук в белом и темном шоколаде. Отборные орехи, очищенные и нежно обжаренные, покрыты тонким слоем вкуснейшей сладкой шоколадной глазури. Сложно придумать что-либо вкуснее и приятнее, чем эти замечательные драже. Очень вкусно употреблять в пищу фундук в йогурте вместе с чаем или кофе, или же просто как сладость, подобно конфетам. ', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '446', '12,5', '16,6', '72,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4832, '', '', 'Изюм радуга', 'Изюм радуга', 'Изюм', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1813-03-082.JPG', '', '', 0, 0, 0, 'Изюм способствует усвоению организмом кальция, в нем много калия, магния, марганца. Он укрепляет сердце и сосуды.А в разноцветной глазури он еще вкусней!', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '379', '3,6', '8,9', '73,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
