('TC-1-7-028', 1, 4835, '', '', 'Семечки ', 'Семечки Радуга', 'Семечки', 'Россия', 0, 0, 0, 0, '', '2017-12-1813-07-222.JPG', '', '', 0, 0, 0, 'Семечки подсолнуха имеют богатый состав полезных жирорастворимых витаминов (А, Е, D, группа В), минералов (магний, цинк, железо, фтор, кальций, йод), аминокислот и полиненасыщенных кислот, которые снижают уровень холестерина и замедляют старение клеток.Семечки в разноцветной глазури это необычайно сладенький,вкусненький десерт.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '734', '31', '63,5', '13', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4836, '', '', 'Грецкий орех в йогурте', 'Грецкий орех в йогурте', 'Грецкий орех', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1813-07-582.JPG', '', '', 0, 0, 0, 'Орехи — залог здоровья человека.Ядра богаты белком, в них много витаминов. Они помогают при диабете, улучшают память и понижают давление. Грецкий орех в йогурте, необычайно вкусненький.Его можно кушать на чайной церемонии вместо конфет. Вкусно и полезно!', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '754', '17,2', '70,2', '9,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30=');
