('TC-1-7-028', 1, 4841, '', '', 'Фундук в шоколаде', 'Фундук в шоколаде', 'Фундук в шоколаде', '', 0, 0, 0, 0, '', '2017-12-1813-14-032.JPG', '', '', 0, 0, 0, 'Фундук – отличный и полезный перекус, прекрасное дополнение к десертам в составе смеси орехов и сухофруктов или самостоятельно.Фундук в шоколаде замечательное лакомство!', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '590,25', '8,57', '46,45', '40,12', '', ';', 'Грузия', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4842, '', '', 'Миндаль  Радуга', 'Миндаль  Радуга', 'Миндаль', 'Казасхстан', 0, 0, 0, 0, '', '2017-12-1813-14-562.JPG', '', '', 0, 0, 0, 'Миндаль среди всех других видов орехов обладает самыми полезными свойствами для здоровья.Ядра миндаля обладают обезболивающим, противосудорожным, обволакивающим и мягчительным действием. А миндаль в разноцветной глазури это удивительное лакомство!\n\n', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '695', '19,6', '67,7', '18,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 4843, '', '', 'Миндаль в йогурте', 'Миндаль в йогурте', 'Миндаль', 'Казахстан', 0, 0, 0, 0, '', '2017-12-1813-15-472.JPG', '', '', 0, 0, 0, 'Вкусное сочетание орехового ядра и сладкой оболочки – миндаль в йогурте. Продукт представляет собой целые отборные поджаренные миндальные орехи, покрытые сладкой йогуртовой глазурью. Миндаль в йогурте – желанное лакомство не только для детей, но и для взрослых. Прекрасно подходит в качестве сопутствующего кофепитию лакомства, придавая процессу восточный колорит. Может входить в состав всевозможных ассорти. ', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '567', '9,19', '39,57', '45,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
