('TC-1-7-028', 1, 5183, '', '', 'Грецкий орех неочищенный', 'Грецкий орех неочищенный', 'Грецкий орех неочищенный', 'Чили', 0, 0, 0, 0, '', '2017-12-1811-46-42_14-40-042223.JPG', '', '', 0, 0, 0, 'Он крупнее и вкуснее, чем его украинский собрат, и обладает неповторимо нежным молочным послевкусием. Продается такое лакомство именно в скорлупе, так как она надежно защищает ядро от разного рода внешних воздействий, сохраняя неизменным его вкус и пользу.В силу природных особенностей, орехи этого сорта имеют очень тонкую скорлупу и легко открываются руками.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '656', '16', '60', '11', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5184, '', '', 'Фундук сырой очищенный', 'Фундук сырой очищенный', 'Фундук', 'Грузия', 0, 0, 0, 0, '', '2017-12-1811-47-16_14-40-402223.JPG', '', '', 0, 0, 0, 'Этот продукт весьма богат питательными веществами, калорийность орехов фундука выше калорийности хлеба, молока и даже шоколада. Лесной орех имеет массу полезных свойств, в том числе он повышает иммунитет, улучшает работу сердца и сосудов, обеспечивает профилактику сердечнососудистых заболеваний и атеросклероза. \n\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '704', '16,1', '66,9', '9,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5185, '', '', 'Курага Джамбо темная', 'Курага Джамбо темная', 'Курага', 'Турция', 0, 0, 0, 0, '', '2017-12-1811-49-37_14-41-112223.JPG', '', '', 0, 0, 0, 'Натуральная курага Джамбо - это крупная отборная курага, с еще более ярким вкусом. Натуральная курага имеет тёмный цвет и мягкую текстуру.Этот сушёный абрикос без косточки имеет восхитительный сладкий аромат без кислинки, который идеально подходит для перекусов. Добавляйте к вашим рецептам в выпечку или просто наслаждайтесь этой курагой.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '215', '5,2', '0,3', '51,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5186, '', '', 'Финик Королевский', 'Финик Королевский Джамбо ', 'Финик', 'Израиль', 0, 0, 0, 0, '', '2017-12-1811-50-17_14-41-392223.JPG', '', '', 0, 0, 0, 'Финики Джамбо ( вес 1 шт -  22-26 грамм ) – настоящее достоинство королевского стола.Тёмно-коричневые королевские финики Джамбо наделены стойким ароматом и нежной мякотью с карамельным вкусом. Их янтарный блеск так и манит попробовать экзотический вкус заморских ягод. \n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '273', '2,8', '0,8', '6,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5187, '', '', 'Курага крупная', 'Курага крупная', 'Курага', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1811-50-31_14-43-062223.JPG', '', '', 0, 0, 0, 'Продукт экстра-класса - это идеально чистые крупного размера сухофрукты, отличающиеся средней упругостью и жесткостью, насыщенным цветом.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '215', '5,2', '0,3', '51,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5188, '', '', 'Ананас натуральный', 'Ананас натуральный', 'Ананас', 'Тайвань', 0, 10, 0, 0, '', '2017-12-1811-51-26_14-44-022223.JPG', '', '', 0, 0, 0, 'Натуральный сушеный ананас — это изумительный экзотический фрукт, но он не только красив, но и крайне полезен. Благодаря своему составу, ананас способствует похудению и расщепляет жиры, поэтому рекомендован при диете. Употребление ананаса предотвращает появление простудных заболеваний, а также заболеваний сердца и сосудов.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '268', '25,7', '24,1', '13,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5189, '', '', 'Курага горная дычка', 'Курага горная дычка', 'Курага ', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1811-51-45_14-52-392223.JPG', '', '', 0, 0, 0, ' Курага \"Горная\" - это натуральный продукт отличного качества.\nКурага — это очень сладкий сухофрукт. Его сладость объясняется тем, что в нем много фруктозы. Поэтому она разрешена для употребления тем, кто имеет проблемы с количеством сахара в крови и диабетикам, Курага \"Горная\" - это натуральный продукт отличного качества.\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '215', '5,0', '0,4', '51', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5190, NULL, '', 'а', NULL, 'не знаю', NULL, 0, 0, 0, 0, NULL, '2017-12-1811-52-06_15-00-062223.JPG', NULL, NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5191, '', '', 'Курага монетка', 'Курага монетка', 'Курага ', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1811-52-29_15-00-322223.JPG', '', '', 0, 0, 0, 'Курага-один из полезнейших продуктов здорового питания, она укрепляет сердечную мышцу, улучшает работу мочевыделительной системы, щитовидной железы. Этот продукт необходим при малокровии, авитаминозе. Сушёный абрикос улучшает функцию желудочно-кишечного тракта и зрения. Общее самочувствие и тонус улучшаются при введении кураги в питательный рацион.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '215', '5,0', '0,4', '5,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5192, '', '', 'Изюм Голден', 'Изюм Голден', 'Изюм', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1811-53-05_15-00-592223.JPG', '', '', 0, 0, 0, 'Голден - изюм золотистого цвета. Характеризуется он тем, что производится методом сушения на солнце и обладает ярко выраженным виноградным сладчайшим вкусом. Считается сортом экстра-класса.Изюм - настоящий бестселлер среди всех сухофруктов. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '272,5', '2,6', '0,6', '65,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5193, '', '', 'Персик сушеный', 'Персик сушеный', 'Персик сушеный', 'Армения', 0, 0, 0, 0, '', '2017-12-1811-54-07_15-01-482223.JPG', '', '', 0, 0, 0, 'Божественный сочный красивый фрукт - всё это персике! Он такой вкусный, что от него невозможно оторваться.Вкусным и полезным персик остается и в вяленом виде.Очень ценный продукт в рационе питания человека. Мякоть плодов персика очень сочная, ароматная, освежающая, питательная, легко усваивается.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '254', '3,0', '0,4', '57,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5194, '', '', 'Урюк  с косточкой', 'Урюк  с косточкой', 'Урюк ', 'Таджикистан', 0, 0, 0, 0, '', '2017-12-1811-54-37_15-02-212223.JPG', '', '', 0, 0, 0, 'Среди всех видов сушеных абрикосов урюк считается самым полезным.Урюк широко используется в кулинарии.Большое содержание в урюке углеводов, прежде всего сахаров, делает его ценным источником энергии, повышающим работоспособность организма и обостряющим умственную активность.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '242', '5', '0,4', '53', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5195, NULL, '', 'а', NULL, 'не знаю', NULL, 0, 0, 0, 0, NULL, '2017-12-1811-55-29_15-02-472223.JPG', NULL, NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5196, '', '', 'Орех грецкий очищенный', 'Орех грецкий очищенный Элита', 'Орех грецкий', 'Украина', 0, 0, 0, 0, '', '2017-12-1811-55-48_15-03-142223.JPG', '', '', 0, 0, 0, 'Грецкий орех этой категории представляет собой разделенное примерно напополам ядро. У грецкого ореха данного сорта ядра самого высокого качества, равномерного светлого цвета без примеси темно-соломенного или лимонно-желтого. В грецких орехах содержится множество белка, других витаминов, клетчатка и минералы.\n\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '655', '16', '60', '11', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30=');
