('TC-1-7-028', 1, 5197, '', '', 'Арахис неочищенный', 'Арахис неочищенный', 'Арахис', 'Аргентина', 0, 0, 0, 0, '', '2017-12-1811-56-22_15-03-442223.JPG', '', '', 0, 0, 0, 'Арахис сырой неочищенный – натуральный продукт, который благодаря своим полезным свойствам является одним из самых популярных орехов.Также арахис профилактически действует на сердечно-сосудистую систему, помогает бороться со стрессами, благоприятно действует на свертываемость крови и укрепляет иммунитет.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '622', '26,3', '45,2', '9,9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
