('TC-1-7-028', 1, 5199, '', '', 'Грецкий орех', 'Грецкий орех', 'Грецкий орех', '', 0, 0, 0, 0, '', '2017-12-1811-57-26_15-12-522223.JPG', '', '', 0, 0, 0, ' Орехи из Чили - лучший сорт грецкого ореха. Крупный,  цельный с мягким и насыщенным вкусом без горечи. Чилийский орех самый вкусный и ароматный среди грецких орехов!  Высокая калорийность позволяет быстро и легко насытиться ими, не употребив в пищу значительного количества продукта. По вкусу, можно ядра обжаривать – вкусовые качества от этого только выиграют!', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '656', '16', '60', '11', '', ';', 'Чили', 0, 'YToxOntpOjA7czowOiIiO30='),
