('TC-1-7-028', 1, 5207, '', '', 'Финик \"Калита\"', 'Финик \"Калита\" араб.', 'Финик', 'Израиль', 0, 0, 0, 0, '', '2017-12-1812-06-08_15-16-572223.JPG', '', '', 0, 0, 0, 'По мнению ученых, финики – идеальный продукт питания. Считается, что финики содержат все необходимые полезные вещества, и даже если питаться лишь финиками и водой, то можно прожить несколько лет.\n\nФиники действительно обладают широким спектром полезных качеств. Они будут полезны при усталости и переутомлении, анемии, гипертонии, параличе лицевого нерва, туберкулезе и сердечно-сосудистых заболеваниях. Кроме того они успокаивают кашель, обладают отхаркивающим, тонизирующим и укрепляющим действием, и благоприятно воздействуют на мозговую деятельность.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '274', '2,5', '0,5', '69,2', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5208, '', '', 'Нават сахар', 'Нават сахар', 'Новат', 'Узбекистан', 0, 0, 0, 0, '', '2017-12-1812-06-22_15-17-182223.JPG', '', '', 0, 0, 0, 'Нават- традиционная узбекская сладость, подаваемая к чаю. Этот кристаллизованный сахар готовят из виноградного сока и сахарного сиропа. Иногда в продукт добавляют пряности и мед.Продукт экологически чистый, не содержит красителей и консервантов.\n\n', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '390', '0', '0', '96,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5209, '', '', 'Инжир натуральный', 'Инжир натуральный', 'Инжир', 'Турция', 0, 0, 0, 0, '', '2017-12-1812-07-4422223.JPG', '', '', 0, 0, 0, 'Инжир – высокое листопадное дерево, с вкусными, очень сладкими плодами, похожими на небольшую грушу, имеющих множество мелких семян внутри.В плодах инжира содержатся витамины группы В, С, РР, А. Он богат калием, который очень позитивно влияет на работу сердечной мышцы и мягких тканей всего организма, предотвращает утомление, выводит лишнюю жидкость. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '49', '0,7', '0,2', '13,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5210, '', '', 'Инжир ветка ', 'Инжир ветка ', 'Инжир', 'Турция', 0, 0, 0, 0, '', '2017-12-1812-08-4622223.JPG', '', '', 0, 0, 0, 'Инжир – высокое листопадное дерево, с вкусными, очень сладкими плодами, похожими на небольшую грушу, имеющих множество мелких семян внутри.В плодах инжира содержатся витамины группы В, С, РР, А. Он богат калием, который очень позитивно влияет на работу сердечной мышцы и мягких тканей всего организма, предотвращает утомление', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '49', '0,7', '0,2', '13,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5211, '', '', 'Чернослив темный', 'Чернослив темный', 'Чернослив', 'Армения', 0, 0, 0, 0, '', '2017-12-1812-09-58_15-19-312223.JPG', '', '', 0, 0, 0, 'Чернослив – это высушенная слива. Этот сухофрукт обладает превосходным сладким вкусом с легкой кислинкой и высокой питательной ценностью.Чернослив обладает мочегонными свойствами, способствует выведению избытка жидкости из организма. Блюда, в состав которых входят эти сухофрукты, полезны людям, страдающим от отеков, заболеваний мочеполовой системы.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '339', '2,3', '0,7', '57', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5212, NULL, '', 'а', NULL, 'не знаю', NULL, 0, 0, 0, 0, NULL, '2017-12-1812-10-09_15-19-552223.JPG', NULL, NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5213, '', '', 'Чернослив светлый', 'Чернослив светлый', 'Чернослив', 'Армения', 0, 0, 0, 0, '', '2017-12-1812-10-4122223.JPG', '', '', 0, 0, 0, 'Благодаря изобилию балластных веществ, чернослив просто необходим для желудочно-кишечного тракта. Так, при заболеваниях желудка достаточно всего 5-6 ягод в день.Употребляя каждый день чернослив, вы не только сможете оздоровить свой организм, но и избавитесь от лишний килограммов, так как чернослив обладает хорошими диетическими свойствами и используется во многих современных диетах.\n\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '256', '2,3', '0,7', '57,5', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5214, '', '', 'Курага Джамбо светлая', 'Курага  Джамбо светлая', 'Курага', 'Турция', 0, 0, 0, 0, '', '2017-12-1812-12-41_15-20-392223.JPG', '', '', 0, 0, 0, 'Курага-один из полезнейших продуктов здорового питания, она укрепляет сердечную мышцу, улучшает работу мочевыделительной системы, щитовидной железы. Этот продукт необходим при малокровии, авитаминозе. Сушёный абрикос улучшает функцию желудочно-кишечного тракта и зрения. Общее самочувствие и тонус улучшаются при введении кураги в питательный рацион.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '245', '5,0', '0,4', '5,1', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5215, '', '', 'Миндаль 23/25', 'Миндаль 23/25 \"Нонпарель\"', 'Миндаль', 'Чили', 0, 0, 0, 0, '', '2017-12-1812-12-5922223.JPG', '', '', 0, 0, 0, ' Он относится к сладким сортам миндаля, которые употребляют в пищу и используют как добавку к десертам и сладостям. Употреблять можно как жареный орех, так и в сыром виде – способ употребления меняет только вкус, но не пользу от продукта.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '649', '18,6', '57,70', '13,60', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5216, '', '', 'Фисташки не соленые', 'Фисташки не соленые сырые', 'Фисташки', 'Иран', 0, 0, 0, 0, '', '2017-12-1812-15-23_15-21-07_15-22-452223.JPG', '', '', 0, 0, 0, 'Достоинств у фисташек огромное множество.Покупайте и кушайте на здоровье!\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '556', '20,0', '50,0', '7,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5217, '', '', 'Изюм гибрид без хвост.', 'Изюм гибрид без хвостиками темный', 'Изюм', '', 0, 0, 0, 0, '', '2017-12-1812-16-33_15-22-19_15-23-182223.JPG', '', '', 0, 0, 0, 'Изюм  прекрасно подходит для укрепления нервной системы, может применяться в качестве успокоительного средства. Изюм способен снимать гнев и раздражительность, оказывать седативное действие, улучшая сон, он показан легковозбудимым людям.', '', '', 'месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '264', '0.6', '66', '2.9', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5218, '', '', 'Изюм Флайн', 'Изюм Флайн', 'Изюм ', 'Чили', 0, 0, 0, 0, '', '2017-12-1812-16-5722223.JPG', '', '', 0, 0, 0, 'Особенностью изюма является тот факт, что он не только не теряет полезные свойства свежего винограда, но и в несколько раз преумножает их.Изюм рекомендовано употреблять при нарушениях деятельности сердечной мышцы, при нервных расстройствах, бессоннице.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '264', '2,9', '0,6', '66', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
