('TC-1-7-028', 1, 5220, '', '', 'Фисташки', 'Фисташки', 'Фисташки', 'Турция', 0, 0, 0, 0, '', '2017-12-1812-17-46_15-24-322223.JPG', '', '', 0, 0, 0, 'Фисташки очень вкусны и питательны, их можно употреблять свежем либо поджаренном виде, а также солеными. Используются фисташки для изготовления некоторых сортов сыра, в колбасном и кондитерском производстве. Из ядер извлекают ценное масло, применяемое в кондитерском деле и в кулинарии.\n\n', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '556', '20,0', '50,0', '7,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5221, '', '', 'Фисташки', 'Фисташки', 'Фисташки', 'Иран', 0, 0, 0, 0, '', '2017-12-1812-18-14_15-26-092223.JPG', '', '', 0, 0, 0, 'Состав фисташек насыщен биологически активными веществами, благодаря этому они имеют массу полезных свойств. Орехи восстанавливают организм после заболеваний дыхательных путей, укрепляют сердечно-сосудистую систему, нормализуют работу желудочно-кишечного тракта, повышают остроту зрения.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '556', '20,0', '50,0', '7,0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5222, '', '', 'Банановые чипсы', 'Банановые чипсы', 'Банановые чипсы', '', 0, 0, 0, 0, '', '2017-12-1812-18-39_15-26-382223.JPG', '', '', 0, 0, 0, 'Чипсами называют хрустящие ломтики .Кроме своих вкусовых качеств, банановые чипсы обладают и полезными свойствами. Так в них в больших количествах присутствует калий и кальций, оказывающие благотворное воздействие на работу сердца, сосудов, формирование костей и зубов. Наделены они и магнием, который регулирует энергетический баланс, а фосфор содействует правильной работе центральной нервной и мочевыделительной систем. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '519', '2,3', '33,6', '50,7', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5223, '', '', 'Ореховый коктейль', 'Ореховый коктейль', 'Ореховый коктейль', 'Россия', 0, 0, 0, 0, '', '2017-12-1812-19-31_15-27-442223.JPG', '', '', 0, 0, 0, 'Ореховый коктейль из кешью, миндаля, грецкого ореха, фундука, арахиса с отборным сортом изюма черный и золотой \"Джамбо\"  без преувеличения можно назвать  здоровьеукреплящим средством. \nЗимой особенно полезно себя любимых пополнить витаминами и минералами, коих в орехах несметное количество. Ореховый коктейль порадуют вас своим качеством и сладкой ценой.', '', '	изюм джамбо \"черный\", изюм джамбо \"золотой\", фундук. грецкий орех, миндаль, кешью, арахис.', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '471', '9,2', '13,2', '38,4', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC-1-7-028', 1, 5224, '', '', 'Орех кедровый очищенный', 'Орех кедровый очищенный', 'Орех кедровый', 'Россия', 0, 0, 0, 0, '', '2017-12-1812-19-1422223.JPG', '', '', 0, 0, 0, 'Семена кедровых орехов успешно используются в кулинарии.Это очень вкусное лакомство, а если их немного поджарить, вкус и аромат станут еще ярче и выразительнее.Они являются ингредиентами в мясных, рыбных, овощных блюдах и салатах.Семена кедрового ореха удовлетворяют суточную потребность организма взрослого в аминокислотах и важнейших микроэлементах.', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '575', '13', '68', '13', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
