('TC-1-7-028', 1, 5231, '', '', 'Финики б/к', 'Финики без косточки', 'Финики', 'Ирак', 0, 0, 0, 0, '', '2017-12-1812-27-01_15-33-552223.JPG', '', '', 0, 0, 0, 'Финики - это одна из старейших выращиваемых человеком пищевых культур. В составе фиников содержатся практически все необходимые человеку полезные вещества, причем есть мнение что на исключительно финиковой диете можно спокойно прожить несколько лет. Низкая калорийность и богатые полезные свойства фиников способствуют их широкому применению в качестве диетического продукта. ', '', '', '12 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '297', '1,75', '0,3', '64,6', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
