('Рыба СЦ', 1, 5883, NULL, '', 'Масляная х/б', 'Масляная х/б', 'не знаю', 'Россия', 0, 0, 0, 0, NULL, '2017-11-1314-02-38_09-33-39.JPG', NULL, NULL, 0, 0, 0, 'Масляная рыба очень ценится в России, но не только в нашей стране живут её ценители. Масляная рыба холодного копчения обладает тонким вкусом, который ценится гурманами во всём мире. Тем более, что её мясо содержит в своём составе большое количество такого вещества, как хром, который способствует поддержанию мышечной массы в хорошем состоянии.', NULL, NULL, '30 суток', NULL, 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, NULL, '180', '18', '12', '0', NULL, ';', NULL, 0, 'YToxOntpOjA7czowOiIiO30='),
