('TC1-3-028', 1, 5901, '', '', 'Колбаса рубленная', 'Колбаса боярская рубленная', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-11-1615-02-38_13-46-42.JPG', '', '', 0, 0, 0, 'Потрясающе вкусная колбаса из охлажденной российской свинины. Мясо, мясо и еще раз мясо – это о нашей Боярской. Колбаса самого настоящего мясного вкуса, с гармоничной ноткой черного и душистого перца и чеснока. Углеводов – ноль!', '', ' свинина, соль, перец черный молотый стабилизаторы - полифосфаты, сахар, усилитель вкуса – глутамат натрия, антиокислитель – изоаскорбат натрия, кориандр, кардамон, чеснок, ароматизаторы идентичные натуральным, лактоза, декстроза, консервант- фиксатор окраски – нитрит натрия', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '156', '12', '12', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
