('TC1-3-028', 1, 5903, '', '', 'Колбаса домашняя в/с', 'Колбаса домашняя в/с', 'Свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-06-39_13-45-07.JPG', '', '', 0, 0, 0, 'Белорусская кухня издревле славится вкуснейшими мясными изделиями и особенно колбасами.Это домашняя колбаса подают ее как правило на праздничные застолье.', '', '', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '328', '11,8', '29,9', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5904, '', '', 'Окорок по тамбовски', 'Окорок по тамбовски', 'Свинина', 'Россия', 0, 0, 0, 0, '', '2017-11-1615-07-32_13-43-26.JPG', '', '', 0, 0, 0, 'Окорок Тамбовский  – завтрак без вкусного бутерброда – это не завтрак! А настоящий, вкусный бутерброд обязательно должен дополняться ломтиком этой замечательной ветчины, под названием окорок По-Тамбовски . Он изготовлен из отборного мяса, и душистых специй, отличается превосходным вкусом и ярким ароматом.', '', 'Окорок свиной, соль, сахар, специи.', '15 суток', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '357', '15,3', '33,0', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
