('TC1-3-028', 1, 5907, '', '', 'Колбаса божоле охотничья', 'Колбаса божоле охотничья', 'Свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-18-5813-35-02.JPG', 'шт', '350 г', 0, 0, 0, 'Благодаря своему составу «Охотничьи» имеют невероятный пряно-копченый с оттенком чеснока аромат и вкус. Качественные охотничьи колбаски имеют натуральную оболочку равномерного цвета. На ощупь они сухие и плотные (упругие).Колбаса Божоле с дымком - это колбаса с ароматом дыма, сыро-вяленая. Произведена из натуральной свинины, без добавления сои.', '', ' Свинина,соль,лактоза,перец,чеснок,мускатный орех, консервант, ферменты, натуральная оболочка,Е 252.', '', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '326', '27,4', '24,3', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5908, '', '', 'Оленина прослойка ', 'Оленина прослойка ', 'Оленина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-19-0413-34-17.JPG', '', '', 0, 0, 0, 'Настоящим деликатесом является оленина сырокопченая. Этот готовый продукт обладает оригинальным и очень изысканным вкусом, который придется по вкусу даже искушенным гурманам.', '', '', '6 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '154', '19,5', '8,5', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5909, '', '', 'Хамон по итальянский ', 'Хамон по итальянский ', 'Свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-19-1013-33-06.JPG', '', '', 0, 0, 0, ' Сыровяленая колбаса из мяса свинины высшего качества, изготовленная по традиционной технологии. Снаружи такие колбасы покрыты благородной белой плесенью, которая образуется в период \"дозревания\" колбас. \nЭта плесень придает колбаске изысканный аромат и привкус.\n', '', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '250', '18', '45', '2,1', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5910, '', '', 'Оленина шахмат вяленая ', 'Оленина шахмат вяленая ', 'Оленина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-115-19-1513-32-07.JPG', '', '', 0, 0, 0, 'Мясо оленя является деликатесом.Вяленая оленина – отличная закуска. Ее употребляют как самостоятельное блюдо.Уникальный вкус мяса оленины дополняют легкие нотки копчености.\n', '', 'Мясо северного оленя, соль, специи.', '4 месяцев', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '', '', '', '', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5911, '', '', 'Колбаса оленина', 'Колбаса оленина   свининина', 'Оленина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-19-2313-31-25.JPG', '', '', 0, 0, 0, ' К числу наиболее деликатесных видов может быть отнесена колбаса сырокопченая.она имеет специфический, очень привлекательный аромат и изысканный вкус, который наверняка оценят даже самые бывалые гурманы.', '500-600 гр.', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '190', '25', '10', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5912, '', '', 'Колбаса оленина   свин.', 'Колбаса оленина   свининой шпик', 'Оленина+свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-19-2813-30-17.JPG', '', '', 0, 0, 0, 'Этот продукт отличается привлекательным солоноватым вкусом и соблазнительным, моментально пробуждающий аппетит ароматом., в состав продукта колбаса из оленины, помимо основного ингредиента входит мелко нарубленный шпик и натуральные специи. Эти добавки придают изделию большую нежность и непередаваемый аромат.', '500 -600 гр.', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '198', '25', '10', '0', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('TC1-3-028', 1, 5913, '', '', 'Колбаса оленина   свин.', 'Колбаса оленина   свининой шпик', 'Оленина+свинина', 'Беларусь', 0, 0, 0, 0, '', '2017-11-1615-20-0613-28-31.JPG', '', '', 0, 0, 0, 'Колбаса, приготовленная из вкуснейшего оленьего мяса,с довавлением свиного шпига нередко служит основой для приготовления самых разнообразных деликатесных блюд.  Ароматная ягодная настойка, а также красное вино - это напитки, которые лучше всего сочетаются с вкусной колбасой из оленины. Превосходно сочетается она и с пивом. И даже входит в состав тапаса - замечательной закуски к янтарному пенному напитку. ', '', '', '4 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '190', '25', '10', '0', '', ';', '', 1, 'YToxOntpOjA7czowOiIiO30='),
