('Рыба С Ц', 1, 5915, '', '', 'Лангустины б/г', 'Лангустины б/г Аргентинская креветка', 'не знаю', 'Австралия', 0, 0, 0, 0, '', '2017-12-0815-38-28_20-28-38.JPG', '', '', 0, 0, 0, 'Лангустины имеют тонкий ни с чем не сравнимый приятный вкус, что делает их одним из наиболее предпочитаемых морских деликатесов в мире. Это изысканное лакомство для настоящих гурманов! ', '2 кг.', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '112', '20,6', '1,151', '2,430', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
('Рыба С Ц', 1, 5916, '', '', 'Лангустины', 'Лангустины с головой свемороженые', 'не знаю', 'Австралия', 0, 0, 0, 0, '', '201712-08153456_20-39-15.JPG', '', '', 0, 0, 0, 'Лангустины – это ближайшие родственники лангустов.Нежный и изысканный вкус мяса  высоко оценен европейскими гурманами. Мясо содержится преимущественно в хвосте. А вкус, не передать словами.', '1 кг.', '', '24 месяца', '', 0, 0, 0, '0000-00-00', '0000-00-00', 1, 1, '', '112', '20,6', '1,51', '2,43', '', ';', '', 0, 'YToxOntpOjA7czowOiIiO30='),
